INSERT INTO `movie` VALUES (1,237000000,'http://www.avatarmovie.com/',19995,'en','Avatar','In the 22nd century, a paraplegic Marine is dispatched to the moon Pandora on a unique mission, but becomes torn between following orders and protecting an alien civilization.',150.437577,2787965087,162,'Enter the World of Pandora.','Avatar',7.2,11800),(2,300000000,'http://disney.go.com/disneypictures/pirates/',285,'en','Pirates of the Caribbean: At World\'s End','Captain Barbossa, long believed to be dead, has come back to life and is headed to the edge of the Earth with Will Turner and Elizabeth Swann. But nothing is quite as it seems.',139.082615,961000000,169,'At the end of the world, the adventure begins.','Pirates of the Caribbean: At World\'s End',6.9,4500),(3,245000000,'http://www.sonypictures.com/movies/spectre/',206647,'en','Spectre','A cryptic message from Bond’s past sends him on a trail to uncover a sinister organization. While M battles political forces to keep the secret service alive, Bond peels back the layers of deceit to reveal the terrible truth behind SPECTRE.',107.376788,880674609,148,'A Plan No One Escapes','Spectre',6.3,4466),(4,250000000,'http://www.thedarkknightrises.com/',49026,'en','The Dark Knight Rises','Following the death of District Attorney Harvey Dent, Batman assumes responsibility for Dent\'s crimes to protect the late attorney\'s reputation and is subsequently hunted by the Gotham City Police Department. Eight years later, Batman encounters the mysterious Selina Kyle and the villainous Bane, a new terrorist leader who overwhelms Gotham\'s finest. The Dark Knight resurfaces to protect a city that has branded him an enemy.',112.312950,1084939099,165,'The Legend Ends','The Dark Knight Rises',7.6,9106),(5,260000000,'http://movies.disney.com/john-carter',49529,'en','John Carter','John Carter is a war-weary, former military captain who\'s inexplicably transported to the mysterious and exotic planet of Barsoom (Mars) and reluctantly becomes embroiled in an epic conflict. It\'s a world on the brink of collapse, and Carter rediscovers his humanity when he realizes the survival of Barsoom and its people rests in his hands.',43.926995,284139100,132,'Lost in our world, found in another.','John Carter',6.1,2124),(6,258000000,'http://www.sonypictures.com/movies/spider-man3/',559,'en','Spider-Man 3','The seemingly invincible Spider-Man goes up against an all-new crop of villain – including the shape-shifting Sandman. While Spider-Man’s superpowers are altered by an alien organism, his alter ego, Peter Parker, deals with nemesis Eddie Brock and also gets caught up in a love triangle.',115.699814,890871626,139,'The battle within.','Spider-Man 3',5.9,3576),(7,260000000,'http://disney.go.com/disneypictures/tangled/',38757,'en','Tangled','When the kingdom\'s most wanted-and most charming-bandit Flynn Rider hides out in a mysterious tower, he\'s taken hostage by Rapunzel, a beautiful and feisty tower-bound teen with 70 feet of magical, golden hair. Flynn\'s curious captor, who\'s looking for her ticket out of the tower where she\'s been locked away for years, strikes a deal with the handsome thief and the unlikely duo sets off on an action-packed escapade, complete with a super-cop horse, an over-protective chameleon and a gruff gang of pub thugs.',48.681969,591794936,100,'They\'re taking adventure to new lengths.','Tangled',7.4,3330),(8,280000000,'http://marvel.com/movies/movie/193/avengers_age_of_ultron',99861,'en','Avengers: Age of Ultron','When Tony Stark tries to jumpstart a dormant peacekeeping program, things go awry and Earth’s Mightiest Heroes are put to the ultimate test as the fate of the planet hangs in the balance. As the villainous Ultron emerges, it is up to The Avengers to stop him from enacting his terrible plans, and soon uneasy alliances and unexpected action pave the way for an epic and unique global adventure.',134.279229,1405403694,141,'A New Age Has Come.','Avengers: Age of Ultron',7.3,6767),(9,250000000,'http://harrypotter.warnerbros.com/harrypotterandthehalf-bloodprince/dvd/index.html',767,'en','Harry Potter and the Half-Blood Prince','As Harry begins his sixth year at Hogwarts, he discovers an old book marked as \'Property of the Half-Blood Prince\', and begins to learn more about Lord Voldemort\'s dark past.',98.885637,933959197,153,'Dark Secrets Revealed','Harry Potter and the Half-Blood Prince',7.4,5293),(10,250000000,'http://www.batmanvsupermandawnofjustice.com/',209112,'en','Batman v Superman: Dawn of Justice','Fearing the actions of a god-like Super Hero left unchecked, Gotham City’s own formidable, forceful vigilante takes on Metropolis’s most revered, modern-day savior, while the world wrestles with what sort of hero it really needs. And with Batman and Superman at war with one another, a new threat quickly arises, putting mankind in greater danger than it’s ever known before.',155.790452,873260194,151,'Justice or revenge','Batman v Superman: Dawn of Justice',5.7,7004),(11,270000000,'http://www.superman.com',1452,'en','Superman Returns','Superman returns to discover his 5-year absence has allowed Lex Luthor to walk free, and that those he was closest too felt abandoned and have moved on. Luthor plots his ultimate revenge that could see millions killed and change the face of the planet forever, as well as ridding himself of the Man of Steel.',57.925623,391081192,154,NULL,'Superman Returns',5.4,1400),(12,200000000,'http://www.mgm.com/view/movie/234/Quantum-of-Solace/',10764,'en','Quantum of Solace','Quantum of Solace continues the adventures of James Bond after Casino Royale. Betrayed by Vesper, the woman he loved, 007 fights the urge to make his latest mission personal. Pursuing his determination to uncover the truth, Bond and M interrogate Mr. White, who reveals that the organization that blackmailed Vesper is far more complex and dangerous than anyone had imagined.',107.928811,586090727,106,'For love, for hate, for justice, for revenge.','Quantum of Solace',6.1,2965),(13,200000000,'http://disney.go.com/disneypictures/pirates/',58,'en','Pirates of the Caribbean: Dead Man\'s Chest','Captain Jack Sparrow works his way out of a blood debt with the ghostly Davey Jones, he also attempts to avoid eternal damnation.',145.847379,1065659812,151,'Jack is back!','Pirates of the Caribbean: Dead Man\'s Chest',7.0,5246),(14,255000000,'http://disney.go.com/the-lone-ranger/',57201,'en','The Lone Ranger','The Texas Rangers chase down a gang of outlaws led by Butch Cavendish, but the gang ambushes the Rangers, seemingly killing them all. One survivor is found, however, by an American Indian named Tonto, who nurses him back to health. The Ranger, donning a mask and riding a white stallion named Silver, teams up with Tonto to bring the unscrupulous gang and others of that ilk to justice.',49.046956,89289910,149,'Never Take Off the Mask','The Lone Ranger',5.9,2311),(15,225000000,'http://www.manofsteel.com/',49521,'en','Man of Steel','A young boy learns that he has extraordinary powers and is not of this earth. As a young man, he journeys to discover where he came from and what he was sent here to do. But the hero in him must emerge if he is to save the world from annihilation and become the symbol of hope for all mankind.',99.398009,662845518,143,'You will believe that a man can fly.','Man of Steel',6.5,6359),(16,225000000,NULL,2454,'en','The Chronicles of Narnia: Prince Caspian','One year after their incredible adventures in the Lion, the Witch and the Wardrobe, Peter, Edmund, Lucy and Susan Pevensie return to Narnia to aid a young prince whose life has been threatened by the evil King Miraz. Now, with the help of a colorful cast of new characters, including Trufflehunter the badger and Nikabrik the dwarf, the Pevensie clan embarks on an incredible quest to ensure that Narnia is returned to its rightful heir.',53.978602,419651413,150,'Hope has a new face.','The Chronicles of Narnia: Prince Caspian',6.3,1630),(17,220000000,'http://marvel.com/avengers_movie/',24428,'en','The Avengers','When an unexpected enemy emerges and threatens global safety and security, Nick Fury, director of the international peacekeeping agency known as S.H.I.E.L.D., finds himself in need of a team to pull the world back from the brink of disaster. Spanning the globe, a daring recruitment effort begins!',144.448633,1519557910,143,'Some assembly required.','The Avengers',7.4,11776),(18,380000000,'http://disney.go.com/pirates/index-on-stranger-tides.html#/video/',1865,'en','Pirates of the Caribbean: On Stranger Tides','Captain Jack Sparrow crosses paths with a woman from his past, and he\'s not sure if it\'s love -- or if she\'s a ruthless con artist who\'s using him to find the fabled Fountain of Youth. When she forces him aboard the Queen Anne\'s Revenge, the ship of the formidable pirate Blackbeard, Jack finds himself on an unexpected adventure in which he doesn\'t know who to fear more: Blackbeard or the woman from his past.',135.413856,1045713802,136,'Live Forever Or Die Trying.','Pirates of the Caribbean: On Stranger Tides',6.4,4948),(19,225000000,'http://www.sonypictures.com/movies/meninblack3/',41154,'en','Men in Black 3','Agents J (Will Smith) and K (Tommy Lee Jones) are back...in time. J has seen some inexplicable things in his 15 years with the Men in Black, but nothing, not even aliens, perplexes him as much as his wry, reticent partner. But when K\'s life and the fate of the planet are put at stake, Agent J will have to travel back in time to put things right. J discovers that there are secrets to the universe that K never told him - secrets that will reveal themselves as he teams up with the young Agent K (Josh Brolin) to save his partner, the agency, and the future of humankind.',52.035179,624026776,106,'They are back... in time.','Men in Black 3',6.2,4160),(20,250000000,'http://www.thehobbit.com/',122917,'en','The Hobbit: The Battle of the Five Armies','Immediately after the events of The Desolation of Smaug, Bilbo and the dwarves try to defend Erebor\'s mountain of treasure from others who claim it: the men of the ruined Laketown and the elves of Mirkwood. Meanwhile an army of Orcs led by Azog the Defiler is marching on Erebor, fueled by the rise of the dark lord Sauron. Dwarves, elves and men must unite, and the hope for Middle-Earth falls into Bilbo\'s hands.',120.965743,956019788,144,'Witness the defining chapter of the Middle-Earth saga','The Hobbit: The Battle of the Five Armies',7.1,4760),(21,215000000,'http://www.theamazingspiderman.com',1930,'en','The Amazing Spider-Man','Peter Parker is an outcast high schooler abandoned by his parents as a boy, leaving him to be raised by his Uncle Ben and Aunt May. Like most teenagers, Peter is trying to figure out who he is and how he got to be the person he is today. As Peter discovers a mysterious briefcase that belonged to his father, he begins a quest to understand his parents\' disappearance – leading him directly to Oscorp and the lab of Dr. Curt Connors, his father\'s former partner. As Spider-Man is set on a collision course with Connors\' alter ego, The Lizard, Peter will make life-altering choices to use his powers and shape his destiny to become a hero.',89.866276,752215857,136,'The untold story begins.','The Amazing Spider-Man',6.5,6586),(22,200000000,'http://www.robinhoodthemovie.com/',20662,'en','Robin Hood','When soldier Robin happens upon the dying Robert of Loxley, he promises to return the man\'s sword to his family in Nottingham. There, he assumes Robert\'s identity; romances his widow, Marion; and draws the ire of the town\'s sheriff and King John\'s henchman, Godfrey.',37.668301,310669540,140,'Rise and rise again, until lambs become lions.','Robin Hood',6.2,1398),(23,250000000,'http://www.thehobbit.com/',57158,'en','The Hobbit: The Desolation of Smaug','The Dwarves, Bilbo and Gandalf have successfully escaped the Misty Mountains, and Bilbo has gained the One Ring. They all continue their journey to get their gold back from the Dragon, Smaug.',94.370564,958400000,161,'Beyond darkness... beyond desolation... lies the greatest danger of all.','The Hobbit: The Desolation of Smaug',7.6,4524),(24,180000000,'http://www.goldencompassmovie.com/index_german.html',2268,'en','The Golden Compass','After overhearing a shocking secret, precocious orphan Lyra Belacqua trades her carefree existence roaming the halls of Jordan College for an otherworldly adventure in the far North, unaware that it\'s part of her destiny.',42.990906,372234864,113,'There are worlds beyond our own - the compass will show the way.','The Golden Compass',5.8,1303),(25,207000000,NULL,254,'en','King Kong','In 1933 New York, an overly ambitious movie producer coerces his cast and hired ship crew to travel to mysterious Skull Island, where they encounter Kong, a giant ape who is immediately smitten with the leading lady.',61.226010,550000000,187,'The eighth wonder of the world.','King Kong',6.6,2337),(26,200000000,'http://www.titanicmovie.com',597,'en','Titanic','84 years later, a 101-year-old woman named Rose DeWitt Bukater tells the story to her granddaughter Lizzy Calvert, Brock Lovett, Lewis Bodine, Bobby Buell and Anatoly Mikailavich on the Keldysh about her life set in April 10th 1912, on a ship called Titanic when young Rose boards the departing ship with the upper-class passengers and her mother, Ruth DeWitt Bukater, and her fiancé, Caledon Hockley. Meanwhile, a drifter and artist named Jack Dawson and his best friend Fabrizio De Rossi win third-class tickets to the ship in a game. And she explains the whole story from departure until the death of Titanic on its first and last voyage April 15th, 1912 at 2:20 in the morning.',100.025899,1845034188,194,'Nothing on Earth could come between them.','Titanic',7.5,7562),(27,250000000,'http://marvel.com/captainamericapremiere',271110,'en','Captain America: Civil War','Following the events of Age of Ultron, the collective governments of the world pass an act designed to regulate all superhuman activity. This polarizes opinion amongst the Avengers, causing two factions to side with Iron Man or Captain America, which causes an epic battle between former allies.',198.372395,1153304495,147,'Divided We Fall','Captain America: Civil War',7.1,7241),(28,209000000,NULL,44833,'en','Battleship','When mankind beams a radio signal into space, a reply comes from ‘Planet G’, in the form of several alien crafts that splash down in the waters off Hawaii. Lieutenant Alex Hopper is a weapons officer assigned to the USS John Paul Jones, part of an international naval coalition which becomes the world\'s last hope for survival as they engage the hostile alien force of unimaginable strength. While taking on the invaders, Hopper must also try to live up to the potential his brother, and his fiancée\'s father, Admiral Shane, expect of him.',64.928382,303025485,131,'The Battle for Earth Begins at Sea','Battleship',5.5,2114),(29,150000000,'http://www.jurassicworld.com/',135397,'en','Jurassic World','Twenty-two years after the events of Jurassic Park, Isla Nublar now features a fully functioning dinosaur theme park, Jurassic World, as originally envisioned by John Hammond.',418.708552,1513528810,124,'The park is open.','Jurassic World',6.5,8662),(30,200000000,'http://www.skyfall-movie.com',37724,'en','Skyfall','When Bond\'s latest assignment goes gravely wrong and agents around the world are exposed, MI6 is attacked forcing M to relocate the agency. These events cause her authority and position to be challenged by Gareth Mallory, the new Chairman of the Intelligence and Security Committee. With MI6 now compromised from both inside and out, M is left with one ally she can trust: Bond. 007 takes to the shadows - aided only by field agent, Eve - following a trail to the mysterious Silva, whose lethal and hidden motives have yet to reveal themselves.',93.004993,1108561013,143,'Think on your sins.','Skyfall',6.9,7604),(31,200000000,'http://www.sonypictures.com/movies/spider-man2/',558,'en','Spider-Man 2','Peter Parker is going through a major identity crisis. Burned out from being Spider-Man, he decides to shelve his superhero alter ego, which leaves the city suffering in the wake of carnage left by the evil Doc Ock. In the meantime, Parker still can\'t act on his feelings for Mary Jane Watson, a girl he\'s loved since childhood.',35.149586,783766341,127,'There\'s a hero in all of us.','Spider-Man 2',6.7,4321),(32,200000000,'http://marvel.com/ironman3',68721,'en','Iron Man 3','When Tony Stark\'s world is torn apart by a formidable terrorist called the Mandarin, he starts an odyssey of rebuilding and retribution.',77.682080,1215439994,130,'Unleash the power behind the armor.','Iron Man 3',6.8,8806),(33,200000000,'http://disney.go.com/wonderland/',12155,'en','Alice in Wonderland','Alice, an unpretentious and individual 19-year-old, is betrothed to a dunce of an English nobleman. At her engagement party, she escapes the crowd to consider whether to go through with the marriage and falls down a hole in the garden after spotting an unusual rabbit. Arriving in a strange and surreal place called \'Underland,\' she finds herself in a world that resembles the nightmares she had as a child, filled with talking animals, villainous queens and knights, and frumious bandersnatches. Alice realizes that she is there for a reason – to conquer the horrific Jabberwocky and restore the rightful queen to her throne.',78.530105,1025491110,108,'You\'re invited to a very important date.','Alice in Wonderland',6.4,4645),(34,210000000,NULL,36668,'en','X-Men: The Last Stand','When a cure is found to treat mutations, lines are drawn amongst the X-Men and The Brotherhood, a band of powerful mutants organized under Xavier\'s former ally, Magneto.',3.857526,459359555,104,'Take a Stand','X-Men: The Last Stand',6.3,3525),(35,200000000,NULL,62211,'en','Monsters University','A look at the relationship between Mike and Sulley during their days at Monsters University — when they weren\'t necessarily the best of friends.',89.186492,743559607,104,'School never looked this scary.','Monsters University',7.0,3528),(36,150000000,'http://www.transformersmovie.com/',8373,'en','Transformers: Revenge of the Fallen','Sam Witwicky leaves the Autobots behind for a normal life. But when his mind is filled with cryptic symbols, the Decepticons target him and he is dragged back into the Transformers\' war.',21.939663,836297228,150,'Revenge is coming.','Transformers: Revenge of the Fallen',6.0,3138),(37,210000000,'http://www.transformersmovie.com',91314,'en','Transformers: Age of Extinction','As humanity picks up the pieces, following the conclusion of \"Transformers: Dark of the Moon,\" Autobots and Decepticons have all but vanished from the face of the planet. However, a group of powerful, ingenious businessman and scientists attempt to learn from past Transformer incursions and push the boundaries of technology beyond what they can control - all while an ancient, powerful Transformer menace sets Earth in his cross-hairs.',116.840296,1091405097,165,'This is not war. It\'s extinction.','Transformers: Age of Extinction',5.8,3095),(38,200000000,'http://www.ozthegreatandpowerfulmovie.com',68728,'en','Oz: The Great and Powerful','Oscar Diggs, a small-time circus illusionist and con-artist, is whisked from Kansas to the Land of Oz where the inhabitants assume he\'s the great wizard of prophecy, there to save Oz from the clutches of evil.',46.985445,491868548,130,'In Oz, nothing is what it seems','Oz: The Great and Powerful',5.7,3530),(39,200000000,'http://www.theamazingspiderman.com',102382,'en','The Amazing Spider-Man 2','For Peter Parker, life is busy. Between taking out the bad guys as Spider-Man and spending time with the person he loves, Gwen Stacy, high school graduation cannot come quickly enough. Peter has not forgotten about the promise he made to Gwen’s father to protect her by staying away, but that is a promise he cannot keep. Things will change for Peter when a new villain, Electro, emerges, an old friend, Harry Osborn, returns, and Peter uncovers new clues about his past.',89.270217,705717432,142,'No more secrets.','The Amazing Spider-Man 2',6.5,4179),(40,170000000,'http://disney.go.com/tron/',20526,'en','TRON: Legacy','Sam Flynn, the tech-savvy and daring son of Kevin Flynn, investigates his father\'s disappearance and is pulled into The Grid. With the help of a mysterious program named Quorra, Sam quests to stop evil dictator Clu from crossing into the real world.',73.795050,400062763,125,'The Game Has Changed.','TRON: Legacy',6.3,2841),(41,200000000,'http://www.disney.go.com/cars/',49013,'en','Cars 2','Star race car Lightning McQueen and his pal Mater head overseas to compete in the World Grand Prix race. But the road to the championship becomes rocky as Mater gets caught up in an intriguing adventure of his own: international espionage.',49.986590,559852396,106,'Ka-ciao!','Cars 2',5.8,2033),(42,200000000,'http://greenlanternmovie.warnerbros.com/',44912,'en','Green Lantern','For centuries, a small but powerful force of warriors called the Green Lantern Corps has sworn to keep intergalactic order. Each Green Lantern wears a ring that grants him superpowers. But when a new enemy called Parallax threatens to destroy the balance of power in the Universe, their fate and the fate of Earth lie in the hands of the first human ever recruited.',51.872839,219851172,114,'In our darkest hour, there will be light.','Green Lantern',5.1,2487),(43,200000000,'http://disney.go.com/toystory/',10193,'en','Toy Story 3','Woody, Buzz, and the rest of Andy\'s toys haven\'t been played with in years. With Andy about to go to college, the gang find themselves accidentally left at a nefarious day care center. The toys must band together to escape and return home to Andy.',59.995418,1066969703,103,'No toy gets left behind.','Toy Story 3',7.6,4597),(44,200000000,'https://www.warnerbros.com/terminator-salvation',534,'en','Terminator Salvation','All grown up in post-apocalyptic 2018, John Connor must lead the resistance of humans against the increasingly dominating militaristic robots. But when Marcus Wright appears, his existence confuses the mission as Connor tries to determine whether Wright has come from the future or the past -- and whether he\'s friend or foe.',71.862892,371353001,115,'The End Begins.','Terminator Salvation',5.9,2463),(45,190000000,'http://www.furious7.com/',168259,'en','Furious 7','Deckard Shaw seeks revenge against Dominic Toretto and his family for his comatose brother.',102.322217,1506249360,137,'Vengeance Hits Home','Furious 7',7.3,4176),(46,200000000,'http://www.worldwarzmovie.com',72190,'en','World War Z','Life for former United Nations investigator Gerry Lane and his family seems content. Suddenly, the world is plagued by a mysterious infection turning whole human populations into rampaging mindless zombies. After barely escaping the chaos, Lane is persuaded to go on a mission to investigate this disease. What follows is a perilous trek around the world where Lane must brave horrific dangers and long odds to find answers before human civilization falls.',81.834855,531865000,116,'Remember Philly!','World War Z',6.7,5560),(47,250000000,'http://www.x-menmovies.com/',127585,'en','X-Men: Days of Future Past','The ultimate X-Men ensemble fights a war for the survival of the species across two time periods as they join forces with their younger selves in an epic battle that must change the past – to save our future.',118.078691,747862775,131,'To save the future, they must alter the past','X-Men: Days of Future Past',7.5,6032),(48,190000000,NULL,54138,'en','Star Trek Into Darkness','When the crew of the Enterprise is called back home, they find an unstoppable force of terror from within their own organization has detonated the fleet and everything it stands for, leaving our world in a state of crisis.  With a personal score to settle, Captain Kirk leads a manhunt to a war-zone world to capture a one man weapon of mass destruction. As our heroes are propelled into an epic chess game of life and death, love will be challenged, friendships will be torn apart, and sacrifices must be made for the only family Kirk has left: his crew.',78.291018,467365246,132,'Earth Will Fall','Star Trek Into Darkness',7.4,4418),(49,195000000,'http://jackthegiantkiller.warnerbros.com',81005,'en','Jack the Giant Slayer','The story of an ancient war that is reignited when a young farmhand unwittingly opens a gateway between our world and a fearsome race of giants. Unleashed on the Earth for the first time in centuries, the giants strive to reclaim the land they once lost, forcing the young man, Jack into the battle of his life to stop them. Fighting for a kingdom, its people, and the love of a brave princess, he comes face to face with the unstoppable warriors he thought only existed in legend–and gets the chance to become a legend himself.',43.349855,197687603,114,'Prepare for a giant adventure','Jack the Giant Slayer',5.5,2598),(50,105000000,NULL,64682,'en','The Great Gatsby','An adaptation of F. Scott Fitzgerald\'s Long Island-set novel, where Midwesterner Nick Carraway is lured into the lavish world of his neighbor, Jay Gatsby. Soon enough, however, Carraway will see through the cracks of Gatsby\'s nouveau riche existence, where obsession, madness, and tragedy await.',61.196071,351040419,143,'Reserving judgments is a matter of infinite hope... I come to the admission that it has a limit.','The Great Gatsby',7.3,3769),(51,150000000,'http://disney.go.com/disneypictures/princeofpersia',9543,'en','Prince of Persia: The Sands of Time','A rogue prince reluctantly joins forces with a mysterious princess and together, they race against dark forces to safeguard an ancient dagger capable of releasing the Sands of Time – gift from the gods that can reverse time and allow its possessor to rule the world.',62.169881,335154643,116,'Defy the Future','Prince of Persia: The Sands of Time',6.2,2317),(52,180000000,'http://www.pacificrimmovie.com/',68726,'en','Pacific Rim','When legions of monstrous creatures, known as Kaiju, started rising from the sea, a war began that would take millions of lives and consume humanity\'s resources for years on end. To combat the giant Kaiju, a special type of weapon was devised: massive robots, called Jaegers, which are controlled simultaneously by two pilots whose minds are locked in a neural bridge. But even the Jaegers are proving nearly defenseless in the face of the relentless Kaiju. On the verge of defeat, the forces defending mankind have no choice but to turn to two unlikely heroes—a washed-up former pilot (Charlie Hunnam) and an untested trainee (Rinko Kikuchi)—who are teamed to drive a legendary but seemingly obsolete Jaeger from the past. Together, they stand as mankind\'s last hope against the mounting apocalypse.',56.523205,407602906,131,'To Fight Monsters, We Created Monsters','Pacific Rim',6.7,4794),(53,195000000,'http://www.transformersmovie.com/',38356,'en','Transformers: Dark of the Moon','Sam Witwicky takes his first tenuous steps into adulthood while remaining a reluctant human ally of Autobot-leader Optimus Prime. The film centers around the space race between the USSR and the USA, suggesting there was a hidden Transformers role in it all that remains one of the planet\'s most dangerous secrets.',28.529607,1123746996,154,'The invasion we always feared. An enemy we never expected.','Transformers: Dark of the Moon',6.1,3299),(54,185000000,'http://www.indianajones.com/site/index.html',217,'en','Indiana Jones and the Kingdom of the Crystal Skull','Set during the Cold War, the Soviets – led by sword-wielding Irina Spalko – are in search of a crystal skull which has supernatural powers related to a mystical Lost City of Gold. After being captured and then escaping from them, Indy is coerced to head to Peru at the behest of a young man whose friend – and Indy\'s colleague – Professor Oxley has been captured for his knowledge of the skull\'s whereabouts.',75.674458,786636033,122,'The adventure continues . . .','Indiana Jones and the Kingdom of the Crystal Skull',5.7,2495),(55,175000000,'http://movies.disney.com/the-good-dinosaur',105864,'en','The Good Dinosaur','An epic journey into the world of dinosaurs where an Apatosaurus named Arlo makes an unlikely human friend.',51.692953,331926147,93,'Little Arms With Big Attitude','The Good Dinosaur',6.6,1736),(56,185000000,'http://disney.go.com/brave/#/home',62177,'en','Brave','Brave is set in the mystical Scottish Highlands, where Mérida is the princess of a kingdom ruled by King Fergus and Queen Elinor. An unruly daughter and an accomplished archer, Mérida one day defies a sacred custom of the land and inadvertently brings turmoil to the kingdom. In an attempt to set things right, Mérida seeks out an eccentric old Wise Woman and is granted an ill-fated wish. Also figuring into Mérida’s quest — and serving as comic relief — are the kingdom’s three lords: the enormous Lord MacGuffin, the surly Lord Macintosh, and the disagreeable Lord Dingwall.',125.114374,538983207,93,'Change your fate.','Brave',6.7,4641),(57,185000000,'http://www.startrekmovie.com/',188927,'en','Star Trek Beyond','The USS Enterprise crew explores the furthest reaches of uncharted space, where they encounter a mysterious new enemy who puts them and everything the Federation stands for to the test.',65.352913,343471816,122,NULL,'Star Trek Beyond',6.6,2568),(58,180000000,'http://disney.go.com/disneypictures/wall-e/',10681,'en','WALL·E','WALL·E is the last robot left on an Earth that has been overrun with garbage and all humans have fled to outer space. For 700 years he has continued to try and clean up the mess, but has developed some rather interesting human-like qualities. When a ship arrives with a sleek new type of robot, WALL·E thinks he\'s finally found a friend and stows away on the ship when it leaves.',66.390712,521311860,98,'An adventure beyond the ordinar-E.','WALL·E',7.8,6296),(59,140000000,NULL,5174,'en','Rush Hour 3','After an attempted assassination on Ambassador Han, Inspector Lee and Detective Carter are back in action as they head to Paris to protect a French woman with knowledge of the Triads\' secret leaders. Lee also holds secret meetings with a United Nations authority, but his personal struggles with a Chinese criminal mastermind named Kenji, which reveals that it\'s Lee\'s long-lost...brother.',22.571780,258022233,91,'The Rush Is On!','Rush Hour 3',6.1,783),(60,200000000,'http://www.sonypictures.com/movies/2012',14161,'en','2012','Dr. Adrian Helmsley, part of a worldwide geophysical team investigating the effect on the earth of radiation from unprecedented solar storms, learns that the earth\'s core is heating up. He warns U.S. President Thomas Wilson that the crust of the earth is becoming unstable and that without proper preparations for saving a fraction of the world\'s population, the entire race is doomed. Meanwhile, writer Jackson Curtis stumbles on the same information. While the world\'s leaders race to build \"arks\" to escape the impending cataclysm, Curtis struggles to find a way to save his family. Meanwhile, volcanic eruptions and earthquakes of unprecedented strength wreak havoc around the world.',45.274225,769653595,158,'We Were Warned.','2012',5.6,4903),(61,200000000,'http://disney.go.com/disneypictures/achristmascarol/?cmp=dcom_VAN_WDSHE_ACC_van_dcomcc__Extl',17979,'en','A Christmas Carol','Miser Ebenezer Scrooge is awakened on Christmas Eve by spirits who reveal to him his own miserable existence, what opportunities he wasted in his youth, his current cruelties, and the dire fate that awaits him if he does not change his ways. Scrooge is faced with his own story of growing bitterness and meanness, and must decide what his own future will hold: death or redemption.',39.744242,325233863,96,'Season\'s Greedings','A Christmas Carol',6.6,1095),(62,176000003,'http://www.jupiterascending.com',76757,'en','Jupiter Ascending','In a universe where human genetic material is the most precious commodity, an impoverished young Earth woman becomes the key to strategic maneuvers and internal strife within a powerful dynasty…',85.369080,183987723,124,'Expand your universe.','Jupiter Ascending',5.2,2768),(63,180000000,'http://legendoftarzan.com',258489,'en','The Legend of Tarzan','Tarzan, having acclimated to life in London, is called back to his former home in the jungle to investigate the activities at a mining encampment.',42.741719,356743061,109,'Human. Nature.','The Legend of Tarzan',5.5,2430),(64,180000000,NULL,411,'en','The Chronicles of Narnia: The Lion, the Witch and the Wardrobe','Siblings Lucy, Edmund, Susan and Peter step through a magical wardrobe and find the land of Narnia. There, the they discover a charming, once peaceful kingdom that has been plunged into eternal winter by the evil White Witch, Jadis. Aided by the wise and magnificent lion, Aslan, the children lead Narnia into a spectacular, climactic battle to be free of the Witch\'s glacial powers forever.',67.391328,748806957,143,'Evil Has Reigned For 100 Years...','The Chronicles of Narnia: The Lion, the Witch and the Wardrobe',6.7,2629),(65,178000000,'http://www.foxmovies.com/movies/x-men-apocalypse',246655,'en','X-Men: Apocalypse','After the re-emergence of the world\'s first mutant, world-destroyer Apocalypse, the X-Men must unite to defeat his extinction level plan.',139.272042,543934787,144,'Only the strong will survive','X-Men: Apocalypse',6.4,4721),(66,185000000,'http://thedarkknight.warnerbros.com/dvdsite/',155,'en','The Dark Knight','Batman raises the stakes in his war on crime. With the help of Lt. Jim Gordon and District Attorney Harvey Dent, Batman sets out to dismantle the remaining criminal organizations that plague the streets. The partnership proves to be effective, but they soon find themselves prey to a reign of chaos unleashed by a rising criminal mastermind known to the terrified citizens of Gotham as the Joker.',187.322927,1004558444,152,'Why So Serious?','The Dark Knight',8.2,12002),(67,175000000,'http://disney.go.com/disneypictures/up/',14160,'en','Up','Carl Fredricksen spent his entire life dreaming of exploring the globe and experiencing life to its fullest. But at age 78, life seems to have passed him by, until a twist of fate (and a persistent 8-year old Wilderness Explorer named Russell) gives him a new lease on life.',92.201962,735099082,96,NULL,'Up',7.7,6870),(68,175000000,'http://www.monstersvsaliens.com/',15512,'en','Monsters vs Aliens','When Susan Murphy is unwittingly clobbered by a meteor full of outer space gunk on her wedding day, she mysteriously grows to 49-feet-11-inches. The military jumps into action and captures Susan, secreting her away to a covert government compound. She is renamed Ginormica and placed in confinement with a ragtag group of Monsters...',36.167578,381509870,94,'When aliens attack, monsters fight back.','Monsters vs Aliens',6.0,1423),(69,140000000,'http://www.ironmanmovie.com/',1726,'en','Iron Man','After being held captive in an Afghan cave, billionaire engineer Tony Stark creates a unique weaponized suit of armor to fight evil.',120.725053,585174222,126,'Heroes aren\'t born. They\'re built.','Iron Man',7.4,8776),(70,170000000,'http://www.hugomovie.com/',44826,'en','Hugo','Hugo is an orphan boy living in the walls of a train station in 1930s Paris. He learned to fix clocks and other gadgets from his father and uncle which he puts to use keeping the train station clocks running. The only thing that he has left that connects him to his dead father is an automaton (mechanical man) that doesn\'t work without a special key which Hugo needs to find to unlock the secret he believes it contains. On his adventures, he meets with a shopkeeper, George Melies, who works in the train station and his adventure-seeking god-daughter. Hugo finds that they have a surprising connection to his father and the automaton, and he discovers it unlocks some memories the old man has buried inside regarding his past.',32.319043,185770160,126,'One of the most legendary directors of our time takes you on an extraordinary adventure.','Hugo',7.0,2141),(71,170000000,NULL,8487,'en','Wild Wild West','Legless Southern inventor Dr. Arliss Loveless plans to rekindle the Civil War by assassinating President U.S. Grant. Only two men can stop him: gunfighter James West and master-of-disguise and inventor Artemus Gordon. The two must team up to thwart Loveless\' plans.',40.748915,222104681,106,'It\'s a whole new west.','Wild Wild West',5.1,1020),(72,145000000,'http://www.themummy.com/',1735,'en','The Mummy: Tomb of the Dragon Emperor','Archaeologist Rick O\'Connell travels to China, pitting him against an emperor from the 2,000-year-old Han dynasty who\'s returned from the dead to pursue a quest for world domination. This time, O\'Connell enlists the help of his wife and son to quash the so-called \'Dragon Emperor\' and his abuse of supernatural power.',60.034162,401128639,112,'A New Evil Awakens.','The Mummy: Tomb of the Dragon Emperor',5.2,1387),(73,175000000,'http://www.suicidesquad.com/',297761,'en','Suicide Squad','From DC Comics comes the Suicide Squad, an antihero team of incarcerated supervillains who act as deniable assets for the United States government, undertaking high-risk black ops missions in exchange for commuted prison sentences.',90.237920,745000000,123,'Worst Heroes Ever','Suicide Squad',5.9,7458),(74,175000000,'http://www.evanalmighty.com/',2698,'en','Evan Almighty','God contacts Congressman Evan Baxter and tells him to build an ark in preparation for a great flood.',27.082182,173000000,96,'A comedy of biblical proportions','Evan Almighty',5.3,1151),(75,178000000,'http://www.edgeoftomorrowmovie.com/',137113,'en','Edge of Tomorrow','Major Bill Cage is an officer who has never seen a day of combat when he is unceremoniously demoted and dropped into combat. Cage is killed within minutes, managing to take an alpha alien down with him. He awakens back at the beginning of the same day and is forced to fight and die again... and again - as physical contact with the alien has thrown him into a time loop.',79.456485,370541256,113,'Live, Die, Repeat','Edge of Tomorrow',7.6,4858),(76,175000000,NULL,9804,'en','Waterworld','In a futuristic world where the polar ice caps have melted and made Earth a liquid planet, a beautiful barmaid rescues a mutant seafarer from a floating island prison. They escape, along with her young charge, Enola, and sail off aboard his ship. But the trio soon becomes the target of a menacing pirate who covets the map to \'Dryland\' – which is tattooed on Enola\'s back.',44.640292,264218220,135,'Beyond the horizon lies the secret to a new beginning.','Waterworld',5.9,992),(77,175000000,'http://www.gijoemovie.com/',14869,'en','G.I. Joe: The Rise of Cobra','From the Egyptian desert to deep below the polar ice caps, the elite G.I. JOE team uses the latest in next-generation spy and military equipment to fight the corrupt arms dealer Destro and the growing threat of the mysterious Cobra organization to prevent them from plunging the world into chaos.',32.852443,302469017,118,'When all else fails, they don\'t.','G.I. Joe: The Rise of Cobra',5.6,1962),(78,175000000,'http://movies.disney.com/inside-out',150540,'en','Inside Out','Growing up can be a bumpy road, and it\'s no exception for Riley, who is uprooted from her Midwest life when her father starts a new job in San Francisco. Like all of us, Riley is guided by her emotions - Joy, Fear, Anger, Disgust and Sadness. The emotions live in Headquarters, the control center inside Riley\'s mind, where they help advise her through everyday life. As Riley and her emotions struggle to adjust to a new life in San Francisco, turmoil ensues in Headquarters. Although Joy, Riley\'s main and most important emotion, tries to keep things positive, the emotions conflict on how best to navigate a new city, house and school.',128.655964,857611174,94,'Meet the little voices inside your head.','Inside Out',8.0,6560),(79,175000000,'http://movies.disney.com/the-jungle-book-2016',278927,'en','The Jungle Book','After a threat from the tiger Shere Khan forces him to flee the jungle, a man-cub named Mowgli embarks on a journey of self discovery with the help of panther, Bagheera, and free spirited bear, Baloo.',94.199316,966550600,106,NULL,'The Jungle Book',6.7,2892),(80,200000000,'http://www.ironmanmovie.com/',10138,'en','Iron Man 2','With the world now aware of his dual life as the armored superhero Iron Man, billionaire inventor Tony Stark faces pressure from the government, the press and the public to share his technology with the military. Unwilling to let go of his invention, Stark, with Pepper Potts and James \'Rhodey\' Rhodes at his side, must forge new alliances – and confront powerful enemies.',77.300194,623933331,124,'It\'s not the armor that makes the hero, but the man inside.','Iron Man 2',6.6,6849),(81,170000000,'http://www.snowwhiteandthehuntsman.com/',58595,'en','Snow White and the Huntsman','After the Evil Queen marries the King, she performs a violent coup in which the King is murdered and his daughter, Snow White, is taken captive. Almost a decade later, a grown Snow White is still in the clutches of the Queen. In order to obtain immortality, The Evil Queen needs the heart of Snow White. After Snow escapes the castle, the Queen sends the Huntsman to find her in the Dark Forest.',77.178973,396600000,127,'The Fairytale is Over','Snow White and the Huntsman',5.8,3118),(82,180000000,'http://movies.disney.com/maleficent',102651,'en','Maleficent','The untold story of Disney\'s most iconic villain from the 1959 classic \'Sleeping Beauty\'. A beautiful, pure-hearted young woman, Maleficent has an idyllic life growing up in a peaceable forest kingdom, until one day when an invading army threatens the harmony of the land.  Maleficent rises to be the land\'s fiercest protector, but she ultimately suffers a ruthless betrayal – an act that begins to turn her heart into stone. Bent on revenge, Maleficent faces an epic battle with the invading King\'s successor and, as a result, places a curse upon his newborn infant Aurora. As the child grows, Maleficent realizes that Aurora holds the key to peace in the kingdom - and to Maleficent\'s true happiness as well.',110.620647,758539785,97,'Don\'t believe the fairy tale.','Maleficent',7.0,4496),(83,170000000,'http://www.dawnofapes.com/',119450,'en','Dawn of the Planet of the Apes','A group of scientists in San Francisco struggle to stay alive in the aftermath of a plague that is wiping out humanity, while Caesar tries to maintain dominance over his community of intelligent apes.',243.791743,710644566,130,'One last chance for peace.','Dawn of the Planet of the Apes',7.3,4410),(84,27000000,NULL,79698,'en','The Lovers','The Lovers is an epic romance time travel adventure film. Helmed by Roland Joffé from a story by Ajey Jhankar, the film is a sweeping tale of an impossible love set against the backdrop of the first Anglo-Maratha war across two time periods and continents and centred around four characters — a British officer in 18th century colonial India, the Indian woman he falls deeply in love with, an American present-day marine biologist and his wife.',2.418535,NULL,109,'Love is longer than life.','The Lovers',4.8,34),(85,175000000,NULL,64686,'en','47 Ronin','Based on the original 1941 movie from Japan, and from ancient Japan’s most enduring tale, the epic 3D fantasy-adventure 47 Ronin is born.  Keanu Reeves leads the cast as Kai, an outcast who joins Oishi (Hiroyuki Sanada), the leader of the 47 outcast samurai.  Together they seek vengeance upon the treacherous overlord who killed their master and banished their kind.  To restore honor to their homeland, the warriors embark upon a quest that challenges them with a series of trials that would destroy ordinary warriors.',41.796339,150962475,119,'For courage. For loyalty. For honor.','47 Ronin',5.9,1326),(86,170000000,'http://www.captainamericathewintersoldiermovie.com',100402,'en','Captain America: The Winter Soldier','After the cataclysmic events in New York with The Avengers, Steve Rogers, aka Captain America is living quietly in Washington, D.C. and trying to adjust to the modern world. But when a S.H.I.E.L.D. colleague comes under attack, Steve becomes embroiled in a web of intrigue that threatens to put the world at risk. Joining forces with the Black Widow, Captain America struggles to expose the ever-widening conspiracy while fighting off professional assassins sent to silence him at every turn. When the full scope of the villainous plot is revealed, Captain America and the Black Widow enlist the help of a new ally, the Falcon. However, they soon find themselves up against an unexpected and formidable enemy—the Winter Soldier.',72.225265,714766572,136,'In heroes we trust.','Captain America: The Winter Soldier',7.6,5764),(87,165000000,'http://www.shrekforeverafter.com/',10192,'en','Shrek Forever After','A bored and domesticated Shrek pacts with deal-maker Rumpelstiltskin to get back to feeling like a real ogre again, but when he\'s duped and sent to a twisted version of Far Far Away—where Rumpelstiltskin is king, ogres are hunted, and he and Fiona have never met—he sets out to restore his world and reclaim his true love.',44.041186,752600867,93,'It ain\'t Ogre... Til it\'s Ogre','Shrek Forever After',6.0,1959),(88,190000000,'http://movies.disney.com/tomorrowland',158852,'en','Tomorrowland','Bound by a shared destiny, a bright, optimistic teen bursting with scientific curiosity and a former boy-genius inventor jaded by disillusionment embark on a danger-filled mission to unearth the secrets of an enigmatic place somewhere in time and space that exists in their collective memory as \"Tomorrowland.\"',130.311355,209154322,130,'Imagine a world where nothing is impossible.','Tomorrowland',6.2,2846),(89,165000000,'http://movies.disney.com/big-hero-6',177572,'en','Big Hero 6','The special bond that develops between plus-sized inflatable robot Baymax, and prodigy Hiro Hamada, who team up with a group of friends to form a band of high-tech heroes.',203.734590,652105443,102,'From the creators of Wreck-it Ralph and Frozen','Big Hero 6',7.8,6135),(90,165000000,'http://disney.go.com/wreck-it-ralph',82690,'en','Wreck-It Ralph','Wreck-It Ralph is the 9-foot-tall, 643-pound villain of an arcade video game named Fix-It Felix Jr., in which the game\'s titular hero fixes buildings that Ralph destroys. Wanting to prove he can be a good guy and not just a villain, Ralph escapes his game and lands in Hero\'s Duty, a first-person shooter where he helps the game\'s hero battle against alien invaders. He later enters Sugar Rush, a kart racing game set on tracks made of candies, cookies and other sweets. There, Ralph meets Vanellope von Schweetz who has learned that her game is faced with a dire threat that could affect the entire arcade, and one that Ralph may have inadvertently started.',62.341073,471222889,108,'The story of a regular guy just looking for a little wreck-ognition.','Wreck-It Ralph',7.1,4570),(91,165000000,NULL,5255,'en','The Polar Express','When a doubting young boy takes an extraordinary train ride to the North Pole, he embarks on a journey of self-discovery that shows him that the wonder of life never fades for those who believe.',47.323228,305875730,100,'This holiday season... believe.','The Polar Express',6.4,1474),(92,165000000,'http://www.warof1996.com',47933,'en','Independence Day: Resurgence','We always knew they were coming back. Using recovered alien technology, the nations of Earth have collaborated on an immense defense program to protect the planet. But nothing can prepare us for the aliens’ advanced and unprecedented force. Only the ingenuity of a few brave men and women can bring our world back from the brink of extinction.',48.775723,389681935,120,'We had twenty years to prepare. So did they.','Independence Day: Resurgence',4.9,2491),(93,165000000,'http://www.howtotrainyourdragon.com/',10191,'en','How to Train Your Dragon','As the son of a Viking leader on the cusp of manhood, shy Hiccup Horrendous Haddock III faces a rite of passage: he must kill a dragon to prove his warrior mettle. But after downing a feared dragon, he realizes that he no longer wants to destroy it, and instead befriends the beast – which he names Toothless – much to the chagrin of his warrior father',67.263269,494878759,98,'One adventure will change two worlds','How to Train Your Dragon',7.5,4227),(94,200000000,NULL,296,'en','Terminator 3: Rise of the Machines','It\'s been 10 years since John Connor saved Earth from Judgment Day, and he\'s now living under the radar, steering clear of using anything Skynet can trace. That is, until he encounters T-X, a robotic assassin ordered to finish what T-1000 started. Good thing Connor\'s former nemesis, the Terminator, is back to aid the now-adult Connor … just like he promised.',69.405188,435000000,109,'The Machines Will Rise.','Terminator 3: Rise of the Machines',5.9,2143),(95,170000000,'http://marvel.com/guardians',118340,'en','Guardians of the Galaxy','Light years from Earth, 26 years after being abducted, Peter Quill finds himself the prime target of a manhunt after discovering an orb wanted by Ronan the Accuser.',481.098624,773328629,121,'All heroes start somewhere.','Guardians of the Galaxy',7.9,9742),(96,165000000,'http://www.interstellarmovie.net/',157336,'en','Interstellar','Interstellar chronicles the adventures of a group of explorers who make use of a newly discovered wormhole to surpass the limitations on human space travel and conquer the vast distances involved in an interstellar voyage.',724.247784,675120017,169,'Mankind was born on Earth. It was never meant to die here.','Interstellar',8.1,10867),(97,160000000,'http://inceptionmovie.warnerbros.com/',27205,'en','Inception','Cobb, a skilled thief who commits corporate espionage by infiltrating the subconscious of his targets is offered a chance to regain his old life as payment for a task considered to be impossible: \"inception\", the implantation of another person\'s idea into a target\'s subconscious.',167.583710,825532764,148,'Your mind is the scene of the crime.','Inception',8.1,13752),(98,15000000,NULL,315011,'ja','シン・ゴジラ','From the mind behind Evangelion comes a hit larger than life.  When a massive, gilled monster emerges from the deep and tears through the city, the government scrambles to save its citizens.  A rag-tag team of volunteers cuts through a web of red tape to uncover the monster\'s weakness and its mysterious ties to a foreign superpower.  But time is not on their side - the greatest catastrophe to ever befall the world is about to evolve right before their very eyes.',9.476999,77000000,120,'A god incarnate. A city doomed.','Shin Godzilla',6.5,143),(99,250000000,'http://www.thehobbit.com/',49051,'en','The Hobbit: An Unexpected Journey','Bilbo Baggins, a hobbit enjoying his quiet life, is swept into an epic quest by Gandalf the Grey and thirteen dwarves who seek to reclaim their mountain home from Smaug, the dragon.',108.849621,1021103568,169,'From the smallest beginnings come the greatest legends.','The Hobbit: An Unexpected Journey',7.0,8297),(100,38000000,NULL,9799,'en','The Fast and the Furious','Domenic Toretto is a Los Angeles street racer suspected of masterminding a series of big-rig hijackings. When undercover cop Brian O\'Conner infiltrates Toretto\'s iconoclastic crew, he falls for Toretto\'s sister and must choose a side: the gang or the LAPD.',6.909942,207283925,106,'Live life 1/4 mile at a time.','The Fast and the Furious',6.6,3428),(101,150000000,'http://www.benjaminbutton.com/',4922,'en','The Curious Case of Benjamin Button','Tells the story of Benjamin Button, a man who starts aging backwards with bizarre consequences.',60.269279,333932083,166,'Life isn\'t measured in minutes, but in moments.','The Curious Case of Benjamin Button',7.3,3292),(102,160000000,'http://www.x-menfirstclassmovie.com/',49538,'en','X-Men: First Class','Before Charles Xavier and Erik Lensherr took the names Professor X and Magneto, they were two young men discovering their powers for the first time. Before they were arch-enemies, they were closest of friends, working together with other mutants (some familiar, some new), to stop the greatest threat the world has ever known.',3.195174,353624124,132,'Witness the moment that will change our world.','X-Men: First Class',7.1,5181),(103,160000000,'http://www.thehungergames.movie/',131634,'en','The Hunger Games: Mockingjay - Part 2','With the nation of Panem in a full scale war, Katniss confronts President Snow in the final showdown. Teamed with a group of her closest friends – including Gale, Finnick, and Peeta – Katniss goes off on a mission with the unit from District 13 as they risk their lives to stage an assassination attempt on President Snow who has become increasingly obsessed with destroying her. The mortal traps, enemies, and moral choices that await Katniss will challenge her more than any arena she faced in The Hunger Games.',127.284427,653428261,137,'The fire will burn forever.','The Hunger Games: Mockingjay - Part 2',6.6,3984),(104,150000000,'http://disney.go.com/disneypictures/sorcerersapprentice/',27022,'en','The Sorcerer\'s Apprentice','Balthazar Blake is a master sorcerer in modern-day Manhattan trying to defend the city from his arch-nemesis, Maxim Horvath. Balthazar can\'t do it alone, so he recruits Dave Stutler, a seemingly average guy who demonstrates hidden potential, as his reluctant protégé. The sorcerer gives his unwilling accomplice a crash course in the art and science of magic, and together, these unlikely partners work to stop the forces of darkness.',35.580815,215283742,109,'It\'s The Coolest Job 