 Earth is not alone','I Am Legend',6.9,4853),(118,150000000,'https://www.warnerbros.com/charlie-and-chocolate-factory',118,'en','Charlie and the Chocolate Factory','A young boy wins a tour through the most magnificent chocolate factory in the world, led by the world\'s most unusual candy maker.',53.905592,474968763,115,'Willy Wonka is semi-sweet and nuts.','Charlie and the Chocolate Factory',6.7,3624),(119,150000000,'http://disney.go.com/disneypictures/ratatouille/',2062,'en','Ratatouille','A rat named Remy dreams of becoming a great French chef despite his family\'s wishes and the obvious problem of being a rat in a decidedly rodent-phobic profession. When fate places Remy in the sewers of Paris, he finds himself ideally situated beneath a restaurant made famous by his culinary hero, Auguste Gusteau. Despite the apparent dangers of being an unlikely - and certainly unwanted - visitor in the kitchen of a fine French restaurant, Remy\'s passion for cooking soon sets into motion a hilarious and exciting rat race that turns the culinary world of Paris upside down.',65.677399,623722818,111,'He\'s dying to become a chef.','Ratatouille',7.5,4369),(120,150000000,'http://www2.warnerbros.com/batmanbegins/index.html',272,'en','Batman Begins','Driven by tragedy, billionaire Bruce Wayne dedicates his life to uncovering and defeating the corruption that plagues his home, Gotham City.  Unable to work within the system, he instead creates a new identity, a symbol of fear for the criminal underworld - The Batman.',115.040024,374218673,140,'Evil fears the knight.','Batman Begins',7.5,7359),(121,150000000,'http://www.madagascar-themovie.com',10527,'en','Madagascar: Escape 2 Africa','Alex, Marty, Melman, Gloria, King Julien, Maurice, the penguins and the chimps are back and still marooned on Madagascar. In the face of this obstacle, the New Yorkers have hatched a plan so crazy it just might work. With military precision, the penguins have repaired an old crashed plane... sort of.',44.