till lives happily with his adoptive family, the Littles, on the east side of Manhattan\'s Central Park. More crazy mouse adventures are in store as Stuart, his human brother, George, and their mischievous cat, Snowbell, set out to rescue a friend.',27.990284,169956806,78,'A Little Goes A Long Way','Stuart Little 2',5.4,613),(223,115000000,NULL,68724,'en','Elysium','In the year 2159, two classes of people exist: the very wealthy who live on a pristine man-made space station called Elysium, and the rest, who live on an overpopulated, ruined Earth. Secretary Rhodes (Jodie Foster), a hard line government ofﬁcial, will stop at nothing to enforce anti-immigration laws and preserve the luxurious lifestyle of the citizens of Elysium. That doesn’t stop the people of Earth from trying to get in, by any means they can. When unlucky Max (Matt Damon) is backed into a corner, he agrees to take on a daunting mission that, if successful, will not only save his life, but could bring equality to these polarized worlds.',67.337670,286140700,109,'He can save us all.','Elysium',6.4,3439),(224,105000000,NULL,2789,'en','The Chronicles of Riddick','After years of outrunning ruthless bounty hunters, escaped convict Riddick suddenly finds himself caught between opposing forces in a fight for the future of the human race. Now, waging incredible battles on fantastic and deadly worlds, this lone, reluctant hero will emerge as humanity\'s champion - and the last hope for a universe on the edge of annihilation.',27.835436,115772733,119,'All the power in the universe can\'t change destiny','The Chronicles of Riddick',6.3,1570),(225,120000000,'http://www.robocop.com',97020,'en','RoboCop','In RoboCop, the year is 2028 and multinational conglomerate OmniCorp is at the center of robot technology.  Overseas, their drones have been used by the military for years, but have been forbidden for law enforcement in America.  Now OmniCorp wants to bring their controversial technology to the home front, and they see a golden opportunity to do it.  When Alex Murphy – a loving husband, father and good cop doing his best to stem the tide of crime and corruption in Detroit – is critically injured, OmniCorp sees their chance to build a part-man, part-robot police officer.  OmniCorp envisions a RoboCop in every city and even more billions for their shareholders, but they never counted on one thing: there is still a man inside the machine.',66.757869,242688965,102,'We\'ve got the future under control.','RoboCop',5.7,2342),(226,120000000,'http://www.speedracerthemovie.warnerbros.com/',7459,'en','Speed Racer','Speed Racer is the tale of a young and brilliant racing driver. When corruption in the racing leagues costs his brother his life, he must team up with the police and the mysterious Racer X to bring an end to the corruption and criminal activities. Inspired by the cartoon series.',17.060695,93945766,135,'Go!','Speed Racer',5.7,354),(227,120000000,'http://www.howdoyouknow-movie.com/',42888,'en','How Do You Know','After being cut from the USA softball team and feeling a bit past her prime, Lisa finds herself evaluating her life and in the middle of a love triangle, as a corporate guy in crisis competes with her current, baseball-playing beau.',11.137655,48668907,121,'How do you know it\'s love?','How Do You Know',4.9,223),(228,117000000,'http://www.knightanddaymovie.com',37834,'en','Knight and Day','A fugitive couple goes on a glamorous and sometimes deadly adventure where nothing and no one – even themselves – are what they seem. Amid shifting alliances and unexpected betrayals, they race across the globe, with their survival ultimately hinging on the battle of truth vs. trust.',44.906918,261930431,109,'Every Hit Man Deserves a Second Shot!','Knight and Day',5.9,1547),(229,120000000,'https://www.uphe.com/movies/oblivion',75612,'en','Oblivion','Jack Harper is one of the last few drone repairmen stationed on Earth.  Part of a massive operation to extract vital resources after decades of war with a terrifying threat known as the Scavs, Jack’s mission is nearly complete.  His existence is brought crashing down when he rescues a beautiful  stranger from a downed spacecraft.  Her arrival triggers a chain of events that  forces him to question everything he knows and puts the fate of humanity in his hands.',67.698004,286168572,124,'Earth is a memory worth fighting for','Oblivion',6.4,4800),(230,113000000,'http://www.starwars.com/films/star-wars-episode-iii-revenge-of-the-sith',1895,'en','Star Wars: Episode III - Revenge of the Sith','Years after the onset of the Clone Wars, the noble Jedi Knights lead a massive clone army into a galaxy-wide battle against the Separatists. When the sinister Sith unveil a thousand-year-old plot to rule the galaxy, the Republic crumbles and from its ashes rises the evil Galactic Empire. Jedi hero Anakin Skywalker is seduced by the dark side of the Force to become the Emperor\'s new apprentice – Darth Vader. The Jedi are decimated, as Obi-Wan Kenobi and Jedi Master Yoda are forced into hiding. The only hope for the galaxy are Anakin\'s own offspring – the twin children born in secrecy who will grow up to become heroes.',44.108427,850000000,140,'The saga is complete.','Star Wars: Episode III - Revenge of the Sith',7.1,4116),(231,120000000,'http://www.starwars.com/films/star-wars-episode-ii-attack-of-the-clones',1894,'en','Star Wars: Episode II - Attack of the Clones','Ten years after the invasion of Naboo, the galaxy is on the brink of civil war. Under the leadership of a renegade Jedi named Count Dooku, thousands of solar systems threaten to break away from the Galactic Republic. When an assassination attempt is made on Senator Padmé Amidala, the former Queen of Naboo, twenty-year-old Jedi apprentice Anakin Skywalker is assigned to protect her. In the course of his mission, Anakin discovers his love for Padmé as well as his own darker side. Soon, Anakin, Padmé, and Obi-Wan Kenobi are drawn into the heart of the Separatist movement and the beginning of the Clone Wars.',43.987061,649398328,142,'A Jedi Shall Not Know Anger. Nor Hatred. Nor Love.','Star Wars: Episode II - Attack of the Clones',6.4,3992),(232,115000000,'http://movies.disney.com/monsters-inc',585,'en','Monsters, Inc.','James Sullivan and Mike Wazowski are monsters, they earn their living scaring children and are the best in the business... even though they\'re more afraid of the children than they are of them. When a child accidentally enters their world, James and Mike suddenly find that kids are not to be afraid of and they uncover a conspiracy that could threaten all children across the world.',106.815545,562816256,92,'We Scare Because We Care.','Monsters, Inc.',7.5,5996),(233,120000000,'http://www.thewolverinemovie.com',76170,'en','The Wolverine','Wolverine faces his ultimate nemesis - and tests of his physical, emotional, and mortal limits - in a life-changing voyage to modern-day Japan.',15.953444,415440673,126,'When he\'s most vulnerable, he\'s most dangerous.','The Wolverine',6.3,4053),(234,115000000,'http://www.starwars.com/films/star-wars-episode-i-the-phantom-menace',1893,'en','Star Wars: Episode I - The Phantom Menace','Anakin Skywalker, a young slave strong with the Force, is discovered on Tatooine. Meanwhile, the evil Sith have returned, enacting their plot for revenge against the Jedi.',54.035265,924317558,136,'Every generation has a legend. Every journey has a first step. Every saga has a beginning.','Star Wars: Episode I - The Phantom Menace',6.3,4432),(235,135000000,'http://www.thecroodsmovie.com/',49519,'en','The Croods','The Croods is a prehistoric comedy adventure that follows the world\'s first family as they embark on a journey of a lifetime when the cave that has always shielded them from danger is destroyed. Traveling across a spectacular landscape, the Croods discover an incredible new world filled with fantastic creatures -- and their outlook is changed forever.',64.183321,585178928,98,'Meet the first modern family.','The Croods',6.8,2399),(236,97250400,'http://www.asterixauxjeuxolympiques.com/index.php',2395,'fr','Astérix aux Jeux Olympiques','Astérix and Obélix have to win the Olympic Games in order to help their friend Alafolix marry Princess Irina (portrayed by supermodel Vanessa Hessler). Brutus (Benoît Poelvoorde) uses every trick in the book to have his own team win the game, and get rid of his father Julius Caesar (Alain Delon) in the process.',20.344364,132900000,116,NULL,'Asterix at the Olympic Games',5.0,471),(237,115000000,NULL,12100,'en','Windtalkers','Joe Enders is a gung-ho Marine assigned to protect a \"windtalker\" - one of several Navajo Indians who were used to relay messages during World War II because their spoken language was indecipherable to Japanese code breakers.',18.714197,77628265,134,'Honor Was Their Code.','Windtalkers',5.8,341),(238,115000000,'http://www.thehuntsmanmovie.com/',290595,'en','The Huntsman: Winter\'s War','As two evil sisters prepare to conquer the land, two renegades—Eric the Huntsman, who aided Snow White in defeating Ravenna in Snowwhite and the Huntsman, and his forbidden lover, Sara—set out to stop them.',60.467984,164602163,114,'The story before Snow White','The Huntsman: Winter\'s War',6.0,1523),(239,125000000,'http://www.teenagemutantninjaturtlesmovie.com',98566,'en','Teenage Mutant Ninja Turtles','The city needs heroes. Darkness has settled over New York City as Shredder and his evil Foot Clan have an iron grip on everything from the police to the politicians. The future is grim until four unlikely outcast brothers rise from the sewers and discover their destiny as Teenage Mutant Ninja Turtles. The Turtles must work with fearless reporter April and her wise-cracking cameraman Vern Fenwick to save the city and unravel Shredder\'s diabolical plan.',143.350376,477200000,101,'Mysterious. Dangerous. Reptilious. You\'ve never seen heroes like this.','Teenage Mutant Ninja Turtles',5.8,2636),(240,105000000,'http://gravitymovie.warnerbros.com/',49047,'en','Gravity','Dr. Ryan Stone, a brilliant medical engineer on her first Shuttle mission, with veteran astronaut Matt Kowalsky in command of his last flight before retiring. But on a seemingly routine spacewalk, disaster strikes. The Shuttle is destroyed, leaving Stone and Kowalsky completely alone-tethered to nothing but each other and spiraling out into the blackness of space. The deafening silence tells them they have lost any link to Earth and any chance for rescue. As fear turns to panic, every gulp of air eats away at what little oxygen is left. But the only way home may be to go further out into the terrifying expanse of space.',110.153618,716392705,91,'Don\'t Let Go','Gravity',7.3,5751),(241,116000000,NULL,9619,'en','Dante\'s Peak','Volcanologist Harry Dalton comes to the sleepy town of Dante\'s Peak to investigate the recent rumblings of the dormant volcano the burg is named for. Before long, his worst fears are realized when a massive eruption hits, and immediately, Harry, the mayor and the townspeople find themselves fighting for their lives amid a catastrophic nightmare.',16.904440,178127760,108,'The pressure is building...','Dante\'s Peak',5.7,428),(242,135000000,'http://www.teenagemutantninjaturtlesmovie.com/',308531,'en','Teenage Mutant Ninja Turtles: Out of the Shadows','After supervillain Shredder escapes custody, he joins forces with mad scientist Baxter Stockman and two dimwitted henchmen, Bebop and Rocksteady, to unleash a diabolical plan to take over the world. As the Turtles prepare to take on Shredder and his new crew, they find themselves facing an even greater evil with similar intentions: the notorious Krang.',39.873791,245623848,112,'Raise some shell.','Teenage Mutant Ninja Turtles: Out of the Shadows',5.8,963),(243,120000000,'http://www.fantasticfourmovie.com/',166424,'en','Fantastic Four','Four young outsiders teleport to a dangerous universe, which alters their physical form in shocking ways. Their lives irrevocably upended, the team must learn to harness their daunting new abilities and work together to save Earth from a former friend turned enemy.',38.126095,167977596,100,'Change is coming.','Fantastic Four',4.4,2278),(244,110000000,NULL,1593,'en','Night at the Museum','Chaos reigns at the natural history museum when night watchman Larry Daley accidentally stirs up an ancient curse, awakening Attila the Hun, an army of gladiators, a Tyrannosaurus rex and other exhibits. Larry tries desperately to keep the museum under control, but he\'s fighting a losing battle until President Teddy Roosevelt comes to the rescue.',48.780039,574480841,108,'Where History Comes To Life','Night at the Museum',6.3,2862),(245,110000000,'http://www.sanandreasmovie.com/',254128,'en','San Andreas','In the aftermath of a massive earthquake in California, a rescue-chopper pilot makes a dangerous journey across the state in order to rescue his estranged daughter.',100.412364,470490832,114,'A rescue pilot survived an earthquake, this is what happens next','San Andreas',6.0,2968),(246,110000000,'http://www.mgm.com/view/movie/2029/Tomorrow-Never-Dies/',714,'en','Tomorrow Never Dies','A deranged media mogul is staging international incidents to pit the world\'s superpowers against each other. Now 007 must take on this evil mastermind in an adrenaline-charged battle to end his reign of terror and prevent global pandemonium.',42.887121,333011068,119,'Yesterday is a memory. Today is history. Tomorrow is in the hands of one man.','Tomorrow Never Dies',6.0,925),(247,110000000,NULL,2024,'en','The Patriot','After proving himself on the field of battle in the French and Indian War, Benjamin Martin wants nothing more to do with such things, preferring the simple life of a farmer. But when his son Gabriel enlists in the army to defend their new nation, America, against the British, Benjamin reluctantly returns to his old life to protect his son.',23.657284,215294342,165,'Some things are worth fighting for.','The Patriot',6.8,1099),(248,110000000,'http://oceans12.warnerbros.com/',163,'en','Ocean\'s Twelve','Danny Ocean reunites with his old flame and the rest of his merry band of thieves in carrying out three huge heists in Rome, Paris and Amsterdam – but a Europol agent is hot on their heels.',76.840712,362744280,125,'Twelve is the new eleven.','Ocean\'s Twelve',6.4,2124),(249,110000000,NULL,787,'en','Mr. & Mrs. Smith','After five (or six) years of vanilla-wedded bliss, ordinary suburbanites John and Jane Smith are stuck in a huge rut. Unbeknownst to each other, they are both coolly lethal, highly-paid assassins working for rival organisations. When they discover they\'re each other\'s next target, their secret lives collide in a spicy, explosive mix of wicked comedy, pent-up passion, nonstop action and high-tech weaponry.',44.635452,478207520,120,'Smart and sexy.','Mr. & Mrs. Smith',6.5,2965),(250,110000000,'http://www.thedivergentseries.movie/#insurgent',262500,'en','Insurgent','Beatrice Prior must confront her inner demons and continue her fight against a powerful alliance which threatens to tear her society apart.',103.718387,295238201,119,'One Choice Can Destroy You','Insurgent',6.2,3829),(251,116000000,NULL,2567,'en','The Aviator','A biopic depicting the life of filmmaker and aviation pioneer Howard Hughes from 1927 to 1947, during which time he became a successful film producer and an aviation magnate, while simultaneously growing more unstable due to severe obsessive-compulsive disorder.',45.616098,102000000,170,'For some men, the sky was the limit. For him, it was just the beginning.','The Aviator',7.0,1489),(252,112000000,NULL,38745,'en','Gulliver\'s Travels','Travel writer Lemuel Gulliver takes an assignment in Bermuda, but ends up on the island of Liliput, where he towers over its tiny citizens.',22.845143,237382724,85,'Something big is going down.','Gulliver\'s Travels',4.9,621),(253,120000000,'http://www.sonypictures.com/movies/thegreenhornet/',40805,'en','The Green Hornet','Britt Reid (Seth Rogen), the heir to the largest newspaper fortune in Los Angeles, is a spoiled playboy who has been, thus far, happy to lead an aimless life. After his father (Tom Wilkinson) dies, Britt meets Kato (Jay Chou), a resourceful company employee. Realizing that they have the talent and resources to make something of their lives, Britt and Kato join forces as costumed crime-fighters to bring down the city\'s most-powerful criminal, Chudnofsky (Christoph Waltz).',31.703608,227817248,119,'Breaking the Law to Protect It.','The Green Hornet',5.5,1251),(254,110000000,'http://www.300themovie.com/',53182,'en','300: Rise of an Empire','Based on Frank Miller\'s latest graphic novel Xerxes and told in the breathtaking visual style of the blockbuster \"300,\" this new chapter of the epic saga takes the action to a fresh battlefield--on the sea--as Greek general Themistokles attempts to unite all of Greece by leading the charge that will change the course of the war. \"300: Rise of an Empire\" pits Themistokles against the massive invading Persian forces led by mortal-turned-god Xerxes and Artemesia, the vengeful commander of the Persian navy.',71.510596,337580051,102,'Seize your glory!','300: Rise of an Empire',6.1,2397),(255,110000000,'http://www.smurfhappens.com/',41513,'en','The Smurfs','When the evil wizard Gargamel chases the tiny blue Smurfs out of their village, they tumble from their magical world and into ours -- in fact, smack dab in the middle of Central Park. Just three apples high and stuck in the Big Apple, the Smurfs must find a way to get back to their village before Gargamel tracks them down.',36.654220,563749323,103,'Smurf Happens.','The Smurfs',5.5,1179),(256,110000000,'http://movies.disney.com/home-on-the-range',13700,'en','Home on the Range','When a greedy outlaw schemes to take possession of the \"Patch Of Heaven\" dairy farm, three determined cows, a karate-kicking stallion and a colorful corral of critters join forces to save their home. The stakes are sky-high as this unlikely animal alliance risk their hides and match wits with a mysterious band of bad guys.',19.625972,103951461,76,'Bust a Moo','Home on the Range',5.7,389),(257,110000000,'http://www.thedivergentseries.movie/#allegiant',262504,'en','Allegiant','Beatrice Prior and Tobias Eaton venture into the world outside of the fence and are taken into protective custody by a mysterious agency known as the Bureau of Genetic Welfare.',86.105615,179246868,121,'Break the boundaries of your world','Allegiant',5.9,1998),(258,110000000,'http://www.steelgetsreal.com/',39254,'en','Real Steel','In the near-future, Charlie Kenton is a washed-up fighter who retired from the ring when robots took over the sport. After Charlie\'s robot is trashed, he reluctantly teams up with his estranged son Max to rebuild and train an unlikely contender.',37.195046,299268508,127,'If you get one shot, make it real.','Real Steel',6.6,2692),(259,105000000,'http://smurfhappens.com',77931,'en','The Smurfs 2','The evil wizard Gargamel creates a couple of mischievous Smurf-like creatures called the Naughties that he hopes will let him harness the all-powerful, magical Smurf-essence. But when he discovers that only a real Smurf can give him what he wants, and only a secret spell that Smurfette knows can turn the Naughties into real Smurfs, Gargamel kidnaps Smurfette and brings her to Paris, where he has been winning the adoration of millions as the world¹s greatest sorcerer. It\'s up to Papa, Clumsy, Grouchy, and Vanity to return to our world, reunite with their human friends Patrick and Grace Winslow, and rescue her! Will Smurfette, who has always felt different from the other Smurfs, find a new connection with the Naughties Vexy and Hackus or will the Smurfs convince her that their love for her is True Blue?',32.473628,347434178,105,'Get ready to get naughty!','The Smurfs 2',5.5,695),(260,160000000,NULL,1639,'en','Speed 2: Cruise Control','Sandra Bullock and Jason Patric star as a young couple whose dream cruise turns to terror when a lunatic computer genius (Willem Dafoe) sets a new course for destruction.',23.336875,164508066,121,'As the stakes get higher, the ride gets even faster.','Speed 2: Cruise Control',4.1,434),(261,110000000,'http://www.if-sentinel.com/',80274,'en','Ender\'s Game','Based on the classic novel by Orson Scott Card, Ender\'s Game is the story of the Earth\'s most gifted children training to defend their homeplanet in the space wars of the future.',45.948340,125537191,114,'This is not a game.','Ender\'s Game',6.6,2303),(262,110000000,NULL,1571,'en','Live Free or Die Hard','John McClane is back and badder than ever, and this time he\'s working for Homeland Security. He calls on the services of a young hacker in his bid to stop a ring of Internet terrorists intent on taking control of America\'s computer infrastructure.',48.933370,383531464,128,'The old school cop is back!','Live Free or Die Hard',6.4,2089),(263,93000000,'http://www.lordoftherings.net/',120,'en','The Lord of the Rings: The Fellowship of the Ring','Young hobbit Frodo Baggins, after inheriting a mysterious ring from his uncle Bilbo, must leave his home in order to keep it from falling into the hands of its evil creator. Along the way, a fellowship is formed to protect the ringbearer and make sure that the ring arrives at its final destination: Mt. Doom, the only place where it can be destroyed.',138.049577,871368364,178,'One ring to rule them all','The Lord of the Rings: The Fellowship of the Ring',8.0,8705),(264,110000000,NULL,10204,'en','Around the World in 80 Days','A bet pits a British inventor, a Chinese thief and a French artist on a worldwide adventure that they can circle the globe in 80 days.',22.643776,72178895,120,'Let your imagination soar.','Around the World in 80 Days',5.7,672),(265,107000000,NULL,8489,'en','Ali','In 1964, a brash new pro boxer, fresh from his olympic gold medal victory, explodes on to the scene; Cassius Clay. Bold and outspoken, he cuts an entirely new image for African Americans in sport with his proud public self confidence and his unapologetic belief that he is the greatest boxer of all time. Yet at the top of his game, both Ali\'s personal and professional lives face the ultimate test.',18.866672,87713825,157,'Float like a butterfly and sting like a bee.','Ali',6.7,447),(266,NULL,NULL,10588,'en','The Cat in the Hat','Conrad and Sally Walden are home alone with their pet fish. It is raining outside, and there is nothing to do. Until The Cat in the Hat walks in the front door. He introduces them to their imagination, and at first it\'s all fun and games, until things get out of hand, and The Cat must go, go, go, before their parents get back.',18.251129,NULL,82,'Don\'t mess with the hat.','The Cat in the Hat',4.9,366),(267,120000000,NULL,2048,'en','I, Robot','In 2035, where robots are common-place and abide by the three laws of robotics, a techno-phobic cop investigates an apparent suicide. Suspecting that a robot may be responsible for the death, his investigation leads him to believe that humanity may be in danger.',95.914473,347234916,115,'Laws are made to be broken.','I, Robot',6.7,3793),(268,130000000,'http://www.kingdomofheavendvd.com/',1495,'en','Kingdom of Heaven','After his wife dies, a blacksmith named Balian is thrust into royalty, political intrigue and bloody holy wars during the Crusades.',44.490453,211643158,144,'Be without fear in the face of your enemies. Safeguard the helpless, and do no wrong','Kingdom of Heaven',6.6,1157),(269,133000000,NULL,10137,'en','Stuart Little','The adventures of a heroic and debonair stalwart mouse named Stuart Little with human qualities, who faces some comic misadventures while searching for his lost bird friend and living with a human family as their child.',30.475297,300135367,84,'The Little Family Just Got Bigger','Stuart Little',5.8,959),(270,105000000,'http://disney.go.com/disneypictures/princessandthefrog/',10198,'en','The Princess and the Frog','A waitress, desperate to fulfill her dreams as a restaurant owner, is set on a journey to turn a frog prince back into a human being, but she has to do face the same problem after she kisses him.',62.479574,267045765,97,'Every Love Story Begins With a Kiss...','The Princess and the Frog',6.7,1247),(271,108000000,'http://www.foxmovies.com/movies/the-martian',286217,'en','The Martian','During a manned mission to Mars, Astronaut Mark Watney is presumed dead after a fierce storm and left behind by his crew. But Watney has survived and finds himself stranded and alone on the hostile planet. With only meager supplies, he must draw upon his ingenuity, wit and spirit to subsist and find a way to signal to Earth that he is alive.',167.932870,630161890,141,'Bring Him Home','The Martian',7.6,7268),(272,126000000,'http://www.theisland-themovie.com/',1635,'en','The Island','In 2019, Lincoln Six-Echo is a resident of a seemingly \"Utopian\" but contained facility. Like all of the inhabitants of this carefully-controlled environment, Lincoln hopes to be chosen to go to The Island — reportedly the last uncontaminated location on the planet. But Lincoln soon discovers that everything about his existence is a lie.',37.680560,162949164,136,'Your time will come...','The Island',6.5,1770),(273,90000000,NULL,24113,'en','Town & Country','Porter Stoddard is a well-known New York architect who is at a crossroads... a nexus where twists and turns lead to myriad missteps some with his wife Ellie, others with longtime friends Mona and her husband Griffin. Deciding which direction to take often leads to unexpected encounters with hilarious consequences.',1.004579,10372291,104,'There\'s no such thing as a small affair.','Town & Country',3.7,16),(274,90000000,NULL,9679,'en','Gone in Sixty Seconds','Upon learning that he has to come out of retirement to steal 50 cars in one night to save his brother Kip\'s life, former car thief Randall \"Memphis\" Raines enlists help from a few \"boost happy\" pals to accomplish a seemingly impossible feat. From countless car chases to relentless cops, the high-octane excitement builds as Randall swerves around more than a few roadblocks to keep Kip alive.',52.995628,237202299,118,'Ice Cold, Hot Wired.','Gone in Sixty Seconds',6.1,1485),(275,103000000,NULL,98,'en','Gladiator','In the year 180, the death of emperor Marcus Aurelius throws the Roman Empire into chaos. Maximus is one of the Roman army\'s most capable and trusted generals and a key advisor to the emperor. As Marcus\' devious son Commodus ascends to the throne, Maximus is set to be executed. He escapes, but is captured by slave traders. Renamed Spaniard and forced to become a gladiator, Maximus must battle to the death with other men for the amusement of paying audiences. His battle skills serve him well, and he becomes one of the most famous and admired men to fight in the Colosseum. Determined to avenge himself against the man who took away his freedom and laid waste to his family, Maximus believes that he can use his fame and skill in the ring to avenge the loss of his family and former glory. As the gladiator begins to challenge his rule, Commodus decides to put his own fighting mettle to the test by squaring off with Maximus in a battle to the death.',95.301296,457640427,155,'A Hero Will Rise.','Gladiator',7.9,5439),(276,102000000,NULL,180,'en','Minority Report','John Anderton is a top \'Precrime\' cop in the late-21st century, when technology can predict crimes before they\'re committed. But Anderton becomes the quarry when another investigator targets him for a murder charge.',65.948959,358372926,145,'The system is perfect until it comes after you.','Minority Report',7.1,2608),(277,100000000,NULL,672,'en','Harry Potter and the Chamber of Secrets','Ignoring threats to his life, Harry returns to Hogwarts to investigate – aided by Ron and Hermione – a mysterious series of attacks.',132.397737,876688482,161,'Hogwarts is back in session.','Harry Potter and the Chamber of Secrets',7.4,5815),(278,150000000,'http://www.mgm.com/#/our-titles/233/Casino-Royale-(2006)',36557,'en','Casino Royale','Le Chiffre, a banker to the world\'s terrorists, is scheduled to participate in a high-stakes poker game in Montenegro, where he intends to use his winnings to establish his financial grip on the terrorist market. M sends Bond – on his maiden mission as a 00 Agent – to attend this game and prevent Le Chiffre from winning. With the help of Vesper Lynd and Felix Leiter, Bond enters the most important poker game in his already dangerous career.',88.935165,599045960,144,'Everyone has a past. Every legend has a beginning.','Casino Royale',7.3,3855),(279,100000000,NULL,869,'en','Planet of the Apes','After a spectacular crash-landing on an uncharted planet, brash astronaut Leo Davidson finds himself trapped in a savage world where talking apes dominate the human race. Desperate to find a way home, Leo must evade the invincible gorilla army led by Ruthless General Thade.',51.188633,362211740,119,'You\'ll be sorry you were ever born human','Planet of the Apes',5.6,1243),(280,100000000,NULL,280,'en','Terminator 2: Judgment Day','Nearly 10 years have passed since Sarah Connor was targeted for termination by a cyborg from the future. Now her son, John, the future leader of the resistance, is the target for a newer, more deadly terminator. Once again, the resistance has managed to send a protector back to attempt to save John and his mother Sarah.',101.741550,520000000,137,'It\'s nothing personal.','Terminator 2: Judgment Day',7.7,4185),(281,80000000,'http://www.publicenemies.net/',11322,'en','Public Enemies','Depression-era bank robber John Dillinger\'s charm and audacity endear him to much of America\'s downtrodden public, but he\'s also a thorn in the side of J. Edgar Hoover and the fledgling FBI. Desperate to capture the elusive outlaw, Hoover makes Dillinger his first Public Enemy Number One and assigns his top agent, Melvin Purvis, the task of bringing him in dead or alive.',33.691694,214104620,140,'America\'s Most Wanted.','Public Enemies',6.5,1344),(282,100000000,'http://www.americangangster.net/',4982,'en','American Gangster','Following the death of his employer and mentor, Bumpy Johnson, Frank Lucas establishes himself as the number one importer of heroin in the Harlem district of Manhattan. He does so by buying heroin directly from the source in South East Asia and he comes up with a unique way of importing the drugs into the United States. Based on a true story.',42.361215,266465037,157,'There are two sides to the American dream','American Gangster',7.4,1502),(283,115000000,NULL,36955,'en','True Lies','Harry Tasker is a secret agent for the United States Government. For years, he has kept his job from his wife, but is forced to reveal his identity and try to stop nuclear terrorists when he and his wife are kidnapped by them.',38.729418,378882411,141,'When he said I do, he never said what he did.','True Lies',6.8,1116),(284,100000000,'http://www.sonypictures.com/movies/thetakingofpelham123/',18487,'en','The Taking of Pelham 1 2 3','Armed men hijack a New York City subway train, holding the passengers hostage in return for a ransom, and turning an ordinary day\'s work for dispatcher Walter Garber into a face-off with the mastermind behind the crime.',40.597856,150166126,106,'I can\'t get it out of my head. I\'m gonna die today.','The Taking of Pelham 1 2 3',6.2,954),(285,100000000,'http://www.littlefockers.net/',39451,'en','Little Fockers','It has taken 10 years, two little Fockers with wife Pam and countless hurdles for Greg to finally get in with his tightly wound father-in-law, Jack. After the cash-strapped dad takes a job moonlighting for a drug company, Jack\'s suspicions about his favorite male nurse come roaring back. When Greg and Pam\'s entire clan descends for the twins\' birthday party, Greg must prove to the skeptical Jack that he\'s fully capable as the man of the house.',32.389353,310650585,98,'Kids bring everyone closer, right?','Little Fockers',5.4,1060),(286,100000000,'http://www.theotherguys-movie.com/',27581,'en','The Other Guys','NYPD detectives Christopher Danson (Johnson) and P.K. Highsmith (Jackson) are the baddest and most beloved cops in New York City. They don\'t get tattoos, other men get tattoos of them. Two desks over and one back, sit detectives Allen Gamble (Ferrell) and Terry Hoitz (Wahlberg). You\'ve seen them in the background of photos of Danson and Highsmith, out of focus and eyes closed. They\'re not heroes, they\'re \"the other guys.\" But every cop has his or her day and soon Gamble and Hoitz stumble into a seemingly innocuous case no other detective wants to touch that could turn into NYC\'s biggest crime. It\'s the opportunity of their lives, but do these guys have the right stuff?',24.399642,170432927,107,'When the cops are busy... Our only hope is...','The Other Guys',6.1,1383),(287,100000000,'http://www.warnerbros.com/eraser',9268,'en','Eraser','U.S. Marshall John Kruger erases the identities of people enrolled in the Witness Protection Program. His current assignment is to protect Lee Cullen, who\'s uncovered evidence that the weapons manufacturer she works for has been selling to terrorist groups. When Kruger discovers that there\'s a corrupt agent within the program, he must guard his own life while trying to protect Lee\'s.',24.507987,242295562,115,'He will erase your past to protect your future.','Eraser',5.6,543),(288,100000000,'http://unchainedmovie.com/',68718,'en','Django Unchained','With the help of a German bounty hunter, a freed slave sets out to rescue his wife from a brutal Mississippi plantation owner.',82.121691,425368238,165,'Life, liberty and the pursuit of vengeance.','Django Unchained',7.8,10099),(289,100000000,NULL,10545,'en','The Hunchback of Notre Dame','When Quasi defies the evil Frollo and ventures out to the Festival of Fools, the cruel crowd jeers him. Rescued by fellow outcast the gypsy Esmeralda, Quasi soon finds himself battling to save the people and the city he loves.',46.727941,100138851,91,NULL,'The Hunchback of Notre Dame',6.8,1129),(290,100000000,NULL,11688,'en','The Emperor\'s New Groove','Kuzco is a self-centered emperor who summons Pacha from a village and to tell him that his home will be destroyed to make room for Kuzco\'s new summer home. Kuzco\'s advisor, Yzma, tries to poison Kuzco and accidentally turns him into a llama, who accidentally ends up in Pacha\'s village. Pacha offers to help Kuzco if he doesn\'t destroy his house, and so they form an unlikely partnership.',51.113717,169327687,78,'It\'s All About.....ME!','The Emperor\'s New Groove',7.2,1490),(291,100000000,'http://theexpendables2film.com/',76163,'en','The Expendables 2','Mr. Church reunites the Expendables for what should be an easy paycheck, but when one of their men is murdered on the job, their quest for revenge puts them deep in enemy territory and up against an unexpected threat.',53.732892,312573423,103,'Back for War.','The Expendables 2',6.1,2896),(292,100000000,NULL,2059,'en','National Treasure','Modern treasure hunters, led by archaeologist Ben Gates, search for a chest of riches rumored to have been stashed away by George Washington, Thomas Jefferson and Benjamin Franklin during the Revolutionary War. The chest\'s whereabouts may lie in secret clues embedded in the Constitution and the Declaration of Independence, and Gates is in a race to find the gold before his enemies do.',58.849256,347451894,131,'The greatest adventure history has ever revealed.','National Treasure',6.4,1926),(293,100000000,'http://www.eragonmovie.com/',2486,'en','Eragon','In his homeland of Alagaesia, a farm boy happens upon a dragon\'s egg -- a discovery that leads him on a predestined journey where he realized he\'s the one person who can defend his home against an evil king.',30.863434,249288105,104,'As darkness falls, the last dragon will choose its rider.','Eragon',4.9,967),(294,100000000,'http://wherethewildthingsare.warnerbros.com/',16523,'en','Where the Wild Things Are','Max imagines running away from his mom and sailing to a far-off land where large talking beasts -- Ira, Carol, Douglas, the Bull, Judith and Alexander -- crown him as their king, play rumpus, build forts and discover secret hideaways.',31.586215,100086793,101,'There\'s one in all of us.','Where the Wild Things Are',6.4,572),(295,100000000,NULL,116711,'en','Epic','A teenager finds herself transported to a deep forest setting where a battle between the forces of good and the forces of evil is taking place. She bands together with a rag-tag group characters in order to save their world -- and ours.',36.711378,268426634,102,'Discover a world beyond your imagination','Epic',6.4,1121),(296,100000000,'http://thetourist-movie.com/',37710,'en','The Tourist','American tourist Frank (Johnny Depp) meets mysterious British woman Elsie (Angelina Jolie) on the train to Venice. Romance seems to bud, but there\'s more to her than meets the eye. Remake of the 2005 French film \"Anthony Zimmer\", written and directed by Jérôme Salle.',41.426678,278731369,103,'It all started when he met a woman','The Tourist',6.0,1699),(297,100000000,'http://www.end-of-days.com/',9946,'en','End of Days','On December 28th, 1999, the citizens of New York City are getting ready for the turn of the millennium. However, the Devil decides to crash the party by coming to the city, inhabiting a man\'s body, and searching for his chosen bride, a 20-year-old woman named Christine York. The world will end, and the only hope lies within an atheist called Jericho Cane.',20.652943,211989043,121,'Prepare for the end.','End of Days',5.5,482),(298,100000000,NULL,1372,'en','Blood Diamond','An ex-mercenary turned smuggler. A Mende fisherman. Amid the explosive civil war overtaking 1999 Sierra Leone, these men join for two desperate missions: recovering a rare pink diamond of immense value and rescuing the fisherman\'s son conscripted as a child soldier into the brutal rebel forces ripping a swath of torture and bloodshed countrywide.',52.792678,170877916,143,'It will cost you everything.','Blood Diamond',7.3,2281),(299,100000000,'http://www.thewolfofwallstreet.com/',106646,'en','The Wolf of Wall Street','A New York stockbroker refuses to cooperate in a large securities fraud case involving corruption on Wall Street, corporate banking world and mob infiltration. Based on Jordan Belfort\'s autobiography.',95.007934,392000694,180,'EARN. SPEND. PARTY.','The Wolf of Wall Street',7.9,6571),(300,100000000,NULL,414,'en','Batman Forever','The Dark Knight of Gotham City confronts a dastardly duo: Two-Face and the Riddler. Formerly District Attorney Harvey Dent, Two-Face believes Batman caused the courtroom accident which left him disfigured on one side. And Edward Nygma, computer-genius and former employee of millionaire Bruce Wayne, is out to get the philanthropist; as The Riddler. Former circus acrobat Dick Grayson, his family killed by Two-Face, becomes Wayne\'s ward and Batman\'s new partner Robin.',48.205606,336529144,121,'Courage now, truth always...','Batman Forever',5.2,1498),(301,105000000,NULL,563,'en','Starship Troopers','Set in the future, the story follows a young soldier named Johnny Rico and his exploits in the Mobile Infantry. Rico\'s military career progresses from recruit to non-commissioned officer and finally to officer against the backdrop of an interstellar war between mankind and an arachnoid species known as \"the Bugs\".',58.782359,121214377,129,'The only good bug is a dead bug.','Starship Troopers',6.7,1560),(302,102000000,'http://cloudatlas.warnerbros.com/',83542,'en','Cloud Atlas','A set of six nested stories spanning time between the 19th century and a distant post-apocalyptic future. Cloud Atlas explores how the actions and consequences of individual lives impact one another throughout the past, the present and the future. Action, mystery and romance weave through the story as one soul is shaped from a killer into a hero and a single act of kindness ripples across centuries to inspire a revolution in the distant future.  Based on the award winning novel by David Mitchell. Directed by Tom Tykwer and the Wachowskis.',73.872343,130482868,172,'Everything is Connected','Cloud Atlas',6.6,2977),(303,80000000,'http://legendoftheguardians.warnerbros.com/',41216,'en','Legend of the Guardians: The Owls of Ga\'Hoole','Soren, a young barn owl, is kidnapped by owls of St. Aggie\'s, ostensibly an orphanage, where owlets are brainwashed into becoming soldiers. He and his new friends escape to the island of Ga\'Hoole, to assist its noble, wise owls who fight the army being created by the wicked rulers of St. Aggie\'s. The film is based on the first three books in the series.',37.321848,140073390,97,'On his way to finding a legend...he will become one.','Legend of the Guardians: The Owls of Ga\'Hoole',6.5,703),(304,100000000,NULL,314,'en','Catwoman','Liquidated after discovering a corporate conspiracy, mild-mannered graphic artist Patience Phillips washes up on an island, where she\'s resurrected and endowed with the prowess of a cat -- and she\'s eager to use her new skills ... as a vigilante. Before you can say \"cat and mouse,\" handsome gumshoe Tom Lone is on her tail.',32.271938,82102379,104,'CATch her in IMAX','Catwoman',4.2,808),(305,100000000,NULL,184315,'en','Hercules','Fourteen hundred years ago, a tormented soul walked the earth that was neither man nor god. Hercules was the powerful son of the god king Zeus, for this he received nothing but suffering his entire life. After twelve arduous labors and the loss of his family, this dark, world-weary soul turned his back on the gods finding his only solace in bloody battle. Over the years he warmed to the company of six similar souls, their only bond being their love of fighting and presence of death. These men and woman never question where they go to fight or why or whom, just how much they will be paid. Now the King of Thrace has hired these mercenaries to train his men to become the greatest army of all time. It is time for this bunch of lost souls to finally have their eyes opened to how far they have fallen when they must train an army to become as ruthless and blood thirsty as their reputation has become.',76.842247,243400000,99,'Before he was a legend, he was a man.','Hercules',5.6,1680),(306,140000000,NULL,9016,'en','Treasure Planet','When space galleon cabin boy Jim Hawkins discovers a map to an intergalactic \"loot of a thousand worlds,\" a cyborg cook named John Silver teaches him to battle supernovas and space storms. But, soon, Jim realizes Silver is a pirate intent on mutiny!',38.924136,109578115,95,'Find your place in the universe.','Treasure Planet',7.2,948),(307,100000000,NULL,18162,'en','Land of the Lost','On his latest expedition, Dr. Rick Marshall is sucked into a space-time vortex alongside his research assistant and a redneck survivalist. In this alternate universe, the trio make friends with a primate named Chaka, their only ally in a world full of dinosaurs and other fantastic creatures.',19.388410,68688831,102,'Right place. Wrong time.','Land of the Lost',5.3,381),(308,90000000,'http://theexpendables3film.com/',138103,'en','The Expendables 3','Barney, Christmas and the rest of the team comes face-to-face with Conrad Stonebanks, who years ago co-founded The Expendables with Barney. Stonebanks subsequently became a ruthless arms trader and someone who Barney was forced to kill… or so he thought. Stonebanks, who eluded death once before, now is making it his mission to end The Expendables -- but Barney has other plans. Barney decides that he has to fight old blood with new blood, and brings in a new era of Expendables team members, recruiting individuals who are younger, faster and more tech-savvy. The latest mission becomes a clash of classic old-school style versus high-tech exper