rs can transcend the abilities of the human brain.',58.991388,103039258,119,'Yesterday, Dr. Will Caster was only human...','Transcendence',5.9,2295),(335,93000000,NULL,331,'en','Jurassic Park III','In need of funds for research, Dr. Alan Grant accepts a large sum of money to accompany Paul and Amanda Kirby on an aerial tour of the infamous Isla Sorna. It isn\'t long before all hell breaks loose and the stranded wayfarers must fight for survival as a host of new -- and even more deadly -- dinosaurs try to make snacks of them.',1.859364,368780809,92,'This time, it\'s not just a walk in the park!','Jurassic Park III',5.7,2077),(336,93000000,'http://www.apeswillrise.com/',61791,'en','Rise of the Planet of the Apes','Scientist Will Rodman is determined to find a cure for Alzheimer\'s, the disease which has slowly consumed his father. Will feels certain he is close to a breakthrough and tests his latest serum on apes, noticing dramatic increases in intelligence and brain activity in the primate subjects – especially Caesar, his pet chimpanzee.',138.433168,482860185,105,'Evolution Becomes Revolution.','Rise of the Planet of the Apes',7.0,4347),(337,90000000,NULL,8204,'en','The Spiderwick Chronicles','Upon moving into the run-down Spiderwick Estate with their mother, twin brothers Jared and Simon Grace, along with their sister Mallory, find themselves pulled into an alternate world full of faeries and other creatures.',21.436682,162839667,95,'Their World Is Closer Than You Think.','The Spiderwick Chronicles',6.3,572),(338,92000000,'http://www.diehardmovie.com/',47964,'en','A Good Day to Die Hard','Iconoclastic, take-no-prisoners cop John McClane, finds himself for the first time on foreign soil after traveling to Moscow to help his wayward son Jack - unaware that Jack is really a highly-trained CIA operative out to stop a nuclear weapons heist. With the Russian underworld in pursuit, and battling a countdown to war, the two McClanes discover that their opposing methods make