ack follows the exploits of agents Kay and Jay, members of a top-secret organization established to monitor and police alien activity on Earth. The two Men in Black find themselves in the middle of the deadly plot by an intergalactic terrorist who has arrived on Earth to assassinate two ambassadors from opposing galaxies. In order to prevent worlds from colliding, the MiB must track down the terrorist and prevent the destruction of Earth. It\'s just another typical day for the Men in Black.',104.121555,589390539,98,'Protecting the Earth from the scum of the universe.','Men in Black',6.9,4412),(344,90000000,'http://toystory.disney.com/toy-story-2',863,'en','Toy Story 2','Andy heads off to Cowboy Camp, leaving his toys to their own devices. Things shift into high gear when an obsessive toy collector named Al McWhiggen, owner of Al\'s Toy Barn kidnaps Woody. Andy\'s toys mount a daring rescue mission, Buzz Lightyear meets his match and Woody has to decide where he and his heart truly belong.',73.575118,497366869,92,'The toys are back!','Toy Story 2',7.3,3806),(345,100000000,NULL,44048,'en','Unstoppable','A runaway train, transporting deadly, toxic chemicals, is barreling down on Stanton, Pennsylvania, and only two men can stop it: a veteran engineer and a young conductor. Thousands of lives hang in the balance as these ordinary heroes attempt to chase down one million tons of hurtling steel and prevent an epic disaster.',37.698465,167805466,98,'1,000,000 Tons. 100,000 Lives. 100 Minutes.','Unstoppable',6.3,1165),(346,90000000,NULL,5175,'en','Rush Hour 2','It\'s vacation time for Carter as he finds himself alongside Lee in Hong Kong wishing for more excitement. While Carter wants to party and meet the ladies, Lee is out to track down a Triad gang lord who may be responsible for killing two men at the American Embassy. Things get complicated as the pair stumble onto a counterfeiting plot. The boys are soon up to their necks in fist fights and life-threatening situations.