ife of Walter Mitty',7.0,3144),(351,92000000,NULL,4327,'en','Charlie\'s Angels','Aspects of this take on the 1970s hit TV series are similar to the original show :Angels Dylan, Natalie and Alex still work for Charlie and interface with Bosley. They still flip their hair, stop traffic with a smile and kick butt. The differences are the unsubtle humor, the martial arts training and the high-tech premise: This time, they\'re hot on the trail of stolen software.',40.203950,264105545,98,'Get Some Action','Charlie\'s Angels',5.6,1232),(352,90000000,'http://thedeparted.warnerbros.com/',1422,'en','The Departed','To take down South Boston\'s Irish Mafia, the police send in one of their own to infiltrate the underworld, not realizing the syndicate has done likewise. While an undercover cop curries favor with the mob kingpin, a career criminal rises through the police ranks. But both sides soon discover there\'s a mole among them.',63.429157,289847354,151,'Lies. Betrayal. Sacrifice. How far will you take it?','The Departed',7.9,4339),(353,90000000,NULL,10674,'en','Mulan','A tomboyish girl disguises herself as a young man so she can fight with the Imperial Chinese Army against the invading Huns. With help from wise-cracking dragon Mushu, Mulan just might save her country -- and win the heart of handsome Captain Li Shang.',67.427755,304320254,88,'This time, the princess saves the prince.','Mulan',7.6,2008),(354,92000000,'http://www.tropicthunder.com/',7446,'en','Tropic Thunder','Vietnam veteran \'Four Leaf\' Tayback\'s memoir, Tropic Thunder, is being made into a film, but Director Damien Cockburn can’t control the cast of prima donnas. Behind schedule and over budget, Cockburn is ordered by a studio executive to get filming back on track, or risk its cancellation. On Tayback\'s advice, Cockburn drops the actors into the middle of the jungle to film the remaining scenes but, unbeknownst to the actors and production, the group have been dropped in the middle of the Golden Triangle, the home of heroin-producing gangs.',43.192048,188072649,107,'The movie they think they\'re making... isn\'t a movie anymore.','Tropic Thunder',6.5,1667),(355,90000000,'http://dragontattoo.com/',65754,'en','The Girl with the Dragon Tattoo','This English-language adaptation of the Swedish novel by Stieg Larsson follows a disgraced journalist, Mikael Blomkvist, as he investigates the disappearance of a weary patriarch\'s niece from 40 years ago. He is aided by the pierced, tattooed, punk computer hacker named Lisbeth Salander. As they work together in the investigation, Blomkvist and Salander uncover immense corruption beyond anything they have ever imagined.',47.651083,232617430,158,'Evil shall with evil be expelled.','The Girl with the Dragon Tattoo',7.2,2434),(356,90000000,NULL,1572,'en','Die Hard: With a Vengeance','New York detective John McClane is back and kicking bad-guy butt in the third installment of this action-packed series, which finds him teaming with civilian Zeus Carver to prevent the loss of innocent lives. McClane thought he\'d seen it all, until a genius named Simon engages McClane, his new \"partner\" -- and his beloved city -- in a deadly game that demands their concentration.',51.881077,366101666,128,'Think fast. Look alive. Die hard.','Die Hard: With a Vengeance',6.9,2066),(357,90000000,'http://sherlock-holmes-movie.warnerbros.com/',10528,'en','Sherlock Holmes','Eccentric consulting detective, Sherlock Holmes and Doctor John Watson battle to bring down a new nemesis and unravel a deadly plot that could destroy England.',57.834787,524028679,128,'Nothing escapes him.','Sherlock Holmes',7.0,5766),(358,100000000,'http://www.benhurmovie.com/',271969,'en','Ben-Hur','A falsely accused nobleman survives years of slavery to take vengeance on his best friend who betrayed him.',29.608322,94061311,125,'First to finish. Last to die.','Ben-Hur',5.3,621),(359,120000000,'http://www.disney.com/atlantis',10865,'en','Atlantis: The Lost Empire','The world\'s most highly qualified crew of archaeologists and explorers is led by historian Milo Thatch as they board the incredible 1,000-foot submarine Ulysses and head deep into the mysteries of the sea.',51.548589,186053725,95,'Atlantis is waiting...','Atlantis: The Lost Empire',6.7,1224),(360,NULL,'http://www.foxmovies.com/movies/alvin-and-the-chipmunks-the-road-chip',258509,'en','Alvin and the Chipmunks: The Road Chip','Through a series of misunderstandings, Alvin, Simon and Theodore come to believe that Dave is going to propose to his new girlfriend in New York City - and dump them. They have three days to get to him and stop the proposal.',27.867368,233755553,92,'Fast & furry-ous','Alvin and the Chipmunks: The Road Chip',5.8,428),(361,75000000,NULL,2253,'en','Valkyrie','Wounded in Africa during World War II, Nazi Col. Claus von Stauffenberg returns to his native Germany and joins the Resistance in a daring plan to create a shadow government and assassinate Adolf Hitler. When events unfold so that he becomes a central player, he finds himself tasked with both leading the coup and personally killing the Führer.',38.832842,200276000,121,'Many saw evil. They dared to stop it.','Valkyrie',6.7,1173),(362,90000000,'http://www.youdontmesswiththezohan.com/',10661,'en','You Don\'t Mess with the Zohan','An Israeli counterterrorism soldier with a secretly fabulous ambition to become a Manhattan hairstylist. Zohan\'s desire runs so deep that he\'ll do anything -- including faking his own death and going head-to-head with an Arab cab driver -- to make his dreams come true.',40.597344,201596308,113,'Lather. Rinse. Save the world.','You Don\'t Mess with the Zohan',5.5,1048),(363,88000000,'http://www.pixels-movie.com/',257344,'en','Pixels','Video game experts are recruited by the military to fight 1980s-era video game characters who\'ve attacked New York.',140.849495,243637091,105,'Game On.','Pixels',5.6,2513),(364,100000000,NULL,644,'en','A.I. Artificial Intelligence','A robotic boy, the 