tp://www.theinterpretermovie.com/',179,'en','The Interpreter','After Silvia Broome, an interpreter at United Nations headquarters, overhears plans of an assassination, an American Secret Service agent is sent to investigate.',18.699840,162944923,128,'The truth needs no translation.','The Interpreter',6.2,392),(369,90000000,'http://www.percyjacksonthemovie.com/us/#!/home',76285,'en','Percy Jackson: Sea of Monsters','In their quest to confront the ultimate evil, Percy and his friends battle swarms of mythical creatures to find the mythical Golden Fleece and to stop an ancient evil from rising.',40.262261,174578751,106,'Where There Are Gods, There Are Monsters.','Percy Jackson: Sea of Monsters',5.9,1648),(370,95000000,NULL,1996,'en','Lara Croft Tomb Raider: The Cradle of Life','Lara Croft ventures to an underwater temple in search of the mythological Pandora\'s Box but, after securing it, it is promptly stolen by the villainous leader of a Chinese crime syndicate. Lara must recover the box before the syndicate\'s evil mastermind uses it to construct a weapon of catastrophic capabilities.',56.811056,156505388,117,'Adventuress Lara Croft goes on a quest to save the mythical Pandora\'s Box','Lara Croft Tomb Raider: The Cradle of Life',5.5,1418),(371,90000000,'http://nowyouseeme.movie',291805,'en','Now You See Me 2','One year after outwitting the FBI and winning the public’s adulation with their mind-bending spectacles, the Four Horsemen resurface only to find themselves face to face with a new enemy who enlists them to pull off their most dangerous heist yet.',51.535701,334901337,129,'You Haven\'t Seen Anything Yet','Now You See Me 2',6.7,3235),(372,68000000,NULL,10003,'en','The Saint','Ivan Tretiak, Russian Mafia boss who wants to create an oil crisis in Moscow and seize power as a result sends Simon Templar, great international criminal, to England to get a secret formula for cold fusion from U.S. scientist Emma Russell. Templar falls in love with Emma and they try to outwit Tretiak and his guerrillas, hiding from them in Moscow',20.913852,118063304,116,'Never reveal your name. Never turn your back. Never surrender your heart.','The Saint',5.9,302),(373,92000000,NULL,1535,'en','Spy Game','Veteran spy Nathan Muir is on the verge of retiring from the CIA when he learns that his one-time protégé and close friend, Tom Bishop, is a political prisoner sentenced to die in Beijing. Although their friendship has been marred by bad blood and resentment, Muir agrees to take on the most dangerous mission of his career and rescue Bishop.',27.166757,143049560,126,'It\'s not how you play the game. It\'s how the game plays you.','Spy Game',6.8,579),(374,90000000,NULL,2067,'en','Mission to Mars','When contact is lost with the crew of the first Mars expedition, a rescue mission is launched to discover their fate.',16.058284,60874615,114,'Let There Be Life.','Mission to Mars',5.7,369),(375,90000000,'http://www.riomovies.com/',46195,'en','Rio','Captured by smugglers when he was just a hatchling, a macaw named Blu never learned to fly and lives a happily domesticated life in Minnesota with his human friend, Linda. Blu is thought to be the last of his kind, but when word comes that Jewel, a lone female, lives in Rio de Janeiro, Blu and Linda go to meet her. Animal smugglers kidnap Blu and Jewel, but the pair soon escape and begin a perilous adventure back to freedom -- and Linda.',46.200042,484635760,96,'1 out of every 8 Americans is afraid of flying. Most of them don\'t have feathers.','Rio',6.5,2166),(376,100000000,NULL,2277,'en','Bicentennial Man','Richard Martin buys a gift, a new NDR-114 robot. The product is named Andrew by the youngest of the family\'s children. \"Bicentennial Man\" follows the life and times of Andrew, a robot purchased as a household appliance programmed to perform menial tasks. As Andrew begins to experience emotions and creative thought, the Martin family soon discovers they don\'t have an ordinary robot.',24.939295,93700000,131,'One robot\'s 200 year journey to become an ordinary man.','Bicentennial Man',6.9,963),(377,90000000,NULL,10357,'en','Volcano','An earthquake shatters a peaceful Los Angeles morning and opens a fissure deep into the earth, causing lava to start bubbling up. As a volcano begins forming in the La Brea Tar Pits, the director of the city\'s emergency management service, Mike Roark, working with geologist Amy Barnes, must then use every resource in the city to try and stop the volcano from consuming Los Angeles.',19.836124,NULL,104,'The coast is toast','Volcano',5.2,376),(378,90000000,NULL,4477,'en','The Devil\'s Own','Frankie McGuire, one of the IRA\'s deadliest assassins, draws an American family into the crossfire of terrorism. But when he is sent to the U.S. to buy weapons, Frankie is housed with the family of Tom O\'Meara, a New York cop who knows nothing about Frankie\'s real identity. Their surprising friendship, and Tom\'s growing suspicions, forces Frankie to choose between the promise of peace or a lifetime of murder.',15.350451,140807547,107,'They come from different worlds. They fight for different causes. Now, two men from opposite sides of the law are about to go to war.','The Devil\'s Own',5.9,290),(379,100000000,NULL,8665,'en','K-19: The Widowmaker','When Russia\'s first nuclear submarine malfunctions on its maiden voyage, the crew must race to save the ship and prevent a nuclear disaster.',15.625949,35168966,138,'Fate has found its hero.','K-19: The Widowmaker',6.1,264),(380,20000000,NULL,9387,'en','Conan the Barbarian','A film adaptation of the classic sword and sorcery hero, Conan the Barbarian. A horde of rampaging warriors massacre the parents of young Conan and enslave the young child for years on The Wheel of Pain. As the sole survivor of the childhood massacre, Conan is released from slavery and taught the ancient arts of fighting. Transforming himself into a killing machine, Conan travels into the wilderness to seek vengeance on Thulsa Doom,