ysia ditches at sea during a terrible storm. He\'s the only survivor, and he washes up on a tiny island with nothing but some flotsam and jetsam from the aircraft\'s cargo.',57.739713,429632142,143,'At the edge of the world, his journey begins.','Cast Away',7.5,3218),(386,100000000,'http://www.warnerbros.com/happy-feet',9836,'en','Happy Feet','Into the world of the Emperor Penguins, who find their soul mates through song, a penguin is born who cannot sing. But he can tap dance something fierce!',37.272385,384335608,108,'WARNING: May Cause Toe-Tapping.','Happy Feet',5.9,1410),(387,75000000,'https://www.uphe.com/movies/the-bourne-supremacy',2502,'en','The Bourne Supremacy','When a CIA operation to purchase classified Russian documents is blown by a rival agent, who then shows up in the sleepy seaside village where Bourne and Marie have been living. The pair run for their lives and Bourne, who promised retaliation should anyone from his former life attempt contact, is forced to once again take up his life as a trained assassin to survive.',53.213931,288500217,108,'They should have left him alone.','The Bourne Supremacy',7.2,2825),(388,85000000,NULL,9772,'en','Air Force One','Russian terrorists conspire to hijack the aircraft with the president and his family on board. The commander in chief finds himself facing an impossible predicament: give in to the terrorists and sacrifice his family, or risk everything to uphold his principles - and the integrity of the nation.',36.387950,315156409,124,'The fate of a nation rests on the courage of one man.','Air Force One',6.2,840),(389,85000000,'http://www.warnerbros.co.uk/movies/oceans-eleven',161,'en','Ocean\'s Eleven','Less than 24 hours into his parole, charismatic thief Danny Ocean is already rolling out his next plan: In one night, Danny\'s hand-picked crew of specialists will attempt to steal more than $150 million from three Las Vegas casinos. But to score the cash, Danny risks his chances of reconciling with ex-wife, Tess.',60.929352,450717150,116,'Are you in or out?','Ocean\'s Eleven',7.2,3783),(390,75000000,'http://www.threemusketeers-movie.com/',52451,'en','The Three Musketeers','The hot-headed young D\'Artagnan along with three former legendary but now down on their luck Musketeers must unite and defeat a beautiful double agent and her villainous employer from seizing the French throne and engulfing Europe in war.',36.605246,132274484,110,'Every legend has a new beginning.','The Three Musketeers',5.6,924),(391,85000000,'http://www.welcometohotelt.com',76492,'en','Hotel Transylvania','Dracula, who operates a high-end resort away from the human world, goes into overprotective mode when a boy discovers the resort and falls for the count\'s teen-aged daughter.',56.257411,358375603,91,'Where monsters go to get away from it all','Hotel Transylvania',6.8,2566),(392,85000000,'http://disney.go.com/disneypictures/enchanted/',4523,'en','Enchanted','The beautiful princess Giselle is banished by an evil queen from her magical, musical animated land and finds herself in the gritty reality of the streets of modern-day Manhattan. Shocked by this strange new environment that doesn\'t operate on a \"happily ever after\" basis, Giselle is now adrift in a chaotic world badly in need of enchantment. But when Giselle begins to fall in love with a charmingly flawed divorce lawyer who has come to her aid - even though she is already promised to a perfect fairy tale prince back home - she has to wonder: Can a storybook view of romance survive in the real world?',29.219980,340487652,107,'This fairytale princess is about to meet a real Prince Charming','Enchanted',6.6,1449),(393,85000000,'http://www.nooneissafe.com',59961,'en','Safe House','A dangerous CIA renegade resurfaces after a decade on the run. When the safe house he\'s remanded to is attacked by mercenaries, a rookie operative escapes with him. Now, the unlikely allies must stay alive long enough to uncover who wants them dead.',34.773106,208076