scomplicatedmovie.com/',22897,'en','It\'s Complicated','Ten years after their divorce, Jane and Jake Adler unite for their son\'s college graduation and unexpectedly end up sleeping together. But Jake is married, and Jane is embarking on a new romance with her architect. Now, she has to sort out her life – just when she thought she had it all figured out.',16.479851,219103655,121,'First comes marriage. Then comes divorce. And then...','It\'s Complicated',6.2,360),(399,85000000,'http://oceans13.warnerbros.com/',298,'en','Ocean\'s Thirteen','Danny Ocean\'s team of criminals are back and composing a plan more personal than ever. When ruthless casino owner Willy Bank doublecrosses Reuben Tishkoff, causing a heart attack, Danny Ocean vows that he and his team will do anything to bring down Willy Bank along with everything he\'s got. Even if it means asking for help from an enemy.',42.069993,311312624,122,'What are the odds of getting even? 13 to one.','Ocean\'s Thirteen',6.5,1999),(400,85000000,'http://www.sonypictures.com/movies/openseason/',7484,'en','Open Season','Boog, a domesticated 900lb. Grizzly bear finds himself stranded in the woods 3 days before Open Season. Forced to rely on Elliot, a fast-talking mule deer, the two form an unlikely friendship and must quickly rally other forest animals if they are to form a rag-tag army against the hunters.',26.619510,197309027,83,'One Fur All & All Fur One','Open Season',6.1,656),(401,85000000,'http://www.thedivergentseries.movie/#divergent',157350,'en','Divergent','In a world divided into factions based on personality types, Tris learns that she\'s been classified as Divergent and won\'t fit in. When she discovers a plot to destroy Divergents, Tris and the mysterious Four must find out what makes Divergents dangerous before it\'s too late.',80.316463,288747895,139,'What makes you different makes you dangerous.','Divergent',6.9,4663),(402,68000000,NULL,853,'en','Enemy at the Gates','Enemy at the Gates is a war film from Jean-Jacques Annaud from 2001 that takes place during the battle of Stalingard in World War II between the Russians and the Germans.',41.273567,96976270,131,'Some Men Are Born To Be Heroes.','Enemy at the Gates',7.2,999),(403,85000000,'http://www.therundown.com/',10159,'en','The Rundown','When Travis, the mouthy son of a criminal, disappears in the Amazon in search of a treasured artifact, his father sends in Beck, who becomes Travis\'s rival for the affections of Mariana, a mysterious Brazilian woman. With his steely disposition, Beck is a man of few words -- but it takes him all the discipline he can muster to work with Travis to nab a tyrant who\'s after the same treasure.',24.107835,80916492,104,'cut to the chase','The Rundown',6.4,514),(404,85000000,NULL,9593,'en','Last Action Hero','Danny is obsessed with a fictional movie character action hero Jack Slater. When a magical ticket transports him into Jack\'s latest adventure, Danny finds himself in a world where movie magic and reality collide. Now it\'s up to Danny to save the life of his hero and new friend.',32.044191,137298489,130,'This isn\'t the movies anymore.','Last Action Hero',6.1,712),(405,85000000,'http://www.sonypictures.com/homevideo/memoirsofageisha/index.html',1904,'en','Memoirs of a Geisha','A sweeping romantic epic set in Japan in the years before World War II, a penniless Japanese child is torn from her family to work as a maid in a geisha house.',16.595874,162242962,145,'My world is as forbidden as it is fragile; without its mysteries, it cannot survive.','Memoirs of a Geisha',7.3,652),(406,85000000,'http://www.thefastandthefurious3.com/',9615,'en','The Fast and the Furious: Tokyo Drift','In order to avoid a jail sentence, Sean Boswell heads to Tokyo to live with his military father. In a low-rent section of the city, Shaun gets caught up in the underground world of drift racing',8.282876,158468292,104,'On the streets of Tokyo, speed needs no translation...','The Fast and the Furious: Tokyo Drift',6.1,1705),(407,NULL,'http://www.arthurchristmas.com/',51052,'en','Arthur Christmas','Each Christmas, Santa and his vast army of highly trained elves produce gifts and distribute them around the world in one night. However, when one of 600 million children to receive a gift from Santa on Christmas Eve is missed, it is deemed ‘acceptable’ to all but one – Arthur. Arthur Claus is Santa’s misfit son who executes an unauthorized rookie mission to get the last present half way around the globe before dawn on Christmas morning.',19.836830,NULL,97,'Ever wonder how 2 Billion presents get delivered all in 1 night?','Arthur Christmas',6.7,333),(408,90000000,'http://www.meetjoeblack.com/',297,'en','Meet Joe Black','When the grim reaper comes to collect the soul of megamogul Bill Parrish, he arrives with a proposition: Host him for a \"vacation\" among the living in trade for a few more days of existence. Parrish agrees, and using the pseudonym Joe Black, Death begins taking part in Parrish\'s daily agenda and falls in love with the man\'s daughter. Yet when Black\'s holiday is over, so is Parrish\'s life.',36.069611,142940100,178,'Sooner or later everyone does.','Meet Joe Black',6.9,1147),(409,85000000,'http://www.wbshop.com/product/code/1000040993.do',9884,'en','Collateral Damage','Firefighter Gordon Brewer is plunged into the complex and dangerous world of international terrorism after he loses his wife and child in a bombing credited to Claudio \'The Wolf\' Perrini.',18.827753,78382433,108,'What would you do if you lost everything?','Collateral Damage',5.5,427),(410,NULL,NULL,16858,'en','All That Jazz','Bob Fosse\'s semi-autobiographical film celebrates show business stripped of glitz or giddy illusions. Joe Gideon (Roy Scheider) is at the top of the heap, one of the most successful directors and choreographers in musical theatre. But he can feel his world slowly collapsing around him--his obsession with work has almost destroyed his personal life, and only his bottles of