ld when they join forces to thwart a rogue cat spy with her own sinister plans for conquest.',11.773980,112483764,82,'Just like real spies... only furrier.','Cats & Dogs 2 : The Revenge of Kitty Galore',4.9,119),(420,85000000,'http://www.fox.co.uk/jumper',8247,'en','Jumper','David Rice is a man who knows no boundaries, a Jumper, born with the uncanny ability to teleport instantly to anywhere on Earth. When he discovers others like himself, David is thrust into a dangerous and bloodthirsty war while being hunted by a sinister and determined group of zealots who have sworn to destroy all Jumpers. Now, David’s extraordinary gift may be his only hope for survival!',21.218000,222231186,88,'anywhere is possible.','Jumper',5.9,1799),(421,85000000,NULL,11253,'en','Hellboy II: The Golden Army','In this continuation to the adventure of the demon superhero, an evil elf breaks an ancient pact between humans and creatures, as he declares war against humanity. He is on a mission to release The Golden Army, a deadly group of fighting machines that can destroy the human race. As Hell on Earth is ready to erupt, Hellboy and his crew set out to defeat the evil prince.',58.579760,160388063,120,'Saving the world is a hell of a job.','Hellboy II: The Golden Army',6.5,1527),(422,65000000,NULL,1949,'en','Zodiac','The true story of the investigation of \'The Zodiac Killer\',  a serial killer who terrified the San Francisco Bay Area, taunting police with his ciphers and letters. The case becomes an obsession for four men as their lives and careers are built and destroyed by the endless trail of clues.',51.970905,84785914,157,'There\'s more than one way to lose your life to a killer.','Zodiac',7.3,2023),(423,82000000,NULL,8452,'en','The 6th Day','Futuristic action about a man who meets a clone of himself and stumbles into a grand conspiracy about clones taking over the world.',18.447479,96085477,123,'Are You Who You Think You Are','The 6th Day',5.7,595),(424,80000000,'http://www.brucealmighty.com/',310,'en','Bruce Almighty','Bruce Nolan toils as a \"human interest\" television reporter in Buffalo, N.Y. Despite his high ratings and the love of his beautiful girlfriend, Grace, Bruce remains unfulfilled. At the end of the worst day in his life, he angrily ridicules God -- and the Almighty responds, endowing Bruce with all of His divine powers.',109.684788,484572835,101,'In Bruce we trust','Bruce Almighty',6.4,3012),(425,80000000,'http://expendablesthemovie.com/',27578,'en','The Expendables','Barney Ross leads a band of highly skilled mercenaries including knife enthusiast Lee Christmas, a martial arts expert, heavy weapons specialist, demolitionist, and a loose-cannon sniper. When the group is commissioned by the mysterious Mr. Church to assassinate the dictator of a small South American island, Barney and Lee visit the remote locale to scout out their opposition and discover the true nature of the conflict engulfing the city.',77.580661,274470394,103,'Choose Your Weapon.','The Expendables',6.0,2926),(426,80000000,'http://www.missionimpossible.com/',954,'en','Mission: Impossible','When Ethan Hunt, the leader of a crack espionage team whose perilous operation has gone awry with no explanation, discovers that a mole has penetrated the CIA, he\'s surprised to learn that he\'s the No. 1 suspect. To clear his name, Hunt now must ferret out the real double agent and, in the process, even the score.',75.290998,457696359,110,'Expect the Impossible.','Mission: Impossible',6.7,2631),(427,75000000,'http://www.thehungergames.movie/',70160,'en','The Hunger Games','Every year in the ruins of what was once North America, the nation of Panem forces each of its twelve districts to send a teenage boy and girl to compete in the Hunger Games.  Part twisted entertainment, part government intimidation tactic, the Hunger Games are a nationally televised event in which “Tributes” must fight with one another until one survivor remains.  Pitted against highly-trained Tributes who have prepared for these Games their entire lives, Katniss is forced to rely upon her sharp instincts as well as the mentorship of drunken former victor Haymitch Abernathy.  If she’s ever to return home to District 12, Katniss must make impossible choices in the arena that weigh survival against humanity and life against love. The world will be watching.',68.550698,691210692,142,'May The Odds Be Ever In Your Favor.','The Hunger Games',6.9,9455),(428,80000000,'http://hangoverpart2.warnerbros.com/',45243,'en','The Hangover Part II','The Hangover crew heads to Thailand for Stu\'s wedding. After the disaster of a bachelor party in Las Vegas last year, Stu is playing it safe with a mellow pre-wedding brunch. However, nothing goes as planned and Bangkok is the perfect setting for another adventure with the rowdy group.',58.040149,254455986,102,'The Wolfpack Is Back','The Hangover Part II',6.2,3739),(429,80000000,NULL,364,'en','Batman Returns','Having defeated the Joker, Batman now faces the Penguin - a warped and deformed individual who is intent on being accepted into Gotham society. Crooked businessman Max Schreck is coerced into helping him become Mayor of Gotham and they both attempt to expose Batman in a different light. Selina Kyle, Max\'s secretary, is thrown from the top of a building and is transformed into Catwoman - a mysterious figure who has the same personality disorder as Batman. Batman must attempt to clear his name, all the time deciding just what must be done with the Catwoman.',59.113174,280000000,126,'The Bat, the Cat, the Penguin.','Batman Returns',6.6,1673),(430,80000000,NULL,7518,'en','Over the Hedge','A scheming raccoon fools a mismatched family of forest creatures into helping him repay a debt of food, by invading the new suburban sprawl that popped up while they were hibernating – and learns a lesson about family himself.',36.327050,343397247,83,'Taking back the neighborhood... One snack at a time.','Over the Hedge',6.3,1074),(431,80000000,NULL,11544,'en','Lilo & Stitch','A lonely Hawaiian girl named Lilo is being raised by her older sister, Nani, after their parents die -- under the watch of social worker Cobra Bubbles. When Lilo adopts a funny-looking dog and names him \"Stitch,\" she doesn\'t realize her new best friend is a wacky alien created by mad scientist Dr. Jumba.',55.659988,145771527,85,'He\'s coming to our galaxy.','Lilo & Stitch',7.1,1314),(432,85000000,NULL,9986,'en','Charlotte\'s Web','Wilbur the pig is scared of the end of the season, because he knows that come that time, he will end up on the dinner table. He hatches a plan with Charlotte, a spider that lives in his pen, to ensure that this will never happen.',14.132583,144000000,97,'Something unexpected, unbelievable, unforgettable.','Charlotte\'s Web',5.8,288),(433,75000000,NULL,8656,'en','Deep Impact','A seven-mile-wide space rock is hurtling toward Earth, threatening to obliterate the planet. Now, it\'s up to the president of the United States to save the world. He appoints a tough-as-nails veteran astronaut to lead a joint American-Russian crew into space to destroy the comet before impact. Meanwhile, an enterprising reporter uses her smarts to uncover the scoop of the century.',34.070054,140464664,120,'Heaven and Earth are about to collide.','Deep Impact',5.9,855),(434,84000000,'http://red-themovie.com/',146216,'en','RED 2','Retired C.I.A. agent Frank Moses reunites his unlikely team of elite operatives for a global quest to track down a missing portable nuclear device.',44.343330,NULL,116,'The best never rest.','RED 2',6.4,1526),(435,82000000,NULL,9291,'en','The Longest Yard','Pro quarter-back, Paul Crewe and former college champion and coach, Nate Scarboro are doing time in the same prison. Asked to put together a team of inmates to take on the guards, Crewe enlists the help of Scarboro to coach the inmates to victory in a football game \'fixed\' to turn out quite another way.',26.065735,190320568,113,'If you can\'t get out, get even.','The Longest Yard',6.2,785),(436,75000000,'http://www.munkyourself.com/',55301,'en','Alvin and the Chipmunks: Chipwrecked','Playing around while aboard a cruise ship, the Chipmunks and Chipettes accidentally go overboard and end up marooned in a tropical paradise. They discover their new turf is not as deserted as it seems.',23.473004,342695435,87,'This holiday it\'s gonna get squeaky.','Alvin and the Chipmunks: Chipwrecked',5.4,484),(437,80000000,'http://www.sonypictures.com/movies/grownups2',109418,'en','Grown Ups 2','The all-star comedy cast from Grown Ups returns (with some exciting new additions) for more summertime laughs. Lenny (Adam Sandler) has relocated his family back to the small town where he and his friends grew up. This time around, the grown ups are the ones learning lessons from their kids on a day notoriously full of surprises: the last day of school.',45.589568,246984278,100,'Just because they\'re a little older doesn\'t mean they\'ve grown up.','Grown Ups 2',5.8,1155),(438,80000000,'http://getsmartmovie.warnerbros.com/',11665,'en','Get Smart','When the identities of secret agents from Control are compromised, the Chief promotes hapless but eager analyst Maxwell Smart and teams him with stylish, capable Agent 99, the only spy whose cover remains intact. Can they work together to thwart the evil plans of KAOS and its crafty operative?',23.496054,230685453,110,'Saving The World...And Loving It!','Get Smart',6.0,1051),(439,80000000,NULL,6964,'en','Something\'s Gotta Give','Harry Sanborn is an aged music industry exec with a fondness for younger women like Marin, his latest trophy girlfriend. Things get a little awkward when Harry suffers a heart attack at the home of Marin\'s mother, Erica. Left in the care of Erica and his doctor, a love triangle starts to take shape.',16.939441,266728738,128,'Schmucks are people too.','Something\'s Gotta Give',6.3,410),(440,80000000,'http://www.shutterisland.com/',11324,'en','Shutter Island','World War II soldier-turned-U.S. Marshal Teddy Daniels investigates the disappearance of a patient from a hospital for the criminally insane, but his efforts are compromised by his troubling visions and also by a mysterious doctor.',81.914696,294804195,138,'Someone is missing.','Shutter Island',7.8,6336),(441,80000000,NULL,12193,'en','Four Christmases','Brad and Kate have made something of an art form out of avoiding their families during the holidays, but this year their foolproof plan is about go bust -- big time. Stuck at the city airport after all departing flights are canceled, the couple is embarrassed to see their ruse exposed to the world by an overzealous television reporter. Now, Brad and Kate are left with precious little choice other than to swallow their pride and suffer the rounds.',19.500893,163733697,88,'His father, her mother, his mother and her father all in one day.','Four Christmases',5.3,331),(442,75000000,NULL,9928,'en','Robots','Rodney Copperbottom is a young robot inventor who dreams of making the world a better place, until the evil Ratchet takes over Big Weld Industries. Now, Rodney\'s dreams – and those of his friends – are in danger of becoming obsolete.',29.558157,260696994,91,'You can shine no matter what you\'re made of.','Robots',6.0,1333),(443,80000000,NULL,754,'en','Face/Off','An antiterrorism agent goes under the knife to acquire the likeness of a terrorist and gather details about a bombing plot. When the terrorist escapes custody, he undergoes surgery to look like the agent so he can get close to the agent\'s family.',46.075037,245676146,138,'In order to catch him, he must become him.','Face/Off',6.8,1583),(444,80000000,NULL,10202,'en','Bedtime Stories','Skeeter Bronson is a down-on-his-luck guy who\'s always telling bedtime stories to his niece and nephew. But his life is turned upside down when the fantastical stories he makes up for entertainment inexplicably turn into reality. Can a bewildered Skeeter manage his own unruly fantasies now that the outrageous characters and situations from his mind have morphed into actual people and events?',23.531721,212874442,99,'Whatever they dream up... he has to survive.','Bedtime Stories',5.9,901),(445,80000000,NULL,4147,'en','Road to Perdition','Mike Sullivan works as a hit man for crime boss John Rooney. Sullivan views Rooney as a father figure, however after his son is witness to a killing, Mike Sullivan finds himself on the run in attempt to save the life of his son and at the same time looking for revenge on those who wronged him.',49.078546,181001478,117,'Pray for Michael Sullivan.','Road to Perdition',7.3,1077),(446,80000000,'http://www.justgowithit-movie.com',50546,'en','Just Go with It','A plastic surgeon, romancing a much younger schoolteacher, enlists his loyal assistant to pretend to be his soon to be ex-wife, in order to cover up a careless lie. When more lies backfire, the assistant\'s kids become involved, and everyone heads off for a weekend in Hawaii that will change all their lives.',37.026650,214918407,117,'Sometimes a guy\'s best wingman... is a wingwoman','Just Go with It',6.3,1543),(447,75000000,NULL,1701,'en','Con Air','When the government puts all its rotten criminal eggs in one airborne basket, it\'s asking for trouble. Before you can say, \"Pass the barf bag,\" the crooks control the plane, led by creepy Cyrus \"The Virus\" Grissom. Watching his every move is the just-released Cameron Poe, who\'d rather reunite with his family.',45.154631,224012234,115,'They were deadly on the ground; Now they have wings','Con Air',6.5,1270),(448,80000000,NULL,13027,'en','Eagle Eye','Jerry Shaw and Rachel Holloman are two strangers whose lives are suddenly thrown into turmoil by a mysterious woman they have never met. Threatening their lives and family, the unseen caller uses everyday technology to control their actions and push them into increasing danger. As events escalate, Jerry and Rachel become the country\'s most-wanted fugitives and must figure out what is happening to them.',46.887983,178066569,118,'Don\'t walk. Run.','Eagle Eye',6.3,1018),(449,79000000,NULL,2289,'en','Cold Mountain','In this classic story of love and devotion set against the backdrop of the American Civil War, a wounded Confederate soldier named W.P. Inman deserts his unit and travels across the South, aiming to return to his young wife, Ada, who he left behind to tend their farm. As Inman makes his perilous journey home, Ada struggles to keep their home intact with the assistance of Ruby, a mysterious drifter sent to help her by a kindly neighbor.',24.598479,173013509,154,'Find the strength. Find the courage. No matter what it takes... find the way home.','Cold Mountain',6.7,533),(450,80000000,NULL,20504,'en','The Book of Eli','A post-apocalyptic tale, in which a lone man fights his way across America in order to protect a sacred book that holds the secrets to saving humankind.',32.363538,157107755,118,'Some will kill to have it. He will kill to protect it.','The Book of Eli',6.6,2164),(451,80000000,NULL,9574,'en','Flubber','Professor Phillip Brainard, an absent minded professor, works with his assistant Weebo, trying to create a substance that\'s a new source of energy and that will save Medfield College where his sweetheart Sara is the president. He has missed his wedding twice, and on the afternoon of his third wedding, Professor Brainard creates flubber, which allows objects to fly through the air.',11.503960,177977226,93,'Catch it if you can!','Flubber',5.3,695),(452,80000000,NULL,11618,'en','The Haunting','Dr. David Marrow invites Nell Vance, and Theo and Luke Sanderson to the eerie and isolated Hill House to be subjects for a sleep disorder study. The unfortunate guests discover that Marrow is far more interested in the sinister mansion itself – and they soon see the true nature of its horror.',19.375768,91188905,113,'Some houses are born bad.','The Haunting',5.2,369),(453,80000000,'http://www.warnerbros.com/archive/spacejam/movie/jam.htm',2300,'en','Space Jam','In a desperate attempt to win a basketball match and earn their freedom, the Looney Tunes seek the aid of retired basketball champion, Michael Jordan.',36.125715,250200000,88,'Get ready to jam.','Space Jam',6.5,1288),(454,NULL,NULL,12096,'en','The Pink Panther','When the coach of the France soccer team is killed by a poisoned dart in the stadium in the end of a game, and his expensive and huge ring with the diamond Pink Panther disappears, the ambitious Chief Inspector Dreyfus assigns the worst police inspector Jacques Clouseau to the case.',25.450534,NULL,93,'Pardon His French.','The Pink Panther',5.6,550),(455,80000000,NULL,10200,'en','The Day the Earth Stood Still','A representative of an alien race that went through drastic evolution to survive its own climate change, Klaatu comes to Earth to assess whether humanity can prevent the environmental damage they have inflicted on their own planet. When barred from speaking to the United Nations, he decides humankind shall be exterminated so the planet can survive.',41.890722,233093859,104,'12.12.08 is the Day the Earth Stood Still','The Day the Earth Stood Still',5.2,1043),(456,75000000,NULL,8834,'en','Conspiracy Theory','A man obsessed with conspiracy theories becomes a target after one of his theories turns out to be true. Unfortunately, in order to save himself, he has to figure out which theory it is.',22.179658,136982834,135,'What if your most paranoid nightmares had just come true?','Conspiracy Theory',6.5,431),(457,68000000,NULL,228150,'en','Fury','Last months of World War II in April 1945. As the Allies make their final push in the European Theater, a battle-hardened U.S. Army sergeant in the 2nd Armored Division named Wardaddy commands a Sherman tank called \"Fury\" and its five-man crew on a deadly mission behind enemy lines. Outnumbered and outgunned, Wardaddy and his men face overwhelming odds in their heroic attempts to strike at the heart of Nazi Germany.',139.575085,211817906,135,'War never ends quietly.','Fury',7.4,3946),(458,70000000,NULL,6068,'en','Six Days Seven Nights','When Quinn, a grouchy pilot living the good life in the South Pacific, agrees to transfer a savvy fashion editor, Robin, to Tahiti, he ends up stranded on a deserted island with her after their plane crashes. The pair avoid each other at first, until they\'re forced to team up to escape from the island -- and some pirates who want their heads.',18.264635,164000000,98,'After this week in paradise, they’re going to need a vacation.','Six Days Seven Nights',5.6,332),(459,80000000,'http://www.yogibear.com/',41515,'en','Yogi Bear','Jellystone Park has been losing business, so greedy Mayor Brown decides to shut it down and sell the land. That means families will no longer be able to experience the natural beauty of the outdoors -- and, even worse, Yogi and Boo Boo will be tossed out of the only home they\'ve ever known. Faced with his biggest challenge ever, Yogi must prove that he really is \"smarter than the average bear\" as he and Boo Boo join forces with their old nemesis Ranger Smith to find a way to save Jellystone Park from closing forever.',11.187696,201584141,80,'Life\'s a Pic-A-Nic','Yogi Bear',5.2,220),(460,80000000,NULL,9023,'en','Spirit: Stallion of the Cimarron','As a wild stallion travels across the frontiers of the Old West, he befriends a young human and finds true love with a mare.',41.670544,122563539,83,'Leader. Hero. Legend.','Spirit: Stallion of the Cimarron',7.4,831),(461,80000000,'http://www.zookeeper-movie.com/',38317,'en','Zookeeper','A comedy about a zookeeper who might be great with animals, but he doesn\'t know anything about the birds and the bees. The man can\'t find love, so he decides to quit his job at the zoo, but his animal friends try to stop him and teach him that Mother Nature knows best when it comes to love.',27.462640,169852759,102,'Welcome to his jungle.','Zookeeper',5.3,498),(462,80000000,NULL,2157,'en','Lost in Space','The prospects for continuing life on Earth in the year 2058 are grim. So the Robinsons are launched into space to colonize Alpha Prime, the only other inhabitable planet in the galaxy. But when a stowaway sabotages the mission, the Robinsons find themselves hurtling through uncharted space.',17.455024,136159423,130,'Danger, Will Robinson!','Lost in Space',5.0,388),(463,80000000,NULL,14462,'en','The Manchurian Candidate','When his army unit was ambushed during the first Gulf War, Sergeant Raymond Shaw saved his fellow soldiers just as his commanding officer, then-Captain Ben Marco, was knocked unconscious. Brokering the incident for political capital, Shaw eventually becomes a vice-presidential nominee, while Marco is haunted by dreams of what happened -- or didn\'t happen -- in Kuwait. As Marco (now a Major) investigates, the story begins to unravel, to the point where he questions if it happened at all. Is it possible the entire unit was kidnapped and brainwashed to believe Shaw is a war hero as part of a plot to seize the White House? Some very powerful people at Manchurian Global corporation appear desperate to stop him from finding out.',21.394281,96105964,129,'This summer everything is under control.','The Manchurian Candidate',6.2,393),(464,NULL,NULL,161795,'en','Déjà Vu','L.A. shop owner Dana and Englishman Sean meet and fall in love at first sight, but Sean is married and Dana is to marry her business partner Alex.',0.605645,NULL,117,'Your future is set...','Déjà Vu',8.0,1),(465,80000000,NULL,159824,'en','Hotel Transylvania 2','When the old-old-old-fashioned vampire Vlad arrives at the hotel for an impromptu family get-together, Hotel Transylvania is in for a collision of supernatural old-school and modern day cool.',61.692197,473226958,89,'They\'re back to raise a little terror','Hotel Transylvania 2',6.7,1497),(466,80000000,'http://movies.disney.com/fantasia-2000',49948,'en','Fantasia 2000','Blending lively music and brilliant animation, this sequel to the original \'Fantasia\' restores \'The Sorcerer\'s Apprentice\' and adds seven new shorts.',14.530946,90874570,74,NULL,'Fantasia 2000',7.0,292),(467,80000000,'http://timemachine.countingdown.com/',2135,'en','The Time Machine','Hoping to alter the events of the past, a 19th century inventor instead travels 800,000 years into the future, where he finds humankind divided into two warring races.',25.978555,123729176,96,'The greatest adventure THROUGH all time!','The Time Machine',5.8,631),(468,90000000,NULL,9822,'en','Mighty Joe Young','As a child living in Africa, Jill Young saw her mother killed while protecting wild gorillas from poachers led by Andrei Strasser. Now an adult, Jill cares for an orphaned gorilla named Joe -- who, due to a genetic anomaly, is 15 feet tall. When Gregg O\'Hara arrives from California and sees the animal, he convinces Jill that Joe would be safest at his wildlife refuge. But Strasser follows them to the U.S., intent on capturing Joe for himself.',6.643778,NULL,114,'Survival is an instinct.','Mighty Joe Young',5.9,208),(469,102000000,NULL,9705,'en','Swordfish','Rogue agent Gabriel Shear is determined to get his mitts on $9 billion stashed in a secret Drug Enforcement Administration account. He wants the cash to fight terrorism, but lacks the computer skills necessary to hack into the government mainframe. Enter Stanley Jobson, a n\'er-do-well encryption expert who can log into anything.',36.788745,147080413,99,'Log On. Hack In. Go Anywhere. Get Everything.','Swordfish',6.1,932),(470,75000000,'http://www.sonypictures.com/homevideo/thelegendofzorro/index.html',1656,'en','The Legend of Zorro','Having spent the last 10 years fighting injustice and cruelty, Alejandro de la Vega is now facing his greatest challenge: his loving wife Elena has thrown him out of the house!  Elena has filed for divorce and found comfort in the arms of Count Armand, a dashing French aristocrat.  But Alejandro knows something she doesn\'t: Armand is the evil mastermind behind a terrorist plot to destroy the United States.  And so, with his marriage and the county\'s future at stake, it\'s up to Zorro to save two unions before it\'s too late.',31.054334,142400065,129,'The original caped crusader is back!','The Legend of Zorro',5.9,893),(471,85000000,NULL,12159,'en','What Dreams May Come','Chris Neilson dies to find himself in a heaven more amazing than he could have ever dreamed of. There is one thing missing: his wife. After he dies, his wife, Annie killed herself and went to hell. Chris decides to risk eternity in hades for the small chance that he will be able to bring her back to heaven.',21.891078,71485043,113,'After life there is more. The end is just the beginning.','What Dreams May Come',6.8,577),(472,85000000,NULL,9678,'en','Little Nicky','After the lord of darkness decides he will not cede his thrown to any of his three sons, the two most powerful of them escape to Earth to create a kingdom for themselves. This action closes the portal filtering sinful souls to Hell and causes Satan to wither away. He must send his most weak but beloved son, Little Nicky, to Earth to return his brothers to Hell.',18.335992,NULL,90,'He\'s Never Been To Earth. He\'s Never Even Slept Over Some Other Dude\'s House.','Little Nicky',5.2,438),(473,88000000,NULL,4442,'en','The Brothers Grimm','Folklore collectors and con artists, Jake and Will Grimm, travel from village to village pretending to protect townsfolk from enchanted creatures and performing exorcisms. However, they are put to the test  when they encounter a real magical curse in a haunted forest with real magical beings, requiring genuine courage.',40.138009,105316267,118,'Eliminating Evil Since 1812.','The Brothers Grimm',5.6,818),(474,70000000,'http://marsattacks.warnerbros.com/',75,'en','Mars Attacks!','\'We come in peace\' is not what those green men from Mars mean when they invade our planet, armed with irresistible weapons and a cruel sense of humor.  This star studded cast must play victim to the alien’s fun and games in this comedy homage to science fiction films of the \'50s and \'60s.',44.090535,101371017,106,'Nice planet. We\'ll take it!','Mars Attacks!',6.1,1509),(475,NULL,NULL,330770,'fr','Évolution','11-year-old Nicolas lives with his mother in a seaside housing estate. The only place that ever sees any activity is the hospital. It is there that all the boys from the village are forced to undergo strange medical trials that attempt to disrupt the phases of evolution.',3.300061,NULL,81,NULL,'Evolution',6.4,47),(476,NULL,NULL,9433,'en','The Edge','The plane carrying wealthy Charles Morse crashes down in the Alaskan wilderness. Together with the two other passengers, photographer Robert and assistant Stephen, Charles devises a plan to help them reach civilization. However, his biggest obstacle might not be the elements, or even the Kodiak bear stalking them -- it could be Robert, whom Charles suspects is having an affair with his wife and would not mind seeing him dead.',20.632673,43312294,117,'They were fighting over a woman when the plane went down. Now, their only chance for survival is each other.','The Edge',6.7,349),(477,80000000,'http://chooseyoursurrogate.com/',19959,'en','Surrogates','Set in a futuristic world where humans live in isolation and interact through surrogate robots, a cop is forced to leave his home for the first time in years in order to investigate the murders of others\' surrogates.',36.664991,122444772,89,'How do you save humanity when the only thing that\'s real is you?','Surrogates',5.9,1195),(478,80000000,NULL,11973,'en','Thirteen Days','Dramatisation of the Cuban Missile Crisis, the nuclear standoff with the USSR sparked by the discovery by the Americans of missle bases established on the Soviet allied island of Cuba. Shown from the perspective of the US President, John F Kennedy, his staff and advisors.',18.261210,34566746,145,'You\'ll never believe how close we came','Thirteen Days',6.9,189),(479,80000000,NULL,11228,'en','Daylight','A group of armed robbers fleeing the police head for the New Jersey Tunnel and run right into trucks transporting toxic waste. The spectacular explosion that follows results in both ends of the tunnel collapsing and the handful of people who survived the explosion are now in peril. Kit Latura is the only man with the skill and knowledge to lead the band of survivors out of the tunnel before the structure collapses.',16.681269,159212469,115,'No air. No escape. No time.','Daylight',5.8,378),(480,80000000,'http://www.walkingwithdinosaurs.com/movie/',77951,'en','Walking With Dinosaurs','Walking with Dinosaurs 3D is a film depicting life-like 3D dinosaur characters set in photo-real landscapes that transports audiences to the prehistoric world as it existed 70 million years ago. The film is based on the 1999 documentary television miniseries Walking with Dinosaurs, produced by the BBC. Walking with Dinosaurs 3D is being produced by Evergreen Studios, the company that produced Happy Feet, and it is was released on October 11, 2013.',10.088006,126546518,87,'The Greatest Adventure in 70 Million Years','Walking With Dinosaurs',5.2,133),(481,44000000,NULL,5491,'en','Battlefield Earth','In the year 3000, man is no match for the Psychlos, a greedy, manipulative race of aliens on a quest for ultimate profit. Led by the powerful Terl, the Psychlos are stripping Earth clean of its natural resources, using the broken remnants of humanity as slaves. What is left of the human race has descended into a near primitive state. After being captured, it is up to Tyler to save mankind.',7.891470,21400000,118,'Take Back The Planet','Battlefield Earth',3.0,255),(482,80000000,NULL,10715,'en','Looney Tunes: Back in Action','Bugs Bunny and Daffy Duck are up to their feuding ways again. Tired of playing second fiddle to Bugs, Daffy has decided to leave the Studio for good. He is aided by Warner Bros.\' humor impaired Vice President of Comedy, Kate Houghton, who releases him from his contract and instructs WB security guard/aspiring stunt man DJ Drake to capture and \"escort\" Daffy off the studio lot.',16.715631,68514844,90,'Real life has never been so animated.','Looney Tunes: Back in Action',5.6,297),(483,80000000,'http://nine-movie.com/',10197,'en','Nine','Arrogant, self-centered movie director Guido Contini finds himself struggling to find meaning, purpose, and a script for his latest film endeavor. With only a week left before shooting begins, he desperately searches for answers and inspiration from his wife, his mistress, his muse, and his mother.',9.357734,53825515,112,'This Holiday Season, Be Italian','Nine',5.1,165),(484,80000000,NULL,9562,'en','Timeline','A group of archaeological students become trapped in the past when they go there to retrieve their professor. The group must survive in 14th century France long enough to be rescued.',11.222680,19480739,116,'They had to travel into the past to save the future','Timeline',5.4,318),(485,80000000,NULL,9922,'en','The Postman','In 2013 there are no highways, no I-ways, no dreams of a better tomorrow, only scattered survivors across what was once the Unites States. Into this apocalyptic wasteland comes an enigmatic drifter with a mule, a knack for Shakespeare and something yet undiscovered: the power to inspire hope.',14.564667,17626234,177,'The year is 2013. One man walked in off the horizon and hope came with him.','The Postman',6.1,299),(486,90000000,NULL,9447,'en','Babe: Pig in the City','Babe, fresh from his victory in the sheepherding contest, returns to Farmer Hoggett\'s farm, but after Farmer Hoggett is injured and unable to work, Babe has to go to the big city to save the farm.',11.356079,69131860,92,'This little pig went to the city...','Babe: Pig in the City',5.2,305),(487,90000000,'http://www.thelastwitchhunter.movie/',274854,'en','The Last Witch Hunter','The modern world holds many secrets, but by far the most astounding is that witches still live among us; vicious supernatural creatures intent on unleashing the Black Death upon the world and putting an end to the human race once and for all. Armies of witch hunters have battled this unnatural enemy for centuries, including Kaulder, a valiant warrior who many years ago slayed the all-powerful Witch Queen, decimating her followers in the process. In the moments right before her death, the Queen cursed Kaulder with immortality, forever separating him from his beloved wife and daughter. Today, Kaulder is the last living hunter who has spent his immortal life tracking down rogue witches, all the while yearning for his long-lost family.',52.612025,146936910,106,'Hunt forever.','The Last Witch Hunter',5.7,1316),(488,80000000,NULL,8870,'en','Red Planet','Astronauts search for solutions to save a dying Earth by searching on Mars, only to have the mission go terribly awry.',13.800656,33463969,106,'Not A Sound. Not A Warning. Not A Chance. Not Alone.','Red Planet',5.4,267),(489,86000000,NULL,9992,'en','Arthur et les Minimoys','Arthur is a spirited ten-year old whose parents are away looking for work, whose eccentric grandfather has been missing for several years, and who lives with his grandmother in a country house that, in two days, will be repossessed, torn down, and turned into a block of flats unless Arthur\'s grandfather returns to sign some papers and pay off the family debt. Arthur discovers that the key to success lies in his own descent into the land of the Minimoys, creatures no larger than a tooth, whom his grandfather helped relocate to their garden. Somewhere among them is hidden a pile of rubies, too. Can Arthur be of stout heart and save the day? Romance beckons as well, and a villain lurks.',27.097932,107944236,94,'Adventure awaits in your own backyard.','Arthur and the Invisibles',6.0,639),(490,NULL,'http://oceans-lefilm.com/',36970,'en','Oceans','An ecological drama/documentary, filmed throughout the globe. Part thriller, part meditation on the vanishing wonders of the sub-aquatic world.',10.706613,19406406,84,'Explore the depths of our planet\'s oceans.  Experience the stories that connect their world to ours.','Oceans',7.3,111),(491,80000000,'http://asoundofthunder.warnerbros.com/',10077,'en','A Sound of Thunder','When a hunter sent back to the prehistoric era runs off the path he must not leave, he causes a chain reaction that alters history in disastrous ways.',7.342892,5989640,110,'Some Rules Should Never Be Broken.','A Sound of Thunder',4.8,111),(492,130000000,NULL,76649,'en','Pompeii','Set in 79 A.D., POMPEII tells the epic story of Milo, a slave turned invincible gladiator who finds himself in a race against time to save his true love Cassia, the beautiful daughter of a wealthy merchant who has been unwillingly betrothed to a corrupt Roman Senator. As Mount Vesuvius erupts in a torrent of blazing lava, Milo must fight his way out of the arena in order to save his beloved as the once magnificent Pompeii crumbles around him.',50.561849,117831631,105,'No warning. No escape.','Pompeii',5.2,1267),(493,8000000,NULL,293644,'es','Don Gato: El inicio de la pandilla','Top Cat has arrived to charm his way into your hearts! Ever wonder how this scheming feline got his start? Well Top Cat Begins reveals the origins of everything you know and love about this classic comedy hero. What follows is an adventure so crazy that it has to be seen to be believed!',0.719996,NULL,89,NULL,'Top Cat Begins',5.3,9),(494,60000000,'http://www.abeautifulmind.com/',453,'en','A Beautiful Mind','At Princeton University, John Nash struggles to make a worthwhile contribution to serve as his legacy to the world of mathematics. He finally makes a revolutionary breakthrough that will eventually earn him the Nobel Prize. After graduate school he turns to teaching, becoming romantically involved with his student Alicia. Meanwhile the government asks his help with breaking Soviet codes, which soon gets him involved in a terrifying conspiracy plot. Nash grows more and more paranoid until a discovery that turns his entire world upside down. Now it is only with Alicia\'s help that he will be able to recover his mental strength and regain his status as the great mathematician we know him as today..',59.248437,313542341,135,'I need to believe that something extra ordinary is possible...','A Beautiful Mind',7.7,3009),(495,45000000,'http://movies.disney.com/the-lion-king',8587,'en','The Lion King','A young lion cub named Simba can\'t wait to be king. But his uncle craves the title for himself and will stop at nothing to get it.',90.457886,788241776,89,'Life\'s greatest adventure is finding your place in the Circle of Life.','The Lion King',8.0,5376),(496,79000000,'http://www.themysteriousisland.com/',72545,'en','Journey 2: The Mysterious Island','Sean Anderson partners with his mom\'s boyfriend on a mission to find his grandfather, who is thought to be missing on a mythical island.',40.723459,355692760,94,'Believe the Impossible. Discover the Incredible.','Journey 2: The Mysterious Island',5.8,1030),(497,78000000,NULL,109451,'en','Cloudy with a Chance of Meatballs 2','After the disastrous food storm in the first film, Flint and his friends are forced to leave the town. Flint accepts the invitation from his idol Chester V to join The Live Corp Company, which has been tasked to clean the island, and where the best inventors in the world create technologies for the betterment of mankind. When Flint discovers that his machine still operates and now creates mutant food beasts like living pickles, hungry tacodiles, shrimpanzees and apple pie-thons, he and his friends must return to save the world.',41.247402,248384621,95,'Something big was leftover.','Cloudy with a Chance of Meatballs 2',6.4,915),(498,78000000,NULL,9533,'en','Red Dragon','Former FBI Agent Will Graham, who was once almost killed by the savage Hannibal \'The Cannibal\' Lecter, now has no choice but to face him again, as it seems Lecter is the only one who can help Graham track down a new serial killer.',10.083905,209196298,124,'Before the Silence.','Red Dragon',6.7,1115),(499,100000000,NULL,2023,'en','Hidalgo','Set in 1890, this is the story of a Pony Express courier who travels to Arabia to compete with his horse, Hidalgo, in a dangerous race for a massive contest prize, in an adventure that sends the pair around the world...',16.759252,108103450,136,'Unbridled. Unbroken. Unbeaten.','Hidalgo',6.5,318),(500,79000000,'http://www.jackandjill-movie.com/',71880,'en','Jack and Jill','Jack Sadelstein, a successful advertising executive in Los Angeles with a beautiful wife and kids, dreads one event each year: the Thanksgiving visit of his twin sister Jill. Jill\'s neediness and passive-aggressiveness is maddening to Jack, turning his normally tranquil life upside down.',22.132418,149673788,91,'His twin sister is coming for the holidays... ...and it ain\'t pretty.','Jack and Jill',4.1,604),(501,76000000,NULL,584,'en','2 Fast 2 Furious','It\'s a major double-cross when former police officer Brian O\'Conner teams up with his ex-con buddy Roman Pearce to transport a shipment of \"dirty\" money for shady Miami-based import-export dealer Carter Verone. But the guys are actually working with undercover agent Monica Fuentes to bring Verone down.',10.520961,236350661,107,'How Fast Do You Want It?','2 Fast 2 Furious',6.2,2028),(502,64000000,'http://www.thelittleprincemovie.com/',309809,'en','The Little Prince','Based on the best-seller book \'The Little Prince\', the movie tells the story of a little girl that lives with resignation in a world where efficiency and work are the only dogmas. Everything will change when accidentally she discovers her neighbor that will tell her about the story of the Little Prince that he once met.',35.384423,97571250,92,'Growing up isn\'t the problem... forgetting is.','The Little Prince',7.6,756),(503,80000000,NULL,4858,'en','The Invasion','Washington, D.C. psychologist Carol Bennell and her colleague Dr. Ben Driscoll are the only two people on Earth who are aware of an epidemic running rampant through the city. They discover an alien virus aboard a crashed space shuttle that transforms anyone who comes into contact with it into unfeeling drones while they sleep. Carol realizes her son holds the key to stopping the spread of the plague and she races to find him before it is too late.',15.673154,15071514,99,'Do not trust anyone. Do not show emotion. Do not fall asleep.','The Invasion',5.7,359),(504,76000000,NULL,17711,'en','The Adventures of Rocky & Bullwinkle','Rocky and Bullwinkle have been living off the finances made from the reruns of their cartoon show. Boris and Natasha somehow manage to crossover into reality and team up with Fearless Leader, an evil criminal turned media mogul with some evil plans up his sleeve. Rocky and Bullwinkle must stop the three of them before they wreak havoc.',8.981427,35134820,88,'This summer it\'s not the same old bull.','The Adventures of Rocky & Bullwinkle',3.9,87),(505,75000000,'http://www.thesecretlifeofpets.com/',328111,'en','The Secret Life of Pets','The quiet life of a terrier named Max is upended when his owner takes in Duke, a stray whom Max instantly dislikes.',31.482872,875958308,87,'Think this is what they do all day?','The Secret Life of Pets',5.9,3462),(506,78000000,NULL,8698,'en','The League of Extraordinary Gentlemen','To prevent a world war from breaking out, famous characters from Victorian literature band together to do battle against a cunning villain.',47.436675,179265204,110,'The power of seven become a league of one.','The League of Extraordinary Gentlemen',5.7,1155),(507,76000000,'http://www.despicableme.com/',93456,'en','Despicable Me 2','Gru is recruited by the Anti-Villain League to help deal with a powerful new super criminal.',136.886704,970761885,98,'Back 2 Work','Despicable Me 2',7.0,4637),(508,75000000,NULL,602,'en','Independence Day','On July 2, a giant alien mothership enters orbit around Earth and deploys several dozen saucer-shaped \'destroyer\' spacecraft that quickly lay waste to major cities around the planet. On July 3, the United States conducts a coordinated counterattack that fails. On July 4, a plan is devised to gain access to the interior of the alien mothership in space, in order to plant a nuclear missile.',60.442593,816969268,145,'Earth. Take a good look. It might be your last.','Independence Day',6.7,3260),(509,73000000,NULL,330,'en','The Lost World: Jurassic Park','Four years after Jurassic Park\'s genetically bred dinosaurs ran amok, multimillionaire John Hammond shocks chaos theorist Ian Malcolm by revealing that Hammond has been breeding more beasties at a secret location. Malcolm, his paleontologist ladylove and a wildlife videographer join an expedition to document the lethal lizards\' natural behavior in this action-packed thriller.',2.502487,229074524,129,'Something has survived.','The Lost World: Jurassic Park',6.2,2487),(510,75000000,NULL,953,'en','Madagascar','Zoo animals leave the comforts of man-made habitats for exotic adventure in this animated family film. After escaping from the zoo, four friends -- a lion, a hippo, a zebra and a giraffe -- are sent back to Africa. When their ship capsizes, stranding them on Madagascar, an island populated by crazy critters, the pals must adapt to jungle life and their new roles as wild animals.',48.110909,532680671,86,'Someone\'s got a zoo loose.','Madagascar',6.6,3237),(511,76000000,'http://www.universalstudiosentertainment.com/children-of-men/',9693,'en','Children of Men','In 2027, in a chaotic world in which humans can no longer procreate, a former activist agrees to help transport a miraculously pregnant woman to a sanctuary at sea, where her child\'s birth may help scientists save the future of humankind.',35.387874,69959751,109,'The future\'s a thing of the past.','Children of Men',7.4,2071),(512,75000000,NULL,36657,'en','X-Men','Two mutants, Rogue and Wolverine, come to a private academy for their kind whose resident superhero team, the X-Men, must oppose a terrorist organization with similar powers.',4.668910,296339527,104,'Evolution Begins','X-Men',6.8,4097),(513,75000000,'http://www.wantedmovie.com/',8909,'en','Wanted','Doormat Wesley Gibson discovers that his recently murdered father – who Wesley never knew – belonged to a secret guild of assassins. After a leather-clad sexpot drafts Wesley into the society, he hones his innate killing skills and turns avenger.',73.822890,258270008,110,'Choose your destiny.','Wanted',6.4,2528),(514,75000000,NULL,9802,'en','The Rock','A group of renegade marine commandos seizes a stockpile of chemical weapons and takes over Alcatraz, with 81 tourists as hostages. Their leader demands $100 million to be paid, as restitution to families of Marines who died in covert ops – or he will launch 15 rockets carrying deadly VX gas into the San Francisco Bay area.',51.469576,335062621,136,'Alcatraz.  Only one man has ever broken out.  Now five million lives depend on two men breaking in.','The Rock',6.9,1456),(515,80000000,'http://www.iceagemovies.com/films/ice-age-the-meltdown',950,'en','Ice Age: The Meltdown','Diego, Manny and Sid return in this sequel to the hit animated movie Ice Age. This time around, the deep freeze is over, and the ice-covered earth is starting to melt, which will destroy the trio\'s cherished valley. The impending disaster prompts them to reunite and warn all the other beasts about the desperate situation.',85.115058,660940780,91,'The Ice age is melting away.','Ice Age: The Meltdown',6.5,2951),(516,75000000,NULL,1824,'en','50 First Dates','Henry is a player skilled at seducing women. But when this veterinarian meets Lucy, a girl with a quirky problem when it comes to total recall, he realizes it\'s possible to fall in love all over again…and again, and again. That\'s because the delightful Lucy has no short-term memory, so Henry must woo her day after day until he finally sweeps her off her feet.',61.437586,196482882,99,'Imagine having to win over the girl of your dreams... every friggin\' day.','50 First Dates',6.6,2105),(517,50000000,'http://www.hairspraymovie.com/',2976,'en','Hairspray','Pleasantly plump teenager, Tracy Turnblad and her best friend, Penny Pingleton audition to be on The Corny Collins Show – and Tracy wins. But when scheming Amber Von Tussle and her mother plot to destroy Tracy, it turns to chaos.',31.160542,90450008,117,'When you follow your own beat, the world will follow you.','Hairspray',6.5,709),(518,80000000,NULL,11026,'en','Exorcist: The Beginning','Having lived through traumatizing events during WWII, Father Lankester Merrin takes a sabbatical from the Church to conduct archaeological excavations in British-administered East Africa. Merrin unearths an ancient Byzantine church believed have been built and then immediately buried to keep down evil from the crypt below. The natives are convinced that uncovering the church has unleashed a demon, and begin to violently clash with the British military troops. As the village rapidly disintegrates into chaos and war, Merrin must face-off with the demon which has taken possession of somebody close to him.',15.761384,78000586,114,'Go back to where the horror began.','Exorcist: The Beginning',4.7,183),(519,75000000,NULL,332,'en','Inspector Gadget','John Brown is a bumbling but well-intentioned security guard who is badly injured in an explosion planned by an evil mastermind. He is taken to a laboratory, where Brenda, a leading robotics surgeon, replaces his damaged limbs with state-of-the-art gadgets and tools. Named \"Inspector Gadget\" by the press, John -- along with his niece, Penny, and her trusty dog, Brain -- uses his new powers to discover who was behind the explosion.',17.561955,NULL,78,'The greatest hero ever assembled.','Inspector Gadget',4.3,318),(520,75000000,NULL,75656,'en','Now You See Me','An FBI agent and an Interpol detective track a team of illusionists who pull off bank heists during their performances and reward their audiences with the money.',71.124686,117698894,115,'4 amazing magicians. 3 impossible heists. 1 billion dollars. This is no illusion.','Now You See Me',7.3,5487),(521,80000000,'http://www.grownups-movie.com/',38365,'en','Grown Ups','After their high school basketball coach passes away, five good friends and former teammates reunite for a Fourth of July holiday weekend.',38.864027,271430189,102,'Boys will be boys. . . some longer than others.','Grown Ups',6.0,1705),(522,60000000,'http://www.theterminal-themovie.com/',594,'en','The Terminal','Viktor Navorski is a man without a country; his plane took off just as a coup d\'etat exploded in his homeland, leaving it in shambles, and now he\'s stranded at Kennedy Airport, where he\'s holding a passport that nobody recognizes. While quarantined in the transit lounge until authorities can figure out what to do with him, Viktor simply goes on living – and courts romance with a beautiful flight attendant.',57.753914,219417255,128,'Life is waiting.','The Terminal',7.0,1910),(523,35000000,NULL,15189,'en','Hotel for Dogs','Placed in a foster home that doesn\'t allow pets, 16-year-old Andi and her younger brother, Bruce, turn an abandoned hotel into a home for their dog. Soon other strays arrive, and the hotel becomes a haven for every orphaned canine in town. But the kids have to do some quick thinking to keep the cops off their tails.',13.257530,73034460,100,'No stray gets turned away.','Hotel for Dogs',5.7,202),(524,75000000,'https://www.epicbuzz.net/movies/vertical-limit',11678,'en','Vertical Limit','Trapped near the summit of K2, the world\'s second-highest mountain, Annie Garrett radios to base camp for help. Brother Peter hears Annie\'s message and assembles a team to save her and her group before they succumb to K2\'s unforgiving elements. But, as Annie lays injured in an icy cavern, the rescuers face several terrifying events that could end the rescue attempt -- and their lives.',1