unich Olympics. This is the story of what happened next.','Munich',6.9,696),(530,70000000,NULL,9567,'en','Tears of the Sun','Navy SEAL Lieutenant A.K. Waters and his elite squadron of tactical specialists are forced to choose between their duty and their humanity, between following orders by ignoring the conflict that surrounds them, or finding the courage to follow their conscience and protect a group of innocent refugees. When the democratic government of Nigeria collapses and the country is taken over by a ruthless military dictator, Waters, a fiercely loyal and hardened veteran is dispatched on a routine mission to retrieve a Doctors Without Borders physician.',27.055085,85632458,121,'He was trained to follow orders. He became a hero by defying them.','Tears of the Sun',6.4,573),(531,75000000,'http://killersfilm.com/',37821,'en','Killers','When an elite assassin marries a beautiful computer whiz after a whirlwind romance, he gives up the gun and settles down with his new bride. That is, until he learns that someone from his past has put a contract out on his life.',23.004607,98159963,100,'Perfect wife. Perfect target.','Killers',5.7,772),(532,75000000,NULL,203801,'en','The Man from U.N.C.L.E.','At the height of the Cold War, a mysterious criminal organization plans to use nuclear weapons and technology to upset the fragile balance of power between the United States and Soviet Union. CIA agent Napoleon Solo and KGB agent Illya Kuryakin are forced to put aside their hostilities and work together to stop the evildoers in their tracks. The duo\'s only lead is the daughter of a missing German scientist, whom they must find soon to prevent a global catastrophe.',48.744209,108145109,116,'Saving the world never goes out of style.','The Man from U.N.C.L.E.',7.1,2265),(533,80000000,NULL,2539,'en','Spanglish','Mexican immigrant and single mother Flor Moreno finds housekeeping work with Deborah and John Clasky, a well-off couple with two children of their own. When Flor admits she can\'t handle the schedule because of her daughter, Cristina, Deborah decides they should move into the Clasky home. Cultures clash and tensions run high as Flor and the Claskys struggle to share space while raising their children on their own, and very different, terms.',14.209329,55041367,130,'Every family has a hero.','Spanglish',5.8,369),(534,75000000,'http://www.sonypictures.com/movies/monsterhouse/',9297,'en','Monster House','Monsters under the bed are scary enough, but what happens when an entire house is out to get you? Three teens aim to find out when they go up against a decrepit neighboring home and unlock its frightening secrets.',36.368839,140175006,91,'The House is . . . ALIVE!','Monster House',6.3,874),(535,75000000,NULL,3172,'en','Bandits','Two bank robbers fall in love with the girl they\'ve kidnapped.',24.353302,67631903,123,'Two\'s company, three\'s a crime.','Bandits',6.2,302),(536,55000000,NULL,6520,'en','First Knight','The timeless tale of King Arthur and the legend of Camelot are retold in this passionate period drama. Arthur is reluctant to hand the crown to Lancelot, and Guinevere is torn between her loyalty to her husband and her growing love for his rival. But Lancelot must balance his loyalty to the throne with the rewards of true love.',19.143321,127600435,134,'Their greatest battle would be for her love.','First Knight',5.9,311),(537,75000000,NULL,1439,'en','Anna and the King','The story of the romance between the King of Siam (now Thailand) and the widowed British school teacher Anna Leonowens during the 1860\'s. Anna teaches the children and becomes romanced by the King. She convinces him that a man can be loved by just one woman.',13.327372,NULL,148,NULL,'Anna and the King',6.4,197),(538,75000000,'http://www.immortalsmovie.com/splash/',37958,'en','Immortals','Theseus is a mortal man chosen by Zeus to lead the fight against the ruthless King Hyperion, who is on a rampage across Greece to obtain a weapon that can destroy humanity.',37.917002,226904017,110,'The Gods need a hero.','Immortals',5.7,880),(539,52000000,NULL,2026,'en','Hostage','When a mafia accountant is taken hostage on his beat, a police officer – wracked by guilt from a prior stint as a negotiator – must negotiate the standoff, even as his own family is held captive by the mob.',23.663713,77944725,113,'Every Second Counts','Hostage',6.2,512),(540,75000000,NULL,7450,'en','Titan A.E.','A young man finds out that he holds the key to restoring hope and ensuring survival for the human race, while an alien species called the Dredge are bent on mankind\'s destruction.',14.443810,36754634,94,'When Earth Ends, The Adventure Begins.','Titan A.E.',6.3,313),(541,75000000,NULL,11375,'en','Hollywood Homicide','Joe Gavilan (Harrison Ford) and his new partner K. C. Calden (Josh Hartnett), are detectives on the beat in Tinseltown. Neither one of them really wants to be a cop, Gavilan moonlights as a real estate broker, and Calden is an aspiring actor moonlighting as a yoga instructor. When the two are assigned a big case they must work out whether they want to solve the case or follow their hearts.',10.605084,51142659,116,NULL,'Hollywood Homicide',5.0,166),(542,75000000,'http://www.wb-soldier.com/',9425,'en','Soldier','Sergeant Todd is a veteran soldier for an elite group of the armed forces. After being defeated by a new breed of genetically engineered soldiers, he is dumped on a waste planet and left for dead. He soon interacts with a group of crash survivors who lead out a peaceful existence. The peace is broken as the new soldiers land on the planet to eliminate the colony, which Sergeant Todd must defend.',11.873856,14567883,99,'Left for dead on a remote planet for obsolete machines and people, a fallen hero has one last battle to fight','Soldier',6.1,221),(543,NULL,NULL,25769,'en','Carriers','Four friends fleeing a viral pandemic soon learn they are more dangerous than any virus.A deadly virus has spread across the globe. Contagion is everywhere, no one is safe and no one can be trusted. Four young attractive people race through the back roads of the American West to the pounding beat of a vacation soundtrack. Their aim is to retreat to secluded utopian beach in the Gulf of Mexico, where they could peacefully wait out the pandemic and survive the apocalyptic disease. Their plans take a grim turn when their car breaks down on an isolated road starting a chain of events that will seal the fate of each of them in an inexorable and horrifying voyage of hell through a western landscape populated by only the hideous dead or the twisted living.',12.708963,5802422,84,'The rules are simple. You break them, you die...','Carriers',5.8,282),(544,75000000,NULL,23685,'en','Monkeybone','After a car crash sends repressed cartoonist Stu Miley (Fraser) into a coma, he and the mischievous Monkeybone, his hilariously horny alter-ego, wake up in a wacked-out waystation for lost souls. When Monkeybone takes over Stu\'s body and escapes to wreak havoc on the real world, Stu has to find a way to stop him before his sister pulls the plug on reality forever!',8.098369,5409517,93,'If It Yells, If It Swings, It\'s Got To Be Monkeybone!','Monkeybone',4.3,78),(545,45000000,NULL,11866,'en','Flight of the Phoenix','When an Amacor oil rig in the Gobi Desert of Mongolia proves unproductive, Captain Frank Towns and copilot \"A.J.\" are sent to shut the operation down. However, on their way to Beijing, a major dust storm forces them to ditch their C-119 Flying Boxcar in an uncharted area of the desert.',20.374308,21009180,113,'Out of the ashes, hope will rise.','Flight of the Phoenix',5.7,276),(546,75000000,NULL,9741,'en','Unbreakable','An ordinary man makes an extraordinary discovery when a train accident leaves his fellow passengers dead – and him unscathed. The answer to this mystery could lie with the mysterious Elijah Price, a man who suffers from a disease that renders his bones as fragile as glass.',42.006908,248118121,106,'Some things are only revealed by accident.','Unbreakable',6.9,1946),(547,74000000,'http://www.minionsmovie.com/',211672,'en','Minions','Minions Stuart, Kevin and Bob are recruited by Scarlet Overkill, a super-villain who, alongside her inventor husband Herb, hatches a plot to take over the world.',875.581305,1156730962,91,'Before Gru, they had a history of bad bosses','Minions',6.4,4571),(548,82000000,'http://suckerpunchmovie.warnerbros.com',23629,'en','Sucker Punch','A young girl is institutionalized by her abusive stepfather. Retreating to an alternative reality as a coping strategy, she envisions a plan which will help her escape from the mental facility.',39.127082,89792502,110,'You will be unprepared','Sucker Punch',5.9,1623),(549,73000000,NULL,8688,'en','Snake Eyes','All bets are off when corrupt homicide cop Rick Santoro witnesses a murder during a boxing match. It\'s up to him and lifelong friend and naval intelligence agent Kevin Dunne to uncover the conspiracy behind the killing. At every turn, Santoro makes increasingly shocking discoveries that even he can\'t turn a blind eye to.',20.790703,103891409,98,'Believe everything except your eyes.','Snake Eyes',5.8,327),(550,75000000,'http://www.warnerbros.com/movies/home-entertainment/sphere/7bdffe73-2a0e-4e7a-98e7-cee4d723e0b3.html',10153,'en','Sphere','The OSSA discovers a spacecraft thought to be at least 300 years old at the bottom of the ocean. Immediately following the discovery, they decide to send a team down to the depths of the ocean to study the space craft.They are the best of best, smart and logical, and the perfect choice to learn more about the spacecraft.',18.659880,13100000,134,'A thousand feet beneath the sea, the blackest holes are in the mind...','Sphere',5.8,476),(551,73000000,'http://www.angrybirds-movie.com/en/',153518,'en','The Angry Birds Movie','An island populated entirely by happy, flightless birds or almost entirely. In this paradise, Red, a bird with a temper problem, speedy Chuck, and the volatile Bomb have always been outsiders. But when the island is visited by mysterious green piggies, it’s up to these unlikely outcasts to figure out what the pigs are up to.',45.720894,349779543,97,'Why so angry?','The Angry Birds Movie',5.9,1022),(552,70000000,'http://www.warnerbros.com/fools-gold',8676,'en','Fool\'s Gold','Treasure hunter Ben \"Finn\" Finnegan has sunk his marriage to Tess and his trusty boat in his obsessive quest to find the legendary Queen\'s Dowry. When he finds a vital clue that may finally pinpoint the treasure\'s whereabouts, he drags Tess and her boss, billionaire Nigel Honeycutt, along on the hunt. But Finn is not the only one interested in the gold; his former mentor-turned-enemy Moe Fitch will stop at nothing to beat him to it.',21.789615,111231041,112,'This February True Love Takes a Dive.','Fool\'s Gold',5.4,444),(553,75000000,'http://www.funnypeoplemovie.com',20829,'en','Funny People','Famous and wealthy funnyman George Simmons doesn\'t give much thought to how he treats people until a doctor delivers stunning health news, forcing George to reevaluate his priorities with a little help from aspiring stand-up comic Ira.',20.199057,61458982,146,'George Simmons was prepared to die, but then a funny thing happened.','Funny People',5.7,390),(554,70000000,'http://www.thekingdommovie.com/',4349,'en','The Kingdom','A team of U.S. government agents is sent to investigate the bombing of an American facility in the Middle East.',26.123705,86658558,110,'How do you stop an enemy who isn\'t afraid to die?','The Kingdom',6.5,513),(555,72500000,'http://www.sonypictures.com/homevideo/talladeganights/',9718,'en','Talladega Nights: The Ballad of Ricky Bobby','Lifelong friends and national idols Ricky Bobby and Cal Naughton Jr. have earned their NASCAR stripes with their uncanny knack of finishing races in the first and second slots, respectively, and slinging catchphrases like \"Shake and bake!\" But when a rival French driver coasts onto the track to challenge their records, they\'ll have to floor it to retain their top-dog status.',12.599836,162966177,116,'The story of a man who could only count to #1','Talladega Nights: The Ballad of Ricky Bobby',6.2,491),(556,70000000,NULL,10808,'en','Dr. Dolittle 2','Dr. John Dolittle the beloved doctor is back, but this time around he plays cupid to bumbling circus bear Archie as he\'s so smitten by a Pacific Western bear female, Ava. Dr. Dolittle must help a group of forest creatures to save their forest. But with the aid of his mangy, madcap animal friends, Dr. Dolittle must teach Archie the ways of true romance in time to save his species and his home before their habit is gone. So John held a meeting for every animal in the forest to not give up without a fight no matter what kind of animal expression they have and everyone agrees to do it and save their home.',13.543053,176104344,87,'The doctor is in again.','Dr. Dolittle 2',4.9,410),(557,72000000,NULL,197,'en','Braveheart','Enraged at the slaughter of Murron, his new bride and childhood love, Scottish warrior William Wallace slays a platoon of the local English lord\'s soldiers. This leads the village to revolt and, eventually, the entire country to rise up against English rule.',60.722162,210000000,177,'Every man dies. Not every man truly lives.','Braveheart',7.7,3336),(558,72000000,NULL,25,'en','Jarhead','Jarhead is a film about a US Marine Anthony Swofford’s experience in the Gulf War. After putting up with an arduous boot camp, Swafford and his unit are sent to the Persian Gulf where they are earger to fight but are forced to stay back from the action. Meanwhile Swofford gets news of his girlfriend is cheating on him. Desperately he wants to kill someone and finally put his training to use.',32.227223,96889998,125,'Welcome to the suck.','Jarhead',6.6,765),(559,75000000,'http://www.simpsonsmovie.com/',35,'en','The Simpsons Movie','After Homer accidentally pollutes the town\'s water supply, Springfield is encased in a gigantic dome by the EPA and the Simpsons are declared fugitives.',46.875375,527068851,87,'See our family. And feel better about yours.','The Simpsons Movie',6.9,2264),(560,72000000,NULL,11086,'en','The Majestic','Set in 1951, a blacklisted Hollywood writer gets into a car accident, loses his memory and settles down in a small town where he is mistaken for a long-lost son.',11.215702,37317558,152,'Sometimes your life comes into focus one frame at a time.','The Majestic',6.6,188),(561,94000000,NULL,10477,'en','Driven','Talented rookie race-car driver Jimmy Bly has started losing his focus and begins to slip in the race rankings. It\'s no wonder, with the immense pressure being shoveled on him by his overly ambitious promoter brother as well as Bly\'s romance with his arch rival\'s girlfriend Sophia. With much riding on Bly, car owner Carl Henry brings former racing star Joe Tanto on board to help Bly. To drive Bly back to the top of the rankings, Tanto must first deal with the emotional scars left over from a tragic racing accident which nearly took his life.',8.468586,54744738,116,'Get ready for the race of your life.','Driven',4.5,179),(562,74500000,NULL,1997,'en','Deux frères','Two tigers are separated as cubs and taken into captivity, only to be reunited years later as enemies by an explorer (Pearce) who inadvertently forces them to fight each other.',8.884318,62172050,109,'Two infant tiger cubs, separated from their parents and each other.','Two Brothers',6.9,180),(563,60000000,NULL,6947,'en','The Village','When a willful young man tries to venture beyond his sequestered Pennsylvania hamlet, his actions set off a chain of chilling incidents that will alter the community forever.',27.491891,256697520,108,'There is no turning back','The Village',6.2,1071),(564,71000000,NULL,3050,'en','Doctor Dolittle','A successful physician and devoted family man, John Dolittle (Eddie Murphy) seems to have the world by the tail, until a long suppressed talent he possessed as a child, the ability to communicate with animals is suddenly reawakened with a vengeance! Now every creature within squawking distance wants the good doctor\'s advice, unleashing an outrageous chain of events that turns his world upside down!',21.462935,294456605,85,'He doesn\'t just talk to the animals!','Doctor Dolittle',5.4,686),(565,72000000,NULL,2675,'en','Signs','A family living on a farm finds mysterious crop circles in their fields which suggests something more frightening to come.',28.848187,408247917,106,'It’s not like they didn’t warn us.','Signs',6.4,1599),(566,150000000,'http://www.shrek2.com/',809,'en','Shrek 2','Shrek, Fiona and Donkey set off to Far, Far Away to meet Fiona\'s mother and father. But not everyone is happy. Shrek and the King find it hard to get along, and there\'s tension in the marriage. The fairy godmother discovers that Shrek has married Fiona instead of her Son Prince Charming and sets about destroying their marriage.',47.320801,919838758,93,'Once upon another time...','Shrek 2',6.7,2988),(567,120000000,'http://disney.go.com/disneyvideos/animatedfilms/cars/',920,'en','Cars','Lightning McQueen, a hotshot rookie race car driven to succeed, discovers that life is about the journey, not the finish line, when he finds himself unexpectedly detoured in the sleepy Route 66 town of Radiator Springs. On route across the country to the big Piston Cup Championship in California to compete against two seasoned pros, McQueen gets to know the town\'s offbeat characters.',82.643036,461983149,117,'Ahhh... it\'s got that new movie smell.','Cars',6.6,3877),(568,70000000,NULL,4806,'en','Runaway Bride','Ike Graham, New York columnist, writes his text always at the last minute. This time, a drunken man in his favourite bar tells Ike about Maggie Carpenter, a woman who always flees from her grooms in the last possible moment. Ike, who does not have the best opinion about females anyway, writes an offensive column without researching the subject