rance...','Inglourious Basterds',7.9,6430),(573,70000000,NULL,879,'en','Hook','The boy who wasn\'t supposed to grow up—Peter Pan—did just that, becoming a soulless corporate lawyer whose workaholism could cost him his wife and kids. But a trip to see Granny Wendy in London, where the vengeful Capt. Hook kidnaps Peter\'s kids and forces Peter to return to Neverland, could lead to a chance at redemption, in this family-oriented fantasy from director Steven Spielberg.',33.648404,300854823,144,'What if Peter Pan grew up?','Hook',6.6,1532),(574,70000000,NULL,1573,'en','Die Hard 2','John McClane is an off-duty cop gripped with a feeling of déjà vu when on a snowy Christmas Eve in the nation\'s capital, terrorists seize a major international airport, holding thousands of holiday travelers hostage. Renegade military commandos led by a murderous rogue officer plot to rescue a drug lord from justice and are prepared for every contingency except one: McClane\'s smart-mouthed heroics.',57.698470,240031094,124,'Die Harder','Die Hard 2',6.6,1896),(575,80000000,'http://www.sonypictures.com/homevideo/swat/',9257,'en','S.W.A.T.','Hondo Harrelson recruits Jim Street to join an elite unit of the Los Angeles Police Department. Together they seek out more members, including tough Deke Kay and single mom Chris Sanchez. The team\'s first big assignment is to escort crime boss Alex Montel to prison. It seems routine, but when Montel offers a huge reward to anyone who can break him free, criminals of various stripes step up for the prize.',34.052253,116643346,117,'You\'re either S.W.A.T. or you\'re not.','S.W.A.T.',5.8,770),(576,68000000,NULL,1903,'en','Vanilla Sky','David Aames (Tom Cruise) has it all: wealth, good looks and gorgeous women on his arm. But just as he begins falling for the warmhearted Sofia (Penelope Cruz), his face is horribly disfigured in a car accident. That\'s just the beginning of his troubles as the lines between illusion and reality, between life and death, are blurred.',27.299301,203388341,136,'Forget everything you know, and open your eyes.','Vanilla Sky',6.5,1078),(577,75000000,NULL,9697,'en','Lady in the Water','Apartment building superintendent Cleveland Heep rescues what he thinks is a young woman from the pool he maintains. When he discovers that she is actually a character from a bedtime story who is trying to make the journey back to her home, he works with his tenants to protect his new friend from the creatures that are determined to keep her in our world.',20.219385,42285169,110,'Time is running out for a happy ending.','Lady in the Water',5.3,409),(578,70000000,'http://www.avp-movie.com/',395,'en','AVP: Alien vs. Predator','When scientists discover something in the Arctic that appears to be a buried Pyramid, they send a research team out to investigate. Little do they know that they are about to step into a hunting ground where Aliens are grown as sport for the Predator race.',42.957216,171183863,101,'Whoever wins... We lose','AVP: Alien vs. Predator',5.5,1217),(579,75000000,'http://www.munkyourself.com/',23398,'en','Alvin and the Chipmunks: The Squeakquel','Pop sensations Alvin, Simon and Theodore end up in the care of Dave Seville\'s twenty-something nephew Toby. The boys must put aside music super stardom to return to school, and are tasked with saving the school\'s music program by winning the $25,000 prize in a battle of the bands. But the Chipmunks unexpectedly meet their match in three singing chipmunks known as The Chipettes - Brittany, Eleanor and Jeanette. Romantic and musical sparks are ignited when the Chipmunks and Chipettes square off.',29.412262,443140005,88,'The Boys are back in town... and they have competition.','Alvin and the Chipmunks: The Squeakquel',5.4,666),(580,75000000,NULL,10590,'en','We Were Soldiers','The story of the first major battle of the American phase of the Vietnam War and the soldiers on both sides that fought it.',19.708731,114660784,138,'400 U.S paratroopers. 4000 Vietnamese 