ig Fish',7.6,1994),(585,NULL,NULL,10395,'en','Wolf','Publisher Will Randall becomes a werewolf and has to fight to keep his job.',13.758526,NULL,125,'The animal is out.','Wolf',6.0,216),(586,66000000,'http://www.warhorsemovie.com/',57212,'en','War Horse','Follows a young man named Albert and his horse, Joey, and how their bond is broken when Joey is sold to the cavalry and sent to the trenches of World War One. Despite being too young to enlist, Albert heads to France to save his friend.',29.505574,177584879,146,'Separated by War. Tested by Battle. Bound by Friendship.','War Horse',7.0,992),(587,70000000,'http://www.monumentsmen.com/',152760,'en','The Monuments Men','Based on the true story of the greatest treasure hunt in history, The Monuments Men is an action drama focusing on seven over-the-hill, out-of-shape museum directors, artists, architects, curators, and art historians who went to the front lines of WWII to rescue the world’s artistic masterpieces from Nazi thieves and return them to their rightful owners.  With the art hidden behind enemy lines, how could these guys hope to succeed?',43.873266,154984035,118,'It was the greatest art heist in history','The Monuments Men',5.8,1523),(588,70000000,NULL,2756,'en','The Abyss','A civilian oil rig crew is recruited to conduct a search and rescue effort when a nuclear submarine mysteriously sinks. One diver soon finds himself on a spectacular odyssey 25,000 feet below the ocean\'s surface where he confronts a mysterious force that has the power to change the world or destroy it.',24.961625,90000098,139,'There\'s everything you\'ve ever known about adventure, and then there\'s The Abyss.','The Abyss',7.1,808),(589,70000000,'http://www.wallstreetmoneyneversleeps.com/',33909,'en','Wall Street: Money Never Sleeps','As the global economy teeters on the brink of disaster, a young Wall Street trader partners with disgraced former Wall Street corporate raider Gordon Gekko on a two tiered mission: To alert the financial community to the coming doom, and to find out who was responsible for the death of the young trader\'s mentor.',23.256450,134748021,133,'Gordon never gives up.','Wall Street: Money Never Sleeps',5.8,493),(590,70000000,NULL,49017,'en','Dracula Untold','Vlad Tepes is a great hero, but when he learns the Sultan is preparing for battle and needs to form an army of 1,000 boys, including Vlad\'s son, he vows to find a way to protect his family. Vlad turns to dark forces in order to get the power to destroy his enemies and agrees to go from hero to monster as he\'s turned into the mythological vampire Dracula.',64.457947,215529201,92,'Every bloodline has a beginning','Dracula Untold',6.2,2389),(591,70000000,NULL,9882,'en','The Siege','The secret US abduction of a suspected terrorist leads to a wave of terrorist attacks in New York that lead to the declaration of martial law.',20.089933,116672912,116,'On November 6th our freedom is history','The Siege',6.0,352),(592,70000000,'http://www.stardustmovie.com',2270,'en','Stardust','In a countryside town bordering on a magical land, a young man makes a promise to his beloved that he\'ll retrieve a fallen star by venturing into the magical realm. His journey takes him into a world beyond his wildest dreams and reveals his true identity.',48.032734,135560026,127,'This Summer A Star Falls. The Chase Begins.','Stardust',7.1,1184),(593,70000000,NULL,978,'en','Seven Years in Tibet','Austrian mountaineer, Heinrich Harrer journeys to the Himalayas without his family to head an expedition in 1939. But when World War II breaks out, the arrogant Harrer falls into Allied forces\' hands as a prisoner of war. He escapes with a fellow detainee and makes his way to Llaso, Tibet, where he meets the 14-year-old Dalai Lama, whose friendship ultimately transforms his outlook on life.',16.929910,131457682,136,'At the end of the world his real journey began.','Seven Years in Tibet',7.0,630),(594,70000000,'http://www.thedilemmamovie.com',44564,'en','The 