ld: Awakening','After being held in a coma-like state for fifteen years, vampire Selene learns that she has a fourteen-year-old vampire/Lycan hybrid daughter named Nissa, and when she finds her, they must stop BioCom from creating super Lycans that will kill them all.',58.401204,160112671,88,'Vengeance Returns','Underworld: Awakening',6.1,1862),(599,75000000,'http://www.warnerbros.com/rock-ages',80585,'en','Rock of Ages','A small town girl and a city boy meet on the Sunset Strip, while pursuing their Hollywood dreams.',23.515938,59418613,123,'Nothin\' but a good time','Rock of Ages',6.0,385),(600,70000000,NULL,10592,'en','Hart\'s War','Fourth-generation Army Col. William McNamara is imprisoned in a brutal German POW camp. Still, as the senior-ranking American officer, he commands his fellow inmates, keeping a sense of honor alive in a place where honor is easy to destroy, all under the dangerous eye of the Luftwafe vetran Col. Wilhelm Visser. Never giving up the fight to win the war, McNamara is silently planning, waiting for his moment to strike back at the enemy. A murder in the camp gives him the chance to set a risky plan in motion. With a court martial to keep Visser and the Germans distracted, McNamara orchestrates a cunning scheme to escape and destroy a nearby munitions plant, enlisting the unwitting help of young Lt. Tommy Hart. Together with his men, McNamara uses a hero\'s resolve to carry out his mission, ultimately forced to weigh the value of his life against the good of his country.',14.244518,32287044,125,'Beyond Courage, Beyond Honor.','Hart\'s War',5.9,241),(601,66000000,NULL,49021,'en','Killer Elite','Based on a shocking true story, Killer Elite pits two of the world’s most elite operatives—Danny, an ex-special ops agent and Hunter, his longtime mentor—against the cunning leader of a secret military society. Covering the globe from Australia to Paris, London and the Middle East, Danny and Hunter are plunged into a highly dangerous game of cat and 