 stop a deadly virus from destroying the human they live in, Frank.',10.545440,13596911,95,'Every BODY needs a hero','Osmosis Jones',5.9,228),(606,70000000,'http://www.dorothyofozthemovie.com/',59981,'en','Legends of Oz: Dorothy\'s Return','Dorothy wakes up in post-tornado Kansas, only to be whisked back to Oz to try to save her old friends the Scarecrow, the Lion, the Tin Man and Glinda from a devious new villain, the Jester. Wiser the owl, Marshal Mallow, China Princess and Tugg the tugboat join Dorothy on her latest magical journey through the colorful landscape of Oz to restore order and happiness to Emerald City.',6.682006,18662027,88,'There\'s trouble in OZ...','Legends of Oz: Dorothy\'s Return',5.9,43),(607,70000000,'http://www.legendary.com/film/blackhat/',201088,'en','Blackhat','A man is released from prison to help American and Chinese authorities pursue a mysterious cyber criminal. The dangerous search leads them from Chicago to Hong Kong.',46.832372,17752940,133,'We are no longer in control.','Blackhat',5.1,826),(608,70000000,'http://www.skycaptain.com/',5137,'en','Sky Captain and the World of Tomorrow','When gigantic robots attack New York City, \"Sky Captain\" uses his private air force to fight them off. His ex-girlfriend, reporter Polly Perkins, has been investigating the recent disappearance of prominent scientists. Suspecting a link between the global robot attacks and missing men, Sky Captain and Polly decide to work together. They fly to the Himalayas in pursuit of the mysterious Dr. Totenkopf, the mastermind behind the robots.',24.664776,57958696,107,'Who will save us?','Sky Captain and the World of Tomorrow',5.7,439),(609,70000000,NULL,3093,'en','Basic Instinct 2','Novelist Catherine Tramell is once again in trouble with the law, and Scotland Yard appoints psychiatrist Dr. Michael Glass to evaluate her. Though, like Detective Nick Curran before him, Glass is entranced by Tramell and lured into a seductive game.',13.483387,38629478,114,'Everything interesting begins in the mind','Basic Instinct 2',4.6,180),(610,50000000,'http://escapeplanmovie.com/',107846,'en','Escape Plan','Ray Breslin is the world\'s foremost authority on structural security. After analyzing every high security prison and learning a vast array of survival skills so he can design escape-proof prisons, his skills are put to the test. He\'s framed and incarcerated in a master prison he designed himself. He needs to escape and find the person who put him behind bars.',44.478043,122915111,115,'No one breaks out alone.','Escape Plan',6.7,1659),(611,70000000,NULL,188207,'en','The Legend of Hercules','In Ancient Greece 1200 B.C., a queen succumbs to the lust of Zeus to bear a son promised to overthrow the tyrannical rule of the king and restore peace to a land in hardship. But this prince, Hercules, knows nothing of his real identity or his destiny. He desires only one thing: the love of Hebe, Princess of Crete, who has been promised to his own brother. When Hercules learns of his greater purpose, he must choose: to flee with his true love or to fulfill his destiny and become the true hero of his time. The story behind one of the greatest myths is revealed in this action-packed epic - a tale of love, sacrifice and the strength of the human spirit.',25.020428,61279452,99,'Every Man Has a Destiny','The Legend of Hercules',4.4,533),(612,68000000,'http://www.paramount.com/movies/sum-all-fears',4614,'en','The Sum of All Fears','When the president of Russia suddenly dies, a man whose politics are virtually unknown succeeds him. The change in political leaders sparks paranoia among American CIA officials, so CIA director Bill Cabot recruits a young analyst to supply insight and advice on the situation. Then the unthinkable happens: a nuclear bomb explodes in a U.S. city, and America is quick to blame the Russians.',22.392544,193000000,124,'27,000 nuclear weapons. One is missing.','The Sum of All Fears',5.9,437),(613,68000000,'http://eclipsethemovie.co