he possibility of gaining his freedom by joining the rising tide of Christianity.',18.888806,39041505,127,'Alexandria, Egypt. 391 A.D. The World Changed Forever.','Agora',6.9,395),(619,68000000,NULL,9824,'en','Mystery Men','When Captain Amazing (Kinnear) is kidnapped by Casanova Frankenstein (Rush) a group of superheroes combine together to create a plan. But these aren\'t normal superheroes. Now, the group who include such heroes as Mr. Furious (Stiller), The Shoveller (Macy) and The Blue Raja (Azaria) must put all the powers together to save everyone they know and love.',12.948627,29762011,121,'We\'re not your classic heroes, we\'re the other guys.','Mystery Men',5.7,250),(620,36000000,'http://hallpassmovie.warnerbros.com/',48988,'en','Hall Pass','When best buds Rick and Fred begin to show signs of restlessness at home, their wives take a bold approach to revitalize their marriages: they grant the guys a \"hall pass\", one week of freedom to do whatever they want. At first, it seems like a dream come true, but they quickly discover that their expectations of the single life - and themselves - are completely and hilariously out of sync with reality.',27.115890,83160734,105,'One Week, No Rules','Hall Pass',5.4,611),(621,90000000,NULL,9008,'en','The Insider','Tells the true story of a 60 Minutes television series exposé of the tobacco industry, as seen through the eyes of a real tobacco executive, Jeffrey Wigand',26.153669,60289912,157,'Two men driven to tell the truth... whatever the cost.','The Insider',7.3,481),(622,80000000,'https://www.facebook.com/thefinesthoursmovie',300673,'en','The Finest Hours','The Coast Guard makes a daring rescue attempt off the coast of Cape Cod after a pair of oil tankers are destroyed during a blizzard in 1952.',28.223664,52099090,114,'32 survivors, room for 12.','The Finest Hours',6.3,588),(623,70000000,'http://wwws.warnerbros.co.uk/bodyoflies/',12113,'en','Body of Lies','The CIA’s hunt is on for the mastermind of a wave of terrorist