enty years since Don Diego de la Vega fought Spanish oppression in Alta California as the legendary romantic hero, Zorro. Having escaped from prison he transforms troubled bandit Alejandro into his successor, in order to foil the plans of the tyrannical Don Rafael Montero who robbed him of his freedom, his wife and his precious daughter.',31.086791,250288523,136,'No one has seen his face... but everyone ... knows this mark.','The Mask of Zorro',6.3,1183),(642,65000000,'http://duedatemovie.warnerbros.com/',41733,'en','Due Date','Peter Highman must scramble across the US in five days to be present for the birth of his first child. He gets off to a bad start when his wallet and luggage are stolen, and put on the \'no-fly\' list. Peter embarks on a terrifying journey when he accepts a ride from an actor.',43.865294,211780824,95,'Leave Your Comfort Zone','Due Date',6.2,1685),(643,65000000,'http://www.unbrokenfilm.com/',227306,'en','Unbroken','A chronicle of the life of Louis Zamperini, an Olympic runner who was taken prisoner by Japanese forces during World War II.',43.055253,163442937,137,'Survival. Resilience. Redemption.','Unbroken',7.3,1400),(644,65000000,'http://movies.warnerbros.com/spacecowboys/index.html',5551,'en','Space Cowboys','Frank Corvin, ‘Hawk’ Hawkins, Jerry O\'Neill and ‘Tank’ Sullivan were hotdog members of Project Daedalus, the Air Force\'s test program for space travel, but their hopes were dashed in 1958 with the formation of NASA and the use of trained chimps. They blackmail their way into orbit when Russia\'s mysterious ‘Ikon’ communications satellite\'s orbit begins to degrade and threatens to crash to Earth.',15.772081,128884132,130,'Space will never be the same.','Space Cowboys',6.3,403),(645,70000000,NULL,9350,'en','Cliffhanger','A year after losing his friend in a tragic 4,000-foot fall, former ranger Gabe Walker and his partner, Hal, are called to return to the same peak to rescue a group of stranded climbers, only to learn the climbers are 