e showed them how to live.','Mona Lisa Smile',6.5,393),(650,65000000,'http://www.dictatorthemovie.com/',76493,'en','The Dictator','The heroic story of a dictator who risks his life to ensure that democracy would never come to the country he so lovingly oppressed.',31.349143,179379533,83,'kurd','The Dictator',5.9,1743),(651,65000000,'http://eyeswideshut.warnerbros.com/',345,'en','Eyes Wide Shut','After Dr. Bill Hartford\'s wife, Alice, admits to having sexual fantasies about a man she met, Bill becomes obsessed with having a sexual encounter. He discovers an underground sexual group and attends one of their meetings -- and quickly discovers that he is in over his head.',27.870312,162091208,159,'Cruise. Kidman. Kubrick.','Eyes Wide Shut',7.1,1234),(652,65000000,NULL,196867,'en','Annie','Ever since her parents left her as a baby, little Annie has led a hard-knock life with her calculating foster mother, Miss Hannigan. However, all that changes when hard-nosed billionaire and mayoral candidate Will Stacks takes her in on the recommendation of his advisers. Stacks believes that he\'s Annie\'s guardian angel, but the plucky youngster\'s confidence and sunny outlook may mean that Annie will save Will instead.',33.439187,133821816,119,'It\'s a Hard Knock Life','Annie',6.0,466),(653,50100000,'http://focusmovie.com/',256591,'en','Focus','Nicky, a veteran con artist, takes a novice named Jess under his wing. While Nicky teaches Jess the tricks of the trade, the pair become romantically involved; but, when Jess gets uncomfortably close, Nicky ends their relationship. Three years later, Nicky is in Buenos Aires working a very dangerous scheme when Jess -- now an accomplished femme fatale -- unexpectedly shows up. Her appearance throws Nicky for a loop at a time when he cannot afford to be off his game.',59.634029,153962963,105,'Never Drop The Con.','Focus',6.7,2542),(654,65000000,'http://www.thismeanswarmovie.com/',59962,'en','This Means War','Two top CIA operatives wage an epic