ming the global population into legions of the flesh eating Undead. The human race’s last and only hope, Alice, awakens in the heart of Umbrella’s most clandestine operations facility and unveils more of her mysterious past as she delves further into the complex. Without a safe haven, Alice continues to hunt those responsible for the outbreak; a chase that takes her from Tokyo to New York, Washington, D.C. and Moscow, culminating in a mind-blowing revelation that will force her to rethink everything that she once thought to be true. Aided by new found allies and familiar friends, Alice must fight to survive long enough to escape a hostile world on the brink of oblivion. The countdown has begun.',6.227675,240159255,95,'The Ultimate Battle Begins','Resident Evil: Retribution',5.6,1600),(659,45000000,'http://www.deathracemovie.net/',10483,'en','Death Race','Terminal Island, New York: 2020. Overcrowding in the US penal system has reached a breaking point. Prisons have been turned over to a monolithic Weyland Corporation, which sees jails full of thugs as an opportunity for televised sport. Adrenalized inmates, a global audience hungry for violence and a spectacular, enclosed arena come together to form the \'Death Race\', the biggest, most brutal event.',42.578770,73762516,105,'Get ready for a killer race.','Death Race',6.0,1175),(660,65000000,NULL,11412,'en','The Long Kiss Goodnight','Samantha Caine, suburban homemaker, is the ideal mom to her 8 year old daughter Caitlin. She lives in Honesdale, PA, has a job teaching school and makes the best Rice Krispie treats in town. But when she receives a bump on her head, she begins to remember small parts of her previous life as a lethal, top-secret agent',15.858629,89456761,120,'What\'s forgotten is not always gone.','The Long Kiss Goodnight',6.5,314),(661,65000000,NULL,11983,'en','Proof of Life','Alice hires a professional negotiator to obtain the release of her engineer husband, who has been kidnapped by anti-government guerrillas in South America.',14.866901,NULL,135,NULL,'Proof of Life',6.0,208),(662,65000000,NULL,6795,'en','Zathura: A Space Adventure','After their father is called into work, two young boys, Walter and Danny, are left in the care of their teenage sister, Lisa, and told they must stay inside. Walter and Danny, who anticipate a boring day, are shocked when they begin playing Zathura, a space-themed board game, which they realize has mystical powers when their house is shot into space. With the help of an astronaut, the boys attempt to return home.',15.194239,64321501,101,'Adventure Is Waiting','Zathura: A Space Adventure',6.1,779),(663,63000000,'http://www.foxmovies.com/movies/fight-club',550,'en','Fight Club','A ticking-time-bomb insomniac and a slippery soap salesman channel primal male aggression into a shocking new form of therapy. Their concept catches on, with underground \"fight clubs\" forming in every town, until an eccentric gets in the way and ignites an out-of-control spiral toward oblivion.',146.757391,100853753,139,'Mischief. Mayhem. Soap.','Fight Club',8.3,9413),(664,65000000,NULL,11170,'en','We Are Marshall','When a plane crash claims the lives of members of the Marshall University football team and some of its fans, the team\'s new coach and his surviving players try to keep the football program alive.',8.629665,43545364,124,'From the ashes we rose.','We Are Marshall',6.7,186),(665,65000000,NULL,9292,'en','Hudson Hawk','Eddie Hawkins, called Hudson Hawk has just been released from ten years of prison and is planning to spend the rest of his life honestly. But then the crazy Mayflower couple blackmail him to steal some of the works of Leonardo da Vinci. If he refuses, they threaten to kill his friend Tommy.',16.803457,17218080,100,'Danger is his middle name.','Hudson Hawk',5.4,269),(666,65000000,NULL,10783,'en','Lucky Numbers','Russ Richards is a TV weatherman and local celebrity on the verge of losing his shirt. Desperate to escape financial ruin, he 