ar of power.','Clear and Present Danger',6.4,386),(679,65000000,NULL,300168,'zh','天將雄師','Huo An, the commander of the Protection Squad of the Western Regions, was framed by evil forces and becomes enslaved. On the other hand, a Roman general escapes to China after rescuing the Prince. The heroic duo meet in the Western Desert and a thrilling story unfolds.',9.568884,121545703,127,'When the Eagle meets the Dragon','Dragon Blade',5.9,145),(680,64000000,'http://www.littleman-movie.com/',9072,'en','Little Man','After leaving the prison, the dwarf criminal Calvin Sims joins to his moron brother Percy to steal an expensive huge diamond in a jewelry for the mobster Walken. They are chased by the police, and Calvin hides the stone in the purse of the executive Vanessa Edwards, whose husband Darryl Edwards wants to have a baby. Percy convinces Calvin to dress like a baby and be left in front of the Edwards\'s house to get inside the house and retrieve the diamond. Darryl and Vanessa keep Calvin for the weekend and decide to adopt him, while Walken threatens Darryl to get the stone back.',12.421504,101595121,98,'Big things come in small packages','Little Man',5.3,261),(681,62000000,'http://www.u-571.com/',3536,'en','U-571','In the midst of World War II, the battle under the sea rages and the Nazis have the upper hand as the Allies are unable to crack their war codes. However, after a wrecked U-boat sends out an SOS signal, the Allies realise this is their chance to seize the \'enigma coding machine\'.',18.096884,127666415,116,'Heroes are ordinary men who do extraordinary things in extraordinary times.','U-571',6.1,340),(682,62000000,NULL,9087,'en','The American President','Widowed U.S. president Andrew Shepherd, one of the world\'s most powerful men, can have anything he wants -- and what he covets most is Sydney Ellen Wade, a Washington lobbyist. But Shepherd\'s attempts at courting her spark wild rumors and decimate his approval ratings.',11.056763,107879496,106,'Why can\'t