nerbros.com',1271,'en','300','Based on Frank Miller\'s graphic novel, \"300\" is very loosely based the 480 B.C. Battle of Thermopylae, where the King of Sparta led his army against the advancing Persians; the battle is said to have inspired all of Greece to band together against the Persians, and helped usher in the world\'s first democracy.',65.197968,422610419,117,'Spartans, prepare for glory!','300',7.0,4997),(689,80000000,'http://www.meetthefockers.com/index.php',693,'en','Meet the Fockers','Hard-to-crack ex-CIA man, Jack Byrnes and his wife, Dina head for the warmer climes of Florida to meet son-in-law-to-be, Greg Focker\'s parents. Unlike their happily matched offspring, the future in-laws find themselves in a situation of opposites that definitely do not attract.',32.829538,516642939,115,'Misery loves family.','Meet the Fockers',6.1,1373),(690,60000000,'http://marleyandmemovie.com/',14306,'en','Marley & Me','A newly married couple who, in the process of starting a family, learn many of life\'s important lessons from their trouble-loving retriever, Marley. Packed with plenty of laughs to lighten the load, the film explores the highs and lows of marriage, maturity and confronting one\'s own mortality, as seen through the lens of family life with a dog.',30.951203,244082376,115,'Heel the love.','Marley & Me',6.9,1343),(691,60000000,'http://thegreenmile.warnerbros.com/',497,'en','The Green Mile','A supernatural tale set on death row in a Southern prison, where gentle giant John Coffey possesses the mysterious power to heal people\'s ailments. When the cellblock\'s head guard, Paul Edgecomb, recognizes Coffey\'s miraculous gift, he tries desperately to help stave off the condemned man\'s execution.',103.698022,284600000,189,'Miracles do happen.','The Green Mile',8.2,4048),(692,NULL,'http://video.movies.go.com/wildhogs/',11199,'en','Wild Hogs','Restless and ready for adventure, four suburban bikers leave the safety of their subdivision and head out on the open road. But complications ensue when they cross paths with an intimidating band of New Mexico bikers known as the Del Fuegos.',31.719463,253625427,100,'A lot can happen on the road to nowhere.','Wild Hogs',5.6,648),(693,150000000,'http://movies.disney.com/chicken-little',9982,'en','Chicken Little','When the sky really is falling and sanity has flown the coop, who will rise to save the day? Together with his hysterical band of misfit friends, Chicken Little must hatch a plan to save the planet from alien invasion and prove that the world\'s biggest hero is a little chicken.',47.973995,314432665,81,'When it comes to saving the world, it helps to be a little chicken.','Chicken Little',5.6,944),(694,61000000,'http://www.gonegirlmovie.com/',210577,'en','Gone Girl','With his wife\'s disappearance having become the focus of an intense media circus, a man sees the spotlight turned on him when it\'s suspected that he may not be innocent.',143.041543,369330363,145,'You don\'t know what you\'ve got \'til it\'s...','Gone Girl',7.9,5862),(695,60000000,'http://www.universalstudiosentertainment.com/the-bourne-identity/',2501,'en','The Bourne Identity','Wounded to the brink of death and suffering from amnesia, Jason Bourne is rescued at sea by a fisherman. With nothing to go on but a Swiss bank account number, he starts to reconstruct his life, but finds that many people he encounters want him dead. However, Bourne realizes that he has the combat and mental skills of a world-class spy – but who does he work for?',86.476817,214034224,119,'He was the perfect weapon until he became the target.','The Bourne Identity',7.3,3583),(696,58000000,'http://www.mgm.com/view/movie/757/Goldeneye/',710,'en','GoldenEye','James Bond must unmask the mysterious head of the Janus Syndicate and prevent the leader from utilizing the GoldenEye weapons system to inflict devastating revenge on Britain.',59.824565,352194034,130,'No limits. No fears. No substitutes.','GoldenEye',6.6,1174),(697,60000000,NULL,2275,'