who have been tasked with investigating one another find they have been set up by the mob -- the very organization the two men believe they have been stealing money from.',42.881415,131940411,109,'2 Guns, 1 Bank.','2 Guns',6.6,1589),(702,60000000,'http://catsanddogsmovie.warnerbros.com/cmp/main.html',10992,'en','Cats & Dogs','When a professor develops a vaccine that eliminates human allergies to dogs, he unwittingly upsets the fragile balance of power between cats and dogs and touches off an epic battle for pet supremacy. The fur flies as the feline faction, led by Mr. Tinkles, squares off against wide-eyed puppy Lou and his canine cohorts.',18.735024,93375151,87,'Things Are Gonna Get Hairy!','Cats & Dogs',5.0,352),(703,60000000,'http://www.italianjobmovie.com/',9654,'en','The Italian Job','Charlie Croker pulled off the crime of a lifetime. The one thing that he didn\'t plan on was being double-crossed. Along with a drop-dead gorgeous safecracker, Croker and his team take off to re-steal the loot and end up in a pulse-pounding, pedal-to-the-metal chase that careens up, down, above and below the streets of Los Angeles.',62.766854,176070171,110,'Get in. Get out. Get even.','The Italian Job',6.6,1919),(704,60000000,NULL,2642,'en','Two Weeks Notice','Dedicated environmental lawyer Lucy Kelson goes to work for billionaire George Wade as part of a deal to preserve a community center. Indecisive and weak-willed George grows dependent on Lucy\'s guidance on everything from legal matters to clothing. Exasperated, Lucy gives notice and picks Harvard graduate June Carter as her replacement. As Lucy\'s time at the firm nears an end, she grows jealous of June and has second thoughts about leaving George.',24.153567,93354918,101,'Over. Done. Finished. A comedy about love at last glance.','Two Weeks Notice',5.9,487),(705,60000000,NULL,8916,'en','Antz','In this animated hit, a neurotic worker ant in love with a rebellious princess rises to unlikely stardom when he switches places with a soldier. Signing up to march in a parade, he ends up under the command of a bloodthirsty general. But he\'s actually been enlisted to fight against a termite army.',41.515702,171757863,83,'Every ant has his day.','Antz',6.0,1272),(706,70000000,'http://www.couplesretreatmovie.com/',19899,'en','Couples Retreat','Four couples, all friends, descend on a tropical island resort. Though one husband and wife are there to work on their marriage, the others just want to enjoy some fun in the sun. They soon find, however, that paradise comes at a price: Participation in couples therapy sessions is mandatory. What started out as a cut-rate vacation turns into an examination of the common problems many face.',26.676487,171844840,113,'It may be paradise... but it\'s no vacation.','Couples Retreat',5.3,588),(707,60000000,NULL,2119,'en','Days of Thunder','Talented but unproven stock car driver Cole Trickle gets a break and with the guidance of veteran Harry Hogge turns heads on the track. The young hotshot develops a rivalry with a fellow racer that threatens his career when the two smash their cars. But with the help of his doctor, Cole just might overcome his injuries-- and his fear.',16.278022,157920733,107,'You can\'t stop the thunder.','Days of Thunder',5.9,353),(708,60000000,NULL,9641,'en','Cheaper by the Dozen 2','Steve Martin and Bonnie Hunt return as heads of the Baker family who, while on vacation, find themselves in competition with a rival family of eight children, headed by Eugene Levy,',18.831023,129181830,94,'Same Big Family... Even Bigger Adventure.','Cheaper by the Dozen 2',5.7,526),(709,61000000,'http://mazerunnermovies.com',294254,'en','Maze Runner: The Scorch Trials','Thomas and his fellow Gladers face their greatest challenge yet: searching for clues about the mysterious and powerful organization known as WCKD. Their journey takes them to the Scorch, a desolate landscape filled with unimaginable obstacles. Teaming up with resistance fighters, the Gladers take on WCKD’s vastly superior forces and uncover its shocking plans for them all.',113.161483,311256926,132,'The Maze Was Just the Beginning.','Maze Runner: The Scorch Trials',6.4,3040),(710,60000000,'http://www.sonypictures.com/movies/eatpraylove/',38167,'en','Eat Pray Love','Liz Gilbert had everything a modern woman is supposed to dream of having – a husband, a house and a successful career – yet like so many others, she found herself lost, confused and searching for what she really wanted in life. Newly divorced and at a crossroads, Gilbert steps out of her comfort zone, risking everything to change her life, embarking on a journey around the world that becomes a quest for self-discovery. In her travels, she discovers the true pleasure of nourishment by eating in Italy, the power of prayer in India and, finally and unexpectedly, the inner peace and balance of true love in Bali.',28.800112,204594016,133,'Let Yourself GO','Eat Pray Love',5.8,636),(711,60000000,NULL,5994,'en','The Family Man','Jack\'s lavish, fast-paced lifestyle changes one Christmas night when he stumbles into a grocery store holdup and disarms the gunman. The next morning he wakes up in bed lying next to Kate, his college sweetheart he left in order to pursue his career, and to the horrifying discovery that his former life no longer exists. As he stumbles through this alternate suburban universe, Jack finds himself at a crossroad where he must choose between his high-power career and the woman he loves.',19.705489,NULL,125,'What if you made different choices? What if you said yes, instead of no? What if you got a second chance?','The Family Man',6.5,521),(712,58000000,NULL,39514,'en','RED','When his peaceful life is threatened by a high-tech assassin, former black-ops agent, Frank Moses reassembles his old team in a last ditch effort to survive and uncover his assailants.',41.430245,71664962,111,'Still armed. Still dangerous. Still got it.','RED',6.6,2808),(713,55000000,NULL,9563,'en','Any Given Sunday','A star quarterback gets knocked out of the game and an unknown third stringer is called in to replace him. The unknown gives a stunning performance and forces the aging coach to reevaluate his game plans and life. A new co-owner/president adds to the pressure of winning. The new owner must prove her self in a male dominated world.',23.127561,100230832,163,'Play or be Played.','Any Given Sunday',6.8,422),(714,60000000,NULL,547,'en','The Horse Whisperer','Based on the novel by the same name from Nicholas Evans, the talented Robert Redford presents this meditative family drama set in the country side. Redford not only directs but also stars in the roll of a cowboy with a magical talent for healing.',12.867352,186883563,170,NULL,'The Horse Whisperer',6.7,292),(715,65000000,NULL,1538,'en','Collateral','Cab driver Max picks up a man who offers him $600 to drive him around. But the promise of easy money sours when Max realizes his fare is an assassin.',44.815022,217764291,120,'It started like any other night.','Collateral',7.0,1451),(716,60000000,'http://www.the-scorpion-king.com/',9334,'en','The Scorpion King','In ancient Egypt, peasant Mathayus is hired to exact revenge on the powerful Memnon and the sorceress Cassandra, who are ready to overtake Balthazar\'s village. Amid betrayals, thieves, abductions and more, Mathayus strives to bring justice to his complicated world.',37.537093,165333180,92,'Warrior. Legend. King.','The Scorpion King',5.3,779),(717,60000000,NULL,11128,'en','Ladder 49','Under the watchful eye of his mentor, Captain Mike Kennedy, probationary firefighter Jack Morrison matures into a seasoned veteran at a Baltimore fire station. However, Jack has reached a crossroads  as the sacrifices he\'s made have put him in harm\'s way innumerable times and significantly impacted his relationship with his wife and kids.',10.999910,74541707,115,'Their greatest challenge lies in rescuing one of their own','Ladder 49',6.2,207),(718,60000000,'http://www.jackreachermovie.com/',75780,'en','Jack Reacher','In an innocent heartland city, five are shot dead by an expert sniper. The police quickly identify and arrest the culprit, and build a slam-dunk case. But the accused man claims he\'s innocent and says \"Get Jack Reacher.\" Reacher himself sees the news report and turns up in the city. The defense is immensely relieved, but Reacher has come to bury the guy. Shocked at the accused\'s request, Reacher sets out to confirm for himself the absolute certainty of the man\'s guilt, but comes up with more than he bargained for.',56.868399,218340595,130,'The Law Has Limits. He Does Not.','Jack Reacher',6.3,2998),(719,60000000,NULL,8914,'en','Deep Blue Sea','On a remote former submarine refueling facility called Aquatica, a team of scientists are searching for a cure for Alzheimer\'s disease. Dr. Susan McAlester genetically engineers three Mako sharks, intending to increase their brain capacity so that they can harvest the tissue as a cure for Alzheimer\'s. Unfortunately, the increased brain capacity also makes the sharks smarter, faster, and more dangerous. Aquatica\'s financial backers are skeptical and nervous about the tests, and send a corporate executive to visit the facility.',22.991269,73648228,105,'Bigger. Smarter. Faster. Meaner.','Deep Blue Sea',5.6,604),(720,60000000,'http://www.thisisit-movie.com',13576,'en','Michael Jackson\'s This Is It','A compilation of interviews, rehearsals and backstage footage of Michael Jackson as he prepared for his series of sold-out shows in London.',15.798622,NULL,111,'Like You\'ve Never Seen Him Before','This Is It',6.7,247),(721,60000000,'http://contagionmovie.warnerbros.com/',39538,'en','Contagion','As an epidemic of a lethal airborne virus - that kills within days - rapidly grows, the worldwide medical community races to find a cure and control the panic that spreads faster than the virus itself.',38.820858,137551594,106,'Nothing spreads like fear','Contagion',6.2,1325),(722,NULL,NULL,10628,'en','Kangaroo Jack','Two childhood friends, a New York hairstylist and a wanna-be musician, get mixed-up with the mob and are forced to deliver $50,000 to Australia, but things go all wrong when the money is lost to a wild kangaroo.',10.292864,NULL,89,'He stole the money... And he\'s not giving it back.','Kangaroo Jack',4.3,203),(723,60000000,'http://coraline.com/',14836,'en','Coraline','When Coraline moves to an old house, she feels bored and neglected by her parents. She finds a hidden door with a bricked up passage. During the night, she crosses the passage and finds a parallel world where everybody has buttons instead of eyes, with caring parents and all her dreams coming true. When the Other Mother invites Coraline to stay in her world forever, the girl refuses and finds that the alternate reality where she is trapped is only a trick to lure her.',51.146047,124596398,100,'Be careful what you wish for.','Coraline',7.3,1386),(724,60000000,'http://www.thehappeningmovie.com',8645,'en','The Happening','When a deadly airborne virus threatens to wipe out the northeastern United States, teacher Elliott Moore (Mark Wahlberg) and his wife (Zooey Deschanel) flee from contaminated cities into the countryside in a fight to discover the truth. Is it terrorism, the accidental release of some toxic military bio weapon -- or something even more sinister? John Leguizamo and Betty Buckley co-star in this thriller from writer-director M. Night Shyamalan.',20.501582,163403799,91,'We\'ve Sensed It. We\'ve Seen The Signs. Now... It\'s Happening.','The Happening',4.9,950),(725,70000000,NULL,9509,'en','Man on Fire','Jaded ex-CIA operative John Creasy reluctantly accepts a job as the bodyguard for a 10-year-old girl in Mexico City. They clash at first, but eventually bond, and when she\'s kidnapped he\'s consumed by fury and will stop at nothing to save her life.',45.299089,130293714,146,'Creasy\'s art is death, and he is about to paint his masterpiece.','Man on Fire',7.3,1553),(726,50000000,'http://movies.disney.com/the-shaggy-dog-2006',10067,'en','The Shaggy Dog','The tale of a workaholic dad-turned-dog who finds that being man\'s best friend shows him the most important job - being a great dad.',4.280619,61112916,98,'It\'s going to be a ruff day.','The Shaggy Dog',4.5,137),(727,60000000,NULL,9384,'en','Starsky & Hutch','Join uptight David Starsky and laid-back Ken \"Hutch\" Hutchinson as they\'re paired for the first time as undercover cops. The new partners must overcome their differences to solve an important case with help from street informant Huggy Bear and persuasive criminal Reese Feldman.',28.848842,170268750,101,'They\'re the man.','Starsky & Hutch',5.6,644),(728,60000000,NULL,9279,'en','Jingle All the Way','Meet Howard Langston, a salesman for a mattress company is constantly busy at his job, and he also constantly disappoints his son, after he misses his son\'s karate exposition, his son tells Howard that he wants for Christmas is an action figure of his son\'s television hero, he tries hard to to make it up to him. Unfortunately for Howard, it is Christmas Eve, and every store is sold out of Turbo Man, now Howard must travel all over town and compete with everybody else to find a Turbo Man action figure.',22.501041,129832389,89,'Two Dads, One Toy, No Prisoners.','Jingle All the Way',5.5,575),(729,66000000,'http://www.sonypictures.com/homevideo/hellboy/',1487,'en','Hellboy','In the final days of World War II, the Nazis attempt to use black magic to aid their dying cause. The Allies raid the camp where the ceremony is taking place, but not before a demon - Hellboy - has already been conjured. Joining the Allied forces, Hellboy eventually grows to adulthood, serving the cause of good rather than evil.',47.479755,99318987,122,'From the Dark Side to Our Side.','Hellboy',6.5,2225),(730,70000000,NULL,9422,'en','A Civil Action','Jan Schlickmann is a cynical lawyer who goes out to \"get rid of\" a case, only to find out it is potentially worth millions. The case becomes his obsession, to the extent that he is willing to give up everything - including his career and his clients\' goals, in order to continue the case against all odds.',10.147321,56702901,115,'Justice has its price.','A Civil Action',6.1,109),(731,60000000,'http://paranorman.com',77174,'en','ParaNorman','In the town of Blithe Hollow, Norman Babcock is a boy who can speak to the dead, but no one besides his eccentric new friend, Neil, believes his ability is real. One day, Norman\'s estranged eccentric uncle tells him of an important annual ritual he must take up to protect the town from an curse cast by a witch it condemned centuries ago. Eventually, Norman decides to cooperate, but things don\'t go according to plan. Now, a magic storm of the witch threatens Blithe Hollow as the accursed dead rise. Together with unexpected new companions, Norman struggles to save his town, only to discover the horrific truth of the curse. With that insight, Norman must resolve the crisis for good as only he can.',39.539045,107139399,90,'It\'s all fun and games until someone raises the dead.','ParaNorman',6.7,789),(732,60000000,NULL,4824,'en','The Jackal','Hired by a powerful member of the Russian mafia to avenge an FBI sting that left his brother dead, the perfectionist Jackal proves an elusive target for the men charged with the task of bringing him down: a deputy FBI boss and a former IRA terrorist.',19.747459,159330280,124,'How do you stop an assassin who has no identity?','The Jackal',6.1,527),(733,60000000,NULL,9620,'en','Paycheck','Michael Jennings is a genius who\'s hired – and paid handsomely – by high-tech firms to work on highly sensitive projects, after which his short-term memory is erased so he\'s incapable of breaching security. But at the end of a three-year job, he\'s told he isn\'t getting a paycheck and instead receives a mysterious envelope. In it are clues he must piece together to find out why he wasn\'t paid – and why he\'s now in hot water.',29.018826,96269812,119,'Remember the future.','Paycheck',5.9,581),(734,60000000,NULL,9302,'en','Up Close & Personal','Tally Atwater has a dream: to be a prime-time network newscaster. She pursues this dream with nothing but ambition, raw talent and a homemade demo tape. Warren Justice is a brilliant, hard edged, veteran newsman. He sees Tally has talent and becomes her mentor. Tally’s career takes a meteoric rise and she and Warren fall in love. The romance that results is as intense and revealing as television news itself. Yet, each breaking story, every videotaped crisis that brings them together, also threatens to drive them apart...',4.801849,NULL,119,'Every Day we Have, is One More Than We Deserve.','Up Close & Personal',5.9,50),(735,60000000,'https://www.uphe.com/movies/the-tale-of-despereaux',10199,'en','The Tale of Despereaux','Once upon a time... in the far away kingdom of Dor... lived a brave and virtuous mouse with comically oversized ears who dreamt of becoming a knight. Banished from his home for having such lofty ambitions, Despereaux sets off on an amazing adventure with his good-hearted rat friend Roscuro, who leads him, at long last, on a very noble quest to rescue an endangered princess and save an entire kingdom from darkness.',16.493576,50877145,93,'Small Mouse. Big Dreams','The Tale of Despereaux',5.8,258),(736,NULL,NULL,10771,'en','The Tuxedo','Cabbie-turned-chauffeur Jimmy Tong learns there is really only one rule when you work for playboy millionaire Clark Devlin : Never touch Devlin\'s prized tuxedo. But when Devlin is temporarily put out of commission in an explosive accident, Jimmy puts on the tux and soon discovers that this extraordinary suit may be more black belt than black tie. Paired with a partner as inexperienced as he is, Jimmy becomes an unwitting secret agent.',21.549232,NULL,98,'Suit up for action!','The Tuxedo',5.3,483),(737,60000000,NULL,3512,'en','Under Siege 2: Dark Territory','A passenger train has been hijacked by an electronics expert and turned into an untraceable command center for a weapons satellite. He has planned to blow up Washington DC and only one man can stop him, former Navy SEAL Casey Ryback.',13.080725,104324083,100,'Last time he rocked the boat. This time the sky\'s the limit.','Under Siege 2: Dark Territory',5.6,210),(738,60000000,NULL,137094,'en','Jack Ryan: Shadow Recruit','Jack Ryan, as a young covert CIA analyst, uncovers a Russian plot to crash the U.S. economy with a terrorist attack.',42.538258,50549107,105,'Trust no one.','Jack Ryan: Shadow Recruit',5.9,1173),(739,60000000,'http://www.foxmovies.com/movies/joy',274479,'en','Joy','A story based on the life of a struggling Long Island single mom who became one of the country\'s most successful entrepreneurs.',29.876507,101134059,124,NULL,'Joy',6.4,1581),(740,60000000,'https://www.facebook.com/LondonHasFallenOfficial',267860,'en','London Has Fallen','In London for the Prime Minister\'s funeral, Mike Banning discovers a plot to assassinate all the attending world leaders.',61.849521,205754447,99,'The world\'s leaders have assembled. So have their enemies.','London Has Fallen',5.8,1621),(741,70000000,NULL,8078,'en','Alien: Resurrection','Two hundred years after Lt. Ripley died, a group of scientists clone her, hoping to breed the ultimate weapon. But the new Ripley is full of surprises … as are the new aliens. Ripley must team with a band of smugglers to keep the creatures from reaching Earth.',37.449630,162000000,109,'It\'s already too late.','Alien: Resurrection',5.9,1365),(742,61000000,'http://www.shootermovie.com/',7485,'en','Shooter','A marksman living in exile is coaxed back into action after learning of a plot to kill the president. Ultimately double-crossed and framed for the attempt, he goes on the run to track the real killer and find out who exactly set him up, and why.',37.378081,95696996,124,'Yesterday was about honor. Today is about justice.','Shooter',6.9,1462),(743,60000000,NULL,17