ace and heart to heart with the last dragon on Earth, Draco. Taking up arms to suppress a tyrant king, Bowen soon realizes his task will be harder than he\'d imagined: If he kills the king, Draco will die as well.',31.791979,115267375,103,'You will believe.','DragonHeart',6.4,535),(805,60000000,'http://www.afterthesunset.com/',10589,'en','After the Sunset','Two master thieves (Brosnan and Hayek) are finally retiring after one last succesful mission. Residing in their own tropical paradise, their old nemesis, FBI Agent Stan P. Lloyd shows up to make sure they really are retired. Docked in the port is an ocean liner called the \"Diamond Cruise\" and Stan is convinced that they\'re not really retired at all, and that this is the next set up.',14.113066,61347797,97,'Who will walk away?','After the Sunset',6.0,226),(806,57000000,'http://www.thespiritofvengeance.com/',71676,'en','Ghost Rider: Spirit of Vengeance','When the devil resurfaces with aims to take over the world in human form, Johnny Blaze reluctantly comes out of hiding to transform into the flame-spewing supernatural hero Ghost Rider -- and rescue a 10-year-old boy from an unsavory end.',48.622278,149217355,95,'He Rides Again.','Ghost Rider: Spirit of Vengeance',4.7,1135),(807,57000000,'http://movies.uip.de/corellismandoline/',1722,'en','Captain Corelli\'s Mandolin','When a Greek fisherman leaves to fight with the Greek army during WWII, his fiancee falls in love with the local Italian commander. The film is based on a novel about an Italian soldier\'s experiences during the Italian occupation of the Greek island of Cephalonia (Kefalonia), but Hollywood made it into a pure love story by removing much of the \"unpleasant\" stuff.',9.061866,62112895,131,NULL,'Captain Corelli\'s Mandolin',5.5,145),(808,56000000,'http://movies.disney.com/the-pacifier',10022,'en','The Pacifier','Disgraced Navy SEAL Shane Wolfe is handed a new assignment: Protect the five Plummer kids from enemies of their recently deceased father -- a government scientist whose top-secret experiment remains hidden in the kids\' house.',35.476300,113006880,95,'Welcome to the infantry.','The Pacifier',5.8,842),(809,56000000,NULL,11358,'en','Walking Tall','A former U.S. soldier returns to his hometown to find it overrun by crime and corruption, which prompts him to clean house.',23.438398,57223890,86,'One man will stand up for what\'s right.','Walking Tall',6.0,381),(810,55000000,NULL,13,'en','Forrest Gump','A man with a low IQ has accomplished great things in his life and been present during significant historic events - in each case, far exceeding what anyone imagined he could do. Yet, despite all the things he has attained, his one true love eludes him. \'Forrest Gump\' is the story of a man who rose above his challenges, and who proved that determination, courage, and love are more important than ability.',138.133331,677945399,142,'The world will never be the same, once you\'ve seen it through the eyes of Forrest Gump.','Forrest Gump',8.2,7927),(811,60000000,'http://www.chipmunks.com',6477,'en','Alvin and the Chipmunks','A struggling songwriter named Dave Seville finds success when he comes across a trio of singing chipmunks: mischievous leader Alvin, brainy Simon, and chubby, impressionable Theodore.',47.336034,361366633,92,'Get your squeak on!','Alvin and the Chipmunks',5.5,1177),(812,55000000,NULL,1597,'en','Meet the Parents','Greg Focker is ready to marry his girlfriend, Pam, but before he pops the question, he must win over her formidable father, humorless former CIA agent Jack Byrnes, at the wedding of Pam\'s sister. As Greg bends over backward to make a good impression, his visit to the Byrnes home turns into a hilarious series of disasters, and everything that can go wrong does, all under Jack\'s critical, hawklike gaze.',29.972240,330444045,108,'First comes love. Then comes the interrogation.','Meet the Parents',6.6,1698),(813,55000000,NULL,10530,'en','Pocahontas','History comes gloriously to life in Disney\'s epic animated tale about love and adventure in the New World. Pocahontas is a Native American woman whose father has arranged for her to marry her village\'s best warrior. But a vision tells her change is coming, and soon she comes face to face with it in the form of Capt. John Smith.',47.845589,346079773,81,'An American legend comes to life.','Pocahontas',6.7,1457),(814,55000000,NULL,1924,'en','Superman','Mild-mannered Clark Kent works as a reporter at the Daily Planet alongside his crush, Lois Lane − who\'s in love with Superman. Clark must summon his superhero alter ego when the nefarious Lex Luthor launches a plan to take over the world.',48.507081,300218018,143,'You\'ll Believe a Man Can Fly!','Superman',6.9,1022),(815,54000000,NULL,9327,'en','The Nutty Professor','Eddie Murphy stars as shy Dr. Sherman Klump, a kind, brilliant, \'calorifically challenged\' genetic professor. When beautiful Carla Purty joins the university faculty, Sherman grows desperate to whittle his 400-pound frame down to size and win her heart. So, with one swig of his experimental fat-reducing serum, Sherman becomes \'Buddy Love\', a fast-talking, pumped-up , plumped down Don Juan.',20.281190,128769345,95,'Inside Sherman Klump, a party animal is about to break out.','The Nutty Professor',5.4,702),(816,70000000,NULL,8488,'en','Hitch','Dating coach Alex \'Hitch\' Hitchens mentors a bumbling client, Albert, who hopes to win the heart of the glamorous Allegra Cole. While Albert makes progress, Hitch faces his own romantic setbacks when proven techniques fail to work on Sara Melas, a tabloid reporter digging for dirt on Allegra Cole\'s love life. When Sara discovers Hitch\'s connection to Albert – now Allegra\'s boyfriend – it threatens to destroy both relationships.',34.576913,368100420,118,'The cure for the common man.','Hitch',6.4,1665),(817,55000000,NULL,10603,'en','George of the Jungle','Baby George got into a plane crash in a jungle, stayed alive and was adopted by a wise ape. Ursula Stanhope, US noble woman is saved from death on safari by grown-up George, and he takes her to jungle to live with him. He slowly learns a rules of human relationships, while Ursula\'s lover Lyle is looking for her and the one who took her. After they are found, Ursula takes George to the USA.',22.573237,NULL,92,'Watch out!','George of the Jungle',5.4,496),(818,55000000,NULL,8273,'en','American Wedding','With high school a distant memory, Jim and Michelle are getting married -- and in a hurry, since Jim\'s grandmother is sick and wants to see him walk down the aisle -- prompting Stifler to throw the ultimate bachelor party. And Jim\'s dad is reliable as ever, doling out advice no one wants to hear.',36.194802,231449203,103,'Forever hold your piece.','American Wedding',6.0,1129),(819,55000000,'http://www.captainphillipsmovie.com',109424,'en','Captain Phillips','The true story of Captain Richard Phillips and the 2009 hijacking by Somali pirates of the US-flagged MV Maersk Alabama, the first American cargo ship to be hijacked in two hundred years.',52.786917,95000000,134,'Out here survival is everything.','Captain Phillips',7.6,2454),(820,55000000,'http://www.datenight-movie.com/',35056,'en','Date Night','Phil and Claire Foster fear that their mild-mannered relationship may be falling into a stale rut. During their weekly date night, their dinner reservation leads to their being mistaken for a couple of thieves – and now a number of unsavoury characters want Phil and Claire killed.',38.061680,152263880,97,'One ordinary couple. One little white lie.','Date Night',5.9,1122),(821,50000000,NULL,8839,'en','Casper','Furious that her late father only willed her his gloomy-looking mansion rather than his millions, Carrigan Crittenden is ready to burn the place to the ground when she discovers a map to a treasure hidden in the house. But when she enters the rickety mansion to seek her claim, she is frightened away by a wicked wave of ghosts. Determined to get her hands on this hidden fortune, she hires afterlife therapist Dr. James Harvey to exorcise the ghosts from the mansion. Harvey and his daughter Kat move in, and soon Kat meets Casper, the ghost of a young boy who\'s \"the friendliest ghost you know.\" But not so friendly are Casper\'s uncles--Stretch, Fatso and Stinkie--who are determined to drive all \"fleshies\" away.',19.830132,287928194,100,'Get an afterlife','Casper',6.0,1019),(822,55000000,NULL,156022,'en','The Equalizer','In The Equalizer, Denzel Washington plays McCall, a man who believes he has put his mysterious past behind him and dedicated himself to beginning a new, quiet life. But when McCall meets Teri (Chloë Grace Moretz), a young girl under the control of ultra-violent Russian gangsters, he can’t stand idly by – he has to help her. Armed with hidden skills that allow him to serve vengeance against anyone who would brutalize the helpless, McCall comes out of his self-imposed retirement and finds his desire for justice reawakened. If someone has a problem, if the odds are stacked against them, if they have nowhere else to turn, McCall will help. He is The Equalizer.',79.922059,192330738,132,'What do you see when you look at me?','The Equalizer',7.1,2954),(823,55000000,'http://www.sonypictures.com/movies/maidinmanhattan/',7303,'en','Maid in Manhattan','Marisa Ventura is a struggling single mom who works at a posh Manhattan hotel and dreams of a better life for her and her young son. One fateful day, hotel guest and senatorial candidate Christopher Marshall meets Marisa and mistakes her for a wealthy socialite. After an enchanting evening together, the two fall madly in love. But when Marisa\'s true identity is revealed, issues of class and social status threaten to separate them. Can two people from very different worlds overcome their differences and live happily ever after?',19.738215,154906693,105,NULL,'Maid in Manhattan',5.6,485),(824,53000000,NULL,8963,'en','Crimson Tide','On a US nuclear missile sub, a young first officer stages a mutiny to prevent his trigger happy captain from launching his missiles before confirming his orders to do so.',20.334629,157387195,116,'Danger runs deep.','Crimson Tide',7.0,498),(825,55000000,'http://www.sonypictures.com/homevideo/thepursuitofhappyness/',1402,'en','The Pursuit of Happyness','The true story of Christopher Gardner, who invests heavily in a device known as a \'Bone Density Scanner\', only to find himself struggle to sell the product as it\'s just marginally better than the current technology, and much more expensive. His wife leaves him,  he loses his house, bank account and credit cards and, now forced to live out in the streets with his young son,  he\'s desperate to find a steady job. He takes on a job as a stockbroker but, before he can receive pay, he needs to go through 6 months of training, and must sell his devices.',80.581367,307077295,117,NULL,'The Pursuit of Happyness',7.7,2525),(826,55000000,NULL,9315,'en','Flightplan','A claustrophobic, Hitchcockian thriller. A bereaved woman and her daughter are flying home from Berlin to America. At 30,000 feet the child vanishes and nobody admits she was ever on that plane.',32.051450,223387299,98,'If Someone Took Everything You Live For... How Far Would You Go To Get It Back?','Flightplan',6.1,772),(827,55000000,NULL,8984,'en','Disclosure','A computer specialist is sued for sexual harassment by a former lover turned boss who initiated the act forcefully, which threatens both his career and his personal life.',15.064058,214015089,123,'Sex Is Power.','Disclosure',5.9,210),(828,55000000,NULL,795,'en','City of Angels','When guardian angel Seth -- who invisibly watches over the citizens of Los Angeles -- becomes captivated by Maggie, a strong-willed heart surgeon, he ponders trading in his pure, otherworldly existence for a mortal life with his beloved. The couple embarks on a tender but forbidden romance spanning heaven and Earth.',21.272734,198685114,114,'She didn\'t believe in angels until she fell in love with one.','City of Angels',6.4,529),(829,30000000,'http://www.miramax.com/movie/kill-bill-volume-1/',24,'en','Kill Bill: Vol. 1','An assassin is shot at the altar by her ruthless employer, Bill and other members of their assassination circle – but \'The Bride\' lives to plot her vengeance. Setting out for some payback, she makes a death list and hunts down those who wronged her, saving Bill for last.',79.754966,180949000,111,'Go for the kill.','Kill Bill: Vol. 1',7.7,4949),(830,55000000,NULL,11353,'en','Bowfinger','On the verge of bankruptcy and desperate for his big break, aspiring filmmaker Bobby Bowfinger concocts a crazy plan to make his ultimate dream movie. Rallying a ragtag team that includes a starry-eyed ingenue, a has-been diva and a film studio gofer, he sets out to shoot a blockbuster featuring the biggest star in Hollywood, Kit Ramsey -- only without letting Ramsey know he\'s in the picture.',13.191829,NULL,97,'The con is on.','Bowfinger',6.0,254),(831,30000000,NULL,393,'en','Kill Bill: Vol. 2','The Bride unwaveringly continues on her roaring rampage of revenge against the band of assassins who had tried to kill her and her unborn child. She visits each of her former associates one-by-one, checking off the victims on her Death List Five until there\'s nothing left to do … but kill Bill.',50.622607,152159461,136,'The bride is back for the final cut.','Kill Bill: Vol. 2',7.6,3948),(832,55000000,NULL,9618,'en','Tango & Cash','Ray Tango and Gabriel Cash are narcotics detectives who, while both being extremely successful, can\'t stand each other. Crime Lord Yves Perret, furious at the loss of income that Tango and Cash have caused him, frames the two for murder. Caught with the murder weapon on the scene of the crime, the two have no alibi. Thrown into prison with most of the criminals they helped convict, it appears that they are going to have to trust each other if they are to clear their names and catch the evil Perret.',22.787667,63408614,104,'Two of L.A.\'s top rival cops are going to have to work together... Even if it kills them.','Tango & Cash',6.1,458),(833,55000000,NULL,9374,'en','Death Becomes Her','Madeline is married to Ernest, who was once arch-rival Helen\'s fiance. After recovering from a mental breakdown, Helen vows to kill Madeline and steal back Ernest. Unfortunately for everyone, the introduction of a magic potion causes things to be a great deal more complicated than a mere murder plot.',29.498304,149022650,104,'In one small bottle... The fountain of youth. The secret of eternal life. The power of an ancient potion. Sometimes it works... sometimes it doesn\'t.','Death Becomes Her',6.3,636),(834,55000000,NULL,8584,'en','Shanghai Noon','Chon Wang, a clumsy imperial guard trails Princess Pei Pei when she is kidnapped from the Forbidden City and transported to America. Wang follows her captors to Nevada, where he teams up with an unlikely partner, outcast outlaw Roy O\'Bannon, and tries to spring the princess from her imprisonment.',25.400935,56932305,110,'The old west meets the far east.','Shanghai Noon',6.2,735),(835,55000000,NULL,2320,'en','Executive Decision','Terrorists hijack a 747 inbound to Washington D.C., demanding the the release of their imprisoned leader. Intelligence expert David Grant (Kurt Russell) suspects another reason and he is soon the reluctant member of a special assault team that is assigned to intercept the plane and hijackers.',17.231675,121969216,133,'Fasten your seat belts','Executive Decision',5.8,256),(836,55000000,'http://www.popperspenguins.com/main.html',58224,'en','Mr. Popper\'s Penguins','Jim Carrey stars as Tom Popper, a successful businessman who’s clueless when it comes to the really important things in life...until he inherits six “adorable” penguins, each with its own unique personality. Soon Tom’s rambunctious roommates turn his swank New York apartment into a snowy winter wonderland — and the rest of his world upside-down.',32.835777,187361754,94,NULL,'Mr. Popper\'s Penguins',5.7,751),(837,55000000,'http://www.forbiddenkingdommovie.com/',1729,'en','The Forbidden Kingdom','An American teenager who is obsessed with Hong Kong cinema and kung-fu classics makes an extraordinary discovery in a Chinatown pawnshop: the legendary stick weapon of the Chinese sage and warrior, the Monkey King. With the lost relic in hand, the teenager unexpectedly finds himself travelling back to ancient China to join a crew of warriors from martial arts lore on a dangerous quest to free the imprisoned Monkey King.',17.097041,127906624,104,'The battle for eternity is the fantasy of a lifetime.','The Forbidden Kingdom',6.3,461),(838,55000000,NULL,175574,'en','Free Birds','In this irreverent, hilarious, adventurous buddy comedy for audiences of all ages, directed by Jimmy Hayward (Horton Hears a Who!), two turkeys from opposite sides of the tracks must put aside their differences and team up to travel back in time to change the course of history - and get turkey off the holiday menu for good.',14.414937,110000000,91,'Hang On To Your Nuggets','Free Birds',5.7,254),(839,50000000,NULL,8077,'en','Alien³','After escaping with Newt and Hicks from the alien planet, Ripley crash lands on Fiorina 161, a prison planet and host to a correctional facility. Unfortunately, although Newt and Hicks do not survive the crash, a more unwelcome visitor does. The prison does not allow weapons of any kind, and with aid being a long time away, the prisoners must simply survive in any way they can.',45.856409,159773545,114,'The bitch is back.','Alien³',6.2,1633),(840,55000000,'http://en.wikipedia.org/wiki/Evita_(film)',8818,'en','Evita','The hit musical based on the life of Evita Duarte, a B-movie Argentinian actress who eventually became the wife of Argentinian president and dictator Juan Perón, and the most beloved and hated woman in Argentina.',7.027139,141047179,134,'The Most Anticipated Motion Picture Event of The Year','Evita',5.9,120),(841,55000000,NULL,8195,'en','Ronin','A briefcase with undisclosed contents – sought by Irish terrorists and the Russian mob – makes its way into criminals\' hands. An Irish liaison assembles a squad of mercenaries, or \'ronin\', and gives them the thorny task of recovering the case.',32.657488,41610884,122,'Your ally could become your enemy.','Ronin',6.7,658),(842,50000000,NULL,10586,'en','The Ghost and the Darkness','Sir Robert Beaumont is behind schedule on a railroad in Africa. Enlisting noted engineer John Henry Patterson to right the ship, Beaumont expects results. Everything seems great until the crew discovers the mutilated corpse of the project\'s foreman, seemingly killed by a lion. After several more attacks, Patterson calls in famed hunter Charles Remington, who has finally met his match in the bloodthirsty lions.',12.465250,75000000,109,'Prey For The Hunters','The Ghost and the Darkness',6.4,236),(843,55000000,'http://www.paddington.com/',116149,'en','Paddington','A young Peruvian bear with a passion for all things British travels to London in search of a home. Finding himself lost and alone at Paddington Station, he begins to realize that city life is not all he had imagined - until he meets the kindly Brown family, who read the label around his neck (\'Please look after this bear. Thank you.\') and offer him a temporary haven. It looks as though his luck has changed until this rarest of bears catches the eye of a museum taxidermist...',39.882276,259207227,95,'The Adventure Begins','Paddington',7.0,883),(844,68000000,NULL,80035,'en','The Watch','Four everyday suburban guys come together as an excuse to escape their humdrum lives one night a week. But when they accidentally discover that their town has become overrun with aliens posing as ordinary suburbanites, they have no choice but to save their neighborhood - and the world - from total extermination.',39.395881,68267862,98,'Got Protection?','The Watch',5.3,881),(845,55000000,NULL,10632,'en','The Hunted','In the wilderness of British Columbia, two hunters are tracked and viciously murdered by Aaron Hallum. Former Special Operations instructor, L.T. Bonham is approached and asked to apprehend Hallum, his former student, who has \'gone rogue\' after suffering severe battle stress from his time in Kosovo.',8.634954,34234008,94,'Some men should not be found.','The Hunted',6.0,189),(846,80000000,NULL,12117,'en','Instinct','Dr. Ethan Powell, an anthropologist, is in Africa studying apes when he is lost for two years. When he is found, he kills 3 men and puts 2 in the hospital. Cuba Gooding\'s character is a psychiatrist who wants to take up the task of trying to get Dr. Powell to speak again and maybe even stand judgment at a trial for his release from prison of mental cases. Along the way, Cuba has to deal with also helping the mental patients that are being abused and neglected. In this process Cuba learns a few things about himself and life, and so does Anthony Hopkins character, Dr. Powell.',7.386394,NULL,126,NULL,'Instinct',6.2,146),(847,55000000,NULL,1792,'en','Stuck on You','In Martha\'s Vineyard, Mass., conjoined twins Walt (Greg Kinnear) and Bob Tenor (Matt Damon) make the best of their handicap by being the fastest grill cooks in town. While outgoing Walt hopes to one day become a famous actor, shy Bob prefers to stay out of the spotlight. When a fading Hollywood actress, Cher (Cher), decides to get her show \"Honey and the Beaze\" cancelled, she hires Walt -- and his brotherly appendage -- as her costars. But their addition surprisingly achieves the opposite.',8.802525,33828318,118,'Whatever happens to the boys, one thing is certain. Nothing will ever come between them.','Stuck on You',5.1,188),(848,NULL,'http://newline.com/properties/semipro.html',13260,'en','Semi-Pro','Jackie Moon is the owner, promoter, coach, and star player of the Flint Michigan Tropics of the American Basketball Association (ABA). In 1976 before the ABA collapses, the National Basketball Association (NBA) plans to merge with the best teams of the ABA at the end of the season. Only the top four teams will make the move and the worst teams will fold. The Tropics are the worst team in the league and if they want to make it to the NBA, Jackie Moon must rally his team and start winning. The only problem is the fact that Jackie Moon is not really the coach and star basketball player he thinks he is. To keep his team from oblivion and leave his mark in the city, Jackie Moon must inspire his team to win fourth place in the playoffs.',10.449975,33472850,91,'Putting the funk into the dunk.','Semi-Pro',5.4,251),(849,60000000,NULL,72197,'en','The Pirates! In an Adventure with Scientists!','The luxuriantly bearded Pirate Captain is a boundlessly enthusiastic, if somewhat less-than-successful, terror of the High Seas. With a rag-tag crew at his side, and seemingly blind to the impossible odds stacked against him, the Captain has one dream: to beat his bitter rivals Black Bellamy and Cutlass Liz to the much coveted Pirate of the Year Award. It’s a quest that takes our heroes from the shores of exotic Blood Island to the foggy streets of Victorian London. Along the way they battle a diabolical queen and team up with a haplessly smitten young scientist, but never lose sight of what a pirate loves best: adventure!',23.700759,118338361,88,'It\'s A Plunderful Life','The Pirates! In an Adventure with Scientists!',6.4,374),(850,55000000,'http://www.changelingmovie.net',3580,'en','Changeling','Christine Collins is overjoyed when her kidnapped son is brought back home. But when Christine suspects that the boy returned to her isn\'t her child, the police captain has her committed to an asylum.',27.509160,113020255,141,'To find her son, she did what no one else dared.','Changeling',7.3,1131),(851,50000000,NULL,12123,'en','Chain Reaction','Two researchers in a green alternative energy project are put on the run when they are framed for murder and treason.',20.588620,60209334,107,'Reaction Time 8-4-96','Chain Reaction',5.3,284),(852,55000000,NULL,9566,'en','The Fan','When the San Francisco Giants pay centerfielder Bobby Rayburn $40 million to lead their team to the World Series, no one is happier or more supportive than #1 fan Gil Renard.  So when Rayburn becomes mired in the worst slump of his career, the obsessed Renard decides to stop at nothing to help his idol regain his former glory... not even murder.',4.366488,18626419,116,'All fans have a favorite player.  This one has a favorite target.','The Fan',5.7,194),(853,70000000,NULL,9833,'en','The Phantom of the Opera','Deformed since birth, a bitter man known only as the Phantom lives in the sewers underneath the Paris Opera House. He falls in love with the obscure chorus singer Christine, and privately tutors her while terrorizing the rest of the opera house and demanding Christine be given lead roles. Things get worse when Christine meets back up with her childhood acquaintance Raoul and the two fall in love',18.927463,154648887,143,'The classic musical comes to the big screen for the first time.','The Phantom of the Opera',7.0,438),(854,55000000,NULL,4517,'en','Elizabeth: The Golden Age','When Queen Elizabeth\'s reign is threatened by ruthless familial betrayal and Spain\'s invading army, she and her shrewd adviser must act to safeguard to the lives of her people.',15.274137,74237563,114,'Woman. Warrior. Queen.','Elizabeth: The Golden Age',6.6,303),(855,62000000,NULL,8202,'en','Æon Flux','400 years into the future, disease has wiped out the majority of the world\'s population, except one walled city, Bregna, ruled by a congress of scientists. When Æon Flux, the top operative in the underground \'Monican\' rebellion, is sent on a mission to kill a government leader, she uncovers a world of secrets.',29.954302,52304001,93,'The Perfect World Meets The Perfect Assassin','Æon Flux',5.4,703),(856,56000000,NULL,16072,'en','Gods and Generals','The film centers mostly around the personal and professional life of Thomas \"Stonewall\" Jackson, a brilliant if eccentric Confederate general, from the outbreak of the American Civil War until its halfway point when Jackson is killed accidentally by his own soldiers in May 1863 during his greatest victory.',4.362535,12923936,214,'The nations heart was touched by...','Gods and Generals',6.1,48),(857,55000000,NULL,34314,'en','Turbulence','On a flight transporting dangerous convicts, murderer Ryan Weaver manages to break free and cause complete chaos throughout the plane. As various people on board fall victim to Weaver, it is ultimately down to flight attendant Teri Halloran to keep the aircraft from crashing, with on-ground support from an air traffic controller. While Halloran struggles to pilot the plane, Weaver continues to terrorize the surviving members of the crew.',4.700024,11466088,100,'If you weren\'t afraid of flying before, you will be now.','Turbulence',5.2,62),(858,55000000,'http://www.imaginethatmovie.com/',19724,'en','Imagine That','A financial executive who can\'t stop his career downspiral is invited into his daughter\'s imaginary world, where solutions to his problems await.',12.340384,NULL,107,'What if your daughter\'s imagination... Was the secret to your success?','Imagine That',5.7,134),(859,50000000,NULL,145220,'en','Muppets Most Wanted','While on a grand world tour, The Muppets find themselves wrapped into an European jewel-heist caper headed by a Kermit the Frog look-alike and his dastardly sidekick.',14.808304,80383290,112,'Taking the world by farce','Muppets Most Wanted',6.2,316),(860,57000000,'http://www.thunderbirdsmovie.com',14623,'en','Thunderbirds','Dangerous missions are the bread and butter of the Thunderbirds, a high-tech secret force employed by the government. Led by Jeff Tracy (Bill Paxton), the Thunderbirds are at the top of their game, but their nemesis, The Hood (Ben Kingsley), has landed on their island and is attempting a coup by using the team\'s rescue vehicles. He\'ll soon discover that the Thunderbirds won\'t go down.',9.278750,28283637,95,NULL,'Thunderbirds',4.2,91),(861,55000000,'http://www.burlesquethemovie.com/',42297,'en','Burlesque','The Burlesque Lounge has its best days behind it. Tess, a retired dancer and owner of the venue, struggles to keep the aging theater alive, facing all kinds of financial and artistic challenges. With the Lounge\'s troupe members becoming increasingly distracted by personal problems and a threat coming from a wealthy businessman\'s quest to buy the spot from Tess, the good fortune seems to have abandoned the club altogether. Meanwhile, the life of Ali, a small-town girl from Iowa, is about to change dramatically. Hired by Tess as a waitress at the Lounge, Ali escapes a hollow past and quickly falls in love with the art of burlesque. Backed by newfound friends amongst the theater\'s crew, she manages to fulfill her dreams of being on stage herself. Things take a dramatic turn though when Ali\'s big voice makes her become the main attraction of the revue',22.863516,89519773,119,'It takes a legend... to make a star','Burlesque',6.9,573),(862,47000000,NULL,2841,'fr','Un long dimanche de fiançailles','In 1919, Mathilde was 19 years old. Two years earlier, her fiancé Manech left for the front at the Somme. Like millions of others he was \"killed on the field of battle.\" It\'s written in black and white on the official notice. But Mathilde refuses to believe it. If Manech had died, she would know. She hangs on to her intuition as tightly as she would onto the last thread of hope linking her to her lover. A former sergeant tells her in vain that Manech died in the no man\'s land of a trench named Bingo Crepescule, in the company of four other men condemned to die for self-inflicted wounds. Her path ahead is full of obstacles but Mathilde is not frightened. Anything is possible to someone who is willing to challenge fate...',23.054510,NULL,133,'Never let go','A Very Long Engagement',7.1,346)