er brother of a powerful federal prosecutor. When plans go awry, Gigli\'s boss sends in Ricki, a gorgeous free-spirited female gangster who has her own set of orders to assist with the kidnapping. But Gigli begins falling for the decidedly unavailable Ricki, which could be a hazard to his occupation.',9.053456,7266209,121,'Life doesn\'t play by the rules.','Gigli',3.5,104),(873,55000000,'http://www.sonypictures.com/homevideo/allthekingsmen/',1717,'en','All the King\'s Men','The story of an idealist\'s rise to power in the world of Louisiana politics and the corruption that leads to his ultimate downfall. Based on the1946 Pulitzer Prize-winning novel written by Robert Penn Warren.',7.768223,9450897,125,'Some people will do anything to gain power. Some will do anything to keep it.','All the King\'s Men',5.7,95),(874,46000000,NULL,479,'en','Shaft','New York police detective John Shaft arrests Walter Wade Jr. for a racially motivated slaying. But the only eyewitness disappears, and Wade jumps bail for Switzerland. Two years later Wade returns to face trial, confident his money and influence will get him acquitted -- especially since he\'s paid a drug kingpin to kill the witness.',19.643365,107196498,99,'Still the man, any questions?','Shaft',5.5,308),(875,53000000,NULL,9444,'en','Anastasia','This animated adventure retells the story of the lost daughter of Russia\'s last czar. The evil Rasputin places a curse on the Romanov family, and Anastasia and her grandmother, Empress Maria, get separated. After growing up in an orphanage, Anastasia encounters two Russian men seeking a reward offered by Empress Maria for the return of her granddaughter. The trio travels to Paris, where they find that the empress has grown skeptical of imposters.',45.565918,139804348,94,'Discover the Adventure Behind the Greatest Mystery of Our Time.','Anastasia',7.4,1432),(876,52500000,NULL,824,'en','Moulin Rouge!','A celebration of love and creative inspiration takes place in the infamous, gaudy 