ble feature that\'ll tear you in two!','Grindhouse',6.8,459),(882,NULL,NULL,39437,'en','Beloved','After Paul D. finds his old slave friend Sethe in Ohio and moves in with her and her daughter Denver, a strange girl comes along by the name of \"Beloved\". Sethe and Denver take her in and then strange things start to happen...',1.453765,NULL,172,'The past has a life of its own.','Beloved',5.9,26),(883,NULL,'http://luckyyoumovie.warnerbros.com/',1950,'en','Lucky You','A professional poker player whose astounding luck at the table fails to translate into his lonesome love life attempts to win the World Series of Poker while simultaneously earning the affections of a beautiful Las Vegas singer.',6.162872,5761917,124,'Change your game. Change your life.','Lucky You',5.4,81),(884,52000000,'https://www.facebook.com/CatchMeIfYouCanMovie',640,'en','Catch Me If You Can','A true story about Frank Abagnale Jr. who, before his 19th birthday, successfully conned millions of dollars worth of checks as a Pan Am pilot, doctor, and legal prosecutor. An FBI agent makes it his mission to put him behind bars. But Frank not only eludes capture, he revels in the pursuit.',73.944049,352114312,141,'The true story of a real fake.','Catch Me If You Can',7.7,3795),(885,40000000,'http://www.zerodarkthirty-movie.com/site/',97630,'en','Zero Dark Thirty','A chronicle of the decade-long hunt for al-Qaeda terrorist leader Osama bin Laden after the September 2001 attacks, and his death at the hands of the Navy S.E.A.L. Team 6 in May, 2011.',38.306954,132820716,157,'The Greatest Manhunt in History','Zero Dark Thirty',6.7,1702),(886,52000000,'https://www.uphe.com/movies/the-break-up',9767,'en','The Break-Up','Cohabitating couple Gary and Brooke find their once-blissful romance on the rocks when petty spats about lemons and dirty dishes mushroom into an all-out battle for custody of their upscale Chicago condo. An escalating argument ensues as Gary and Brooke continue to live under the same roof, all while cooking up schemes to drive each other off the premises.',26.251217,204999686,106,'. . . pick a side.','The Break-Up',5.6,832),(887,52000000,NULL,11631,'en','Mamma Mia!','Set on an idyllic Greek island, the plot serves as a background for a wealth of ABBA hit songs. Donna, an independent, single mother who owns a small hotel on the island is about to let go of Sophie, the spirited young daughter she\'s raised alone. But Sophie has secretly invited three of her mother\'s ex-lovers in the hopes of finding her father.',30.780599,609841637,108,'Take a trip down the aisle you\'ll never forget','Mamma Mia!',6.4,1386),(888,52000000,'http://www.valentinesdaymovie.com/',32856,'en','Valentine\'s Day','More than a dozen Angelenos navigate Valentine\'s Day from early morning until midnight. Three couples awake together, but each relationship will sputter; are any worth saving? A grade-school boy wants flowers for his first true love; two high school seniors plan first-time sex at noon; a TV sports reporter gets the assignment to find romance in LA; a star quarterback contemplates his future; two strangers meet on a plane; grandparents, together for years, face a crisis; and, an \"I Hate Valentine\'s Day\" dinner beckons the lonely and the lied to. Can Cupid finish his work by midnight?',25.419290,216485654,125,'A Love Story. More or Less.','Valentine\'s Day',5.7,1013),(889,50000000,'http://www.warnerbros.com/dukes-hazzard/index_splash',6519,'en','The Dukes of Hazzard','Cousins, Bo and Luke Duke, with the help of their eye-catching cousin, Daisy and moonshine-running Uncle Jesse, try and save the family farm from being destroyed by Hazzard County\'s corrupt commissioner, Boss Hogg. Their efforts constantly find the \'Duke Boys\' eluding authorities in \'The General Lee\', their 1969 orange Dodge Charger that keeps them one step ahead of the dimwitted antics of the small southern town\'s Sheriff, Roscoe P. Coltrane.',15.982120,110803676,104,'Cousins. Outlaws. Thrillbillies.','The Dukes of Hazzard',5.1,316),(890,52000000,NULL,8741,'en','The Thin Red Line','Based on the graphic novel by James Jones, The Thin Red Line tells the story of a group of men, an Army Rifle company called C-for-Charlie, who change, suffer, and ultimately make essential discoveries about themselves during the fierce World War II battle of Guadalcanal. It follows their journey, from the surprise of an unopposed landing, through the bloody and exhausting battles that follow, to the ultimate departure of those who survived. A powerful frontline cast - including Sean Penn, Nick Nolte, Woody Harrelson and George Clooney - explodes into action in this hauntingly realistic view of military and moral chaos in the Pacific during World War II.',40.072583,98126565,170,'Every man fights his own war.','The Thin Red Line',7.2,771),(891,52000000,'http://www.thechangeupmovie.com/',49520,'en','The Change-Up','Dave is a married man with two kids and a loving wife , and Mitch is a single man who is at the prime of his sexual life. One fateful night while Mitch and Dave are peeing in a fountain when lightning strikes, they switch bodies.',32.015477,75450437,112,'Who says men can\'t change?','The Change-Up',5.9,736),(892,82000000,'http://www.universalpictures.com/manonthemoon/',1850,'en','Man on the Moon','A film about the life and career of the eccentric avant-garde comedian, Andy Kaufman.',24.444186,47434430,118,'Hello, my name is Andy and this is my movie.','Man on the Moon',6.9,435),(893,52000000,NULL,524,'en','Casino','The life of the gambling paradise – Las Vegas – and its dark mafia underbelly.',40.066880,116112375,178,'No one stays at the top forever.','Casino',7.8,1307),(894,52000000,'http://www.frompariswithlovefilm.com/',26389,'en','From Paris with Love','James Reese has a good job as an ambassador\'s aid in France, but his real passion is a side gig, working in a minor role in the CIA. He would love to be a full-fledged agent and can\'t believe his luck when he lands an assignment with Charlie Wax. Trigger-happy Charlie soon has James crying for his desk job, but when he learns that the same guys they\'re trying to catch are after him, James realizes that Charlie may be his only hope of survival.',27.916284,52826594,92,'Two agents. One city. No merci.','From Paris with Love',6.1,675),(895,52000000,NULL,11817,'en','Bulletproof Monk','A mysterious and immortal Tibetan kung fu master, who has spent the last 60 years traveling around the world protecting the ancient Scroll of the Ultimate, mentors a selfish street kid in the ancient intricacies of kung fu.',15.207070,NULL,104,'A power beyond measure requires a protector without equal.','Bulletproof Monk',5.1,278),(896,51000000,NULL,2123,'en','Me, Myself & Irene','Rhode Island State Trooper Charlie Baileygates has a multiple personality disorder. One personality is crazy and aggressive, while the other is more friendly and laid back. Both of these personalities fall in love with the same woman named Irene after Charlie loses his medication.',39.001682,149270999,116,'From gentle to mental.','Me, Myself & Irene',6.1,927),(897,51000000,NULL,9907,'en','Barnyard','When things get crazy at the farm, it\'s up to a boisterous bovine named Otis (voiced by Kevin James) to save the day in this computer-animated tale. The animals in this barnyard sing, dance and party, but Otis\'s stern dad (Sam Elliott) warns the crew to keep their cool around humans. Troublemaker Otis rarely listens to his pop, but when the farmer disappears and the animals go nutty, the young cow realizes he must stop the madness.',10.430832,72779000,90,'What happens in the barn stays in the barn','Barnyard',5.3,225),(898,NULL,NULL,9969,'en','Deck the Halls','Two neighbors have it out after one of them decorates his house for the holidays so brightly that it can be seen from space.',5.952527,47231070,93,'There glows the neighborhood','Deck the Halls',5.1,109),(899,50000000,'http://www.twilightthemovie.com/',18239,'en','The Twilight 