s finds himself besieged by opportunists all gunning for their piece of the pie. Babe, a television tabloid reporter, poses as an innocent small-town girl to do an exposé on Deeds.',18.121404,171269535,96,'Small town kid, big time right hook.','Mr. Deeds',5.6,644),(909,50000000,'http://www.super8-movie.com/',37686,'en','Super 8','In 1979 Ohio, several youngsters are making a zombie movie with a Super-8 camera. In the midst of filming, the friends witness a horrifying train derailment and are lucky to escape with their lives. They soon discover that the catastrophe was no accident, as a series of unexplained events and disappearances soon follows. Deputy Jackson Lamb, the father of one of the kids, searches for the terrifying truth behind the crash.',37.069253,260095987,112,'It Arrives.','Super 8',6.6,2435),(910,52000000,'http://www.brockovich.com/movie.html',462,'en','Erin Brockovich','A twice-divorced mother of three who sees an injustice, takes on the bad guy and wins -- with a little help from her push-up bra. Erin goes to work for an attorney and comes across medical records describing illnesses clustered in one nearby town. She starts investigating and soon exposes a monumental cover-up.',30.347332,256271286,131,'She brought a small town to its feet and a huge corporation to its knees.','Erin Brockovich',7.1,716),(911,50000000,NULL,9919,'en','How to Lose a Guy in 10 Days','An advice columnist, Andie Anderson (Kate Hudson), tries pushing the boundaries of what she can write about in her new piece about how to get a man to leave you in 10 days. Her editor, Lana (Bebe Neuwirth), loves it, and Andie goes off to find a man she can use for the experiment. Enter executive Ben Berry (Matthew McConaughey), who is so confident in his romantic prowess that he thinks he can make any woman fall in love with him in 10 days. When Andie and Ben meet, their plans backfire.',23.854701,177371441,116,'One of them is lying. So is the other.','How to Lose a Guy in 10 Days',6.3,850),(912,50000000,'http://www.22jumpstreetmovie.com',187017,'en','22 Jump Street','After making their way through high school (twice), big changes are in store for officers Schmidt and Jenko when they go deep undercover at a local college. But when Jenko meets a kindred spirit on the football team, and Schmidt infiltrates the bohemian art major scene, they begin to question their partnership. Now they don\'t have to just crack the case - they have to figure out if they can have a mature relationship. If these two overgrown adolescents can grow from freshmen into real men, college might be the best thing that ever happened to them.',52.380982,188441614,112,'They\'re not 21 anymore','22 Jump Street',7.0,3319),(913,60000000,NULL,628,'en','Interview with the Vampire','A vampire relates his epic life story of love, betrayal, loneliness, and dark hunger to an over-curious reporter.',50.163785,223664608,123,'Drink from me and live forever','Interview with the Vampire',7.2,1516),(914,70000000,NULL,10201,'en','Yes Man','Carl Allen has stumbled across a way to shake free of post-divorce blues and a dead-end job: embrace life and say yes to everything.',43.849351,225990978,104,'One Word Can Change Everything.','Yes Man',6.4,1813),(915,50000000,'http://www.centralintelligencemovie.com/',302699,'en','Central Intelligence','After he reunites with an old pal through Facebook, a mild-mannered accountant is lured into the world of international espionage.',45.318703,216972543,107,'Saving the world takes a little Hart and a big Johnson','Central Intelligence',6.2,1650),(916,NULL,NULL,9441,'en','Stepmom','Jackie is a divorced mother of two. Isabel is the career minded girlfriend of Jackie’s ex-husband Luke, forced into the role of unwelcome stepmother to their children. But when Jackie discovers she is ill, both women realise they must put aside their differences to find a common ground and celebrate life to the fullest, while they have the chance.',16.368283,NULL,124,'Be there for the joy. Be there for the tears. Be there for each other.','Stepmom',6.9,277),(917,50000000,'http://daddyshomemovie.tumblr.com/',274167,'en','Daddy\'s Home','The story of a mild-mannered radio executive (Ferrell) who strives to become the best stepdad ever to his wife\'s two children, but complications ensue when their freewheeling, freeloading real father arrives, forcing stepdad to compete for the affection of the kids.',38.616744,242786137,96,'Choose your Daddy','Daddy\'s Home',5.8,854),(918,50000000,'http://movies.disney.com/into-the-woods/',224141,'en','Into the Woods','In a woods filled with magic and fairy tale characters, a baker and his wife set out to end the curse put on them by their neighbor, a spiteful witch.',65.901610,212902372,125,'Be careful what you wish for...','Into the Woods',5.6,1652),(919,45000000,'http://theinsideman.net',388,'en','Inside Man','Bank robber Dalton Russell enters a Manhattan bank, locks the doors and takes hostages, working methodically and without haste. Detective Frazier is assigned to negotiate, but his mind is occupied with the corruption charges he is facing. With an army of police surrounding the bank, the thief, the cop and a high-profile \'fixer\' enter high-stakes negotiations.',45.220386,184376254,129,'It looked like the perfect bank robbery. But you can\'t judge a crime by its cover.','Inside Man',7.3,1630),(920,90000000,NULL,2112,'en','Payback','With friends like these, who needs enemies? That\'s the question bad guy Porter is left asking after his wife and partner steal his heist money and leave him for dead -- or so they think. Five months and an endless reservoir of bitterness later, Porter\'s partners and the crooked cops on his tail learn how bad payback can be.',17.457947,161626121,100,'No More Mr. Nice Guy.','Payback',6.7,548),(921,50000000,NULL,10329,'en','Congo','Eight people embark on an expedition into the Congo, a mysterious expanse of unexplored Africa where human greed and the laws of nature have gone berserk. When the thrill-seekers -- some with ulterior motives -- stumble across a race of killer apes.',10.755847,152022101,109,'Where you are the endangered species.','Congo',5.0,213),(922,50000000,'http://www.weboughtazoo.com/',74465,'en','We Bought a Zoo','Benjamin has lost his wife and, in a bid to start his life over, purchases a large house that has a zoo – welcome news for his daughter, but his son is not happy about it. The zoo is need of renovation and Benjamin sets about the work with the head keeper and the rest of the staff, but, the zoo soon runs into financial trouble.',38.629763,120081841,124,'A True Zoo Story','We Bought a Zoo',6.5,909),(923,50000000,'http://knowing-themovie.com/',13811,'en','Knowing','A teacher opens a time capsule that has been dug up at his son\'s elementary school; in it are some chilling predictions -- some that have already occurred and others that are about to -- that lead him to believe his family plays a role in the events that are about to unfold.',32.693093,155446362,121,'Knowing is everything...','Knowing',5.9,1486),(924,50000000,NULL,6877,'en','Failure to Launch','Tripp, an attractive man in his thirties, is still living with his parents Al and Sue. Tripp\'s best friends Demo and Ace are also still living in their parents\' homes and seem proud of it. Al and Sue are not happy, however, and are fascinated when friends whose adult son has recently moved away from home reveal they hired an expert to arrange the matter and couldn\'t be happier with the result.',18.806031,88715192,97,'To leave the nest, some men just need a little push.','Failure to Launch',5.5,399),(925,50000000,NULL,10320,'en','The Ring Two','Rachel Keller must prevent evil Samara from taking possession of her son\'s soul.',32.233713,161451538,110,'The dead don\'t sleep.','The Ring Two',5.4,632),(926,50000000,'http://crazystupidlove.warnerbros.com/index.html',50646,'en','Crazy, Stupid, Love.','Cal Weaver is living the American dream. He has a good job, a beautiful house, great children and a beautiful wife, named Emily. Cal\'s seemingly perfect life unravels, however, when he learns that Emily has been unfaithful and wants a divorce. Over 40 and suddenly single, Cal is adrift in the fickle world of dating. Enter, Jacob Palmer, a self-styled player who takes Cal under his wing and teaches him how to be a hit with the ladies.',37.990705,142851197,118,'This Is Stupid','Crazy, Stupid, Love.',7.0,2443),(927,50000000,NULL,8920,'en','Garfield','Garfield, the fat, lazy, lasagna lover, has everything a cat could want. But when Jon, in an effort to impress the Liz - the vet and an old high-school crush - adopts a dog named Odie and brings him home, Garfield gets the one thing he doesn\'t want. Competition.',17.667826,200804534,80,'Get ready for frisky business.','Garfield',5.2,820),(928,60000000,NULL,13673,'en','Christmas with the Kranks','Luther Krank is fed up with the commerciality of Christmas; he decides to skip the holiday and go on a vacation with his wife instead. But when his daughter decides at the last minute to come home, he must put together a holiday celebration.',9.225166,NULL,99,'No! Ho! Ho!','Christmas with the Kranks',5.2,193),(929,50000000,'http://www.moneyball-movie.com/',60308,'en','Moneyball','The story of Oakland Athletics general manager Billy Beane\'s successful attempt to put together a baseball team on a budget, by employing computer-generated analysis to draft his players.',46.180421,110206216,133,'What are you really worth?','Moneyball',7.0,1381),(930,50000000,NULL,6950,'en','Outbreak','A deadly airborne virus finds its way into the USA and starts killing off people at an epidemic rate. Col Sam Daniels\' job is to stop the virus spreading from a small town, which must be quarantined, and to prevent an over reaction by the White House.',30.397496,189859560,127,'This animal carries a deadly virus... and the greatest medical crisis in the world is about to happen.','Outbreak',6.3,513),(931,50000000,NULL,225574,'en','Non-Stop','Bill Marks is a burned-out veteran of the Air Marshals service. He views the assignment not as a life-saving duty, but as a desk job in the sky. However, today\'s flight will be no routine trip. Shortly into the transatlantic journey from New York to London, he receives a series of mysterious text messages ordering him to have the government transfer $150 million into a secret account, or a passenger will die every 20 minutes.',83.295796,222809600,106,'The hijacking was just the beginning.','Non-Stop',6.8,2268),(932,50000000,NULL,13836,'en','Race to Witch Mountain','A taxi driver gets more than he bargained for when he picks up two teen runaways. Not only does the pair possess supernatural powers, but they\'re also trying desperately to escape people who have made them their targets.',23.935053,106303988,98,'The race is on','Race to Witch Mountain',5.5,509),(933,54000000,'http://vforvendetta.warnerbros.com/',752,'en','V for Vendetta','In a world in which Great Britain has become a fascist state, a masked vigilante known only as \'V\' conducts guerrilla warfare against the oppressive British government. When \'V\' rescues a young woman from the secret police, he finds in her an ally with whom he can continue his fight to free the people of Britain.',84.630969,132511035,132,'People should not be afraid of their governments. Governments should be afraid of their people.','V for Vendetta',7.7,4442),(934,50000000,NULL,6038,'en','Shanghai Knights','The dynamic duo of Chon Wang and Roy O\'Bannon return for another crazy adventure. This time, they\'re in London to avenge the murder of Chon\'s father, but end up on an even bigger case. Chon\'s sister is there to do the same, but instead unearths a plot to kill the royal family. No one believes her, though, and it\'s up to Chon and Roy (who has romance on his mind) to prove her right.',16.251204,88323487,115,'A Royal Kick In The Arse.','Shanghai Knights',6.0,692),(935,50000000,NULL,9975,'en','Curious George','When The Man in the Yellow Hat befriends Curious George in the jungle, they set off on a non-stop, fun-filled journey through the wonders of the big city toward the warmth of true friendship.',9.894346,69834815,86,'Get Carried Away With The Cutest Little Monkey Around!','Curious George',6.2,106),(936,50000000,NULL,11451,'en','Herbie Fully Loaded','Maggie Peyton, the new owner of Number 53 - the free-wheelin\' Volkswagen bug with a mind of its own - puts the car through its paces on the road to becoming a NASCAR competitor.',12.050755,66002004,101,'Start your engines...','Herbie Fully Loaded',5.1,542),(937,50000000,NULL,12103,'en','Don\'t Say a Word','When the daughter of a psychiatrist is kidnapped, he\'s horrified to discover that the abductors\' demand is that he break through to a post traumatic stress disorder suffering young woman who knows a secret..',11.596207,100020092,113,'...I\'ll never tell.','Don\'t Say a Word',6.0,220),(938,50000000,'http://www.hanselandgretelmovie.com/',60304,'en','Hansel & Gretel: Witch Hunters','After getting a taste for blood as children, Hansel and Gretel have become the ultimate vigilantes, hell-bent on retribution. Now, unbeknownst to them, Hansel and Gretel have become the hunted, and must face an evil far greater than witches... their past.',53.027870,224803475,88,'Classic tale. New twist.','Hansel & Gretel: Witch Hunters',5.7,3239),(939,50000000,NULL,2251,'en','Unfaithful','Connie is a wife and mother whose 11-year marriage to Edward has lost its sexual spark. When Connie literally runs into handsome book collector Paul, he sweeps her into an all-consuming affair. But Edward soon becomes suspicious and decides to confront the other man.',14.382253,119137784,124,'Where do you go when you\'ve gone too far?','Unfaithful',6.3,276),(940,50000000,'http://www.findnumberfour.com/',46529,'en','I Am Number Four','A teenage fugitive with an incredible secret races to stay one step ahead of the mysterious forces seeking destroy him in this sci-fi action thriller. With three dead and one on the run, the race to find the elusive Number Four begins. Outwardly normal teen John Smith never gets too comfortable in the same identity, and along with his guardian, Henri, he is constantly moving from town to town. With each passing day, John gains a stronger grasp on his extraordinary new powers, and his bond to the beings that share his fantastic fate grows stronger.',43.450266,144492830,109,'Three like him have already been killed…he is Number Four.','I Am Number Four',5.9,1567),(941,50000000,'http://syrianamovie.warnerbros.com/',231,'en','Syriana','The Middle Eastern oil industry is the backdrop of this tense drama, which weaves together numerous story lines. Bennett Holiday is an American lawyer in charge of facilitating a dubious merger of oil companies, while Bryan Woodman, a Switzerland-based energy analyst, experiences both personal tragedy and opportunity during a visit with Arabian royalty. Meanwhile, veteran CIA agent Bob Barnes uncovers an assassination plot with unsettling origins.',16.871194,94000000,128,'Everything is connected.','Syriana',6.3,451),(942,50000000,'http://www.thirteenhoursmovie.com/',300671,'en','13 Hours: The Secret Soldiers of Benghazi','An American Ambassador is killed during an attack at a U.S. compound in Libya as a security team struggles to make sense out of the chaos.',42.526529,69411370,144,'When everything went wrong, six men had the courage to do what was right.','13 Hours: The Secret Soldiers of Benghazi',7.0,938),(943,50000000,'http://www.bookoflifemovie.com/',228326,'en','The Book of Life','The journey of Manolo, a young man who is torn between fulfilling the expectations of his family and following his heart. Before choosing which path to follow, he embarks on an incredible adventure that spans three fantastical worlds where he must face his greatest fears.',34.890999,97437106,95,NULL,'The Book of Life',7.3,755),(944,45000000,NULL,9754,'en','Firewall','State-of-the-art security system creator, Jack Stanfield has cemented his reputation as a man who\'s thought of everything. But when a criminal finds a way into Jack\'s personal life, everything Jack holds dear is suddenly at stake.',18.186026,82800000,105,'Nothing Is More Dangerous Than A Man With Everything To Lose.','Firewall',5.6,267),(945,50000000,NULL,66,'en','Absolute Power','A master thief coincidentally is robbing a house where a murder in which the President of The United States is involved occurs in front of his eyes. He is forced to run yet may hold evidence that could convict the President. A political thriller from and starring Clint Eastwood and based on a novel by David Baldacci.',13.576765,50068310,121,'Corrupts Absolutely.','Absolute Power',6.4,223),(946,50000000,NULL,4421,'en','G.I. Jane','A female Senator succeeds in enrolling a woman into Combined Reconnaissance Team training where everyone expects her to fail.',19.434672,48169156,125,'Failure is not an option.','G.I. Jane',6.0,395),(947,50000000,NULL,2649,'en','The Game','In honor of his birthday, San Francisco banker Nicholas Van Orton, a financial genius and a coldhearted loner, receives an unusual present from his younger brother, Conrad -- a gift certificate to play a unique kind of game. In nearly a nanosecond, Nicholas finds himself consumed by a dangerous set of ever-changing rules, unable to distinguish where the charade ends and reality begins.',62.925175,109423648,129,'What do you get for the man who has everything?','The Game',7.5,1506),(948,50000000,'http://www.sonypictures.com/homevideo/silenthill/',588,'en','Silent Hill','The eerie and deserted ghost town of Silent Hill draws a young mother desperate to find a cure for her only child\'s illness. Unable to accept the doctor\'s diagnosis that her daughter should be permanently institutionalized for psychiatric care, Rose flees with her child, heading for the abandoned town in search of answers – and ignoring the protests of her husband. It\'s soon clear this place is unlike anywhere she\'s ever been. It\'s smothered by fog, inhabited by a variety of strange beings and periodically overcome by a living \'darkness\' that literally transforms everything it touches. As Rose searches for her little girl, she begins to learn the history of the strange town and realizes that her daughter is just a pawn in a larger game.',32.927994,97607453,125,'We\'ve been expecting you.','Silent Hill',6.3,1067),(949,NULL,NULL,10393,'en','The Replacements','Maverick old-guard coach Jimmy McGinty is hired in the wake of a players\' strike to help the Washington Sentinels advance to the playoffs. But that impossible dream hinges on whether his replacements can hunker down and do the job. So, McGinty dusts off his secret dossier of ex-players who never got a chance (or screwed up the one they were given) and knits together a bad-dream team of guys who just may give the Sentinels their title shot.',14.837288,NULL,118,'Throw the ball. Catch the girl. Keep it simple.','The Replacements',6.1,203),(950,50000000,'http://www.americanreunionmovie.com/',71552,'en','American Reunion','The characters we met a little more than a decade ago are returning to East Great Falls for their high-school reunion. In one long-overdue weekend, they will discover what has changed, who hasn’t and that time and distance can’t break the bonds of friendship. It was summer 1999 when four small-town Michigan boys began a quest to lose their virginity. In the years that have passed, Jim and Michelle married while Kevin and Vicky said goodbye. Oz and Heather grew apart, but Finch still longs for Stifler’s mom. Now these lifelong friends have come home as adults to reminisce about – and get inspired by – the hormonal teens who launched a comedy legend.',39.920035,234989584,113,'Save the best piece for last.','American Reunion',6.1,1611),(951,50000000,NULL,9631,'en','The Negotiator','The police try to arrest expert hostage negotiator Danny Roman, who insists he\'s being framed for his partner\'s murder in what he believes is an elaborate conspiracy. Thinking there\'s evidence in the Internal Affairs offices that might clear him, he takes everyone in the office hostage and demands that another well-known negotiator be brought in to handle the situation and secretly investigate the conspiracy.',28.725621,44547681,140,'He frees hostages for a living. Now he\'s taking hostages to survive.','The Negotiator',6.8,582),(952,50000000,NULL,216282,'en','Into the Storm','The town of Silverton is in one day destroyed by the unprecedented power of a series of tornadoes. The population is at the mercy of the unpredictable and deadly cyclones, while hunters warn that the worst is yet to come. Most people find shelter, but some just go to the tornado for that one, unique shot.',20.566554,160602194,89,'Prepare to go','Into the Storm',5.8,817),(953,50000000,NULL,306,'en','Beverly Hills Cop III','Back in sunny southern California and on the trail of two murderers, Axel Foley again teams up with LA cop Billy Rosewood. Soon, they discover that an amusement park is being used as a front for a massive counterfeiting ring – and it\'s run by the same gang that shot Billy\'s boss.',20.333953,119208989,104,NULL,'Beverly Hills Cop III',5.5,434),(954,50000000,NULL,928,'en','Gremlins 2: The New Batch','Young sweethearts Billy and Kate move to the Big Apple, land jobs in a high-tech office park and soon reunite with the friendly and lovable Gizmo. But a series of accidents creates a whole new generation of Gremlins. The situation worsens when the devilish green creatures invade a top-secret laboratory and develop genetically altered powers, making them even harder to destroy!',33.986370,41482207,106,'Here they grow again.','Gremlins 2: The New Batch',6.2,652),(955,50000000,'http://thejudgemovie.com/',205587,'en','The Judge','A successful lawyer returns to his hometown for his mother\'s funeral only to discover that his estranged father, the town\'s judge, is suspected of murder.',42.472324,83719388,141,'Defend your Honor.','The Judge',7.2,1417),(956,50000000,NULL,6623,'en','The Peacemaker','When a train carrying atomic warheads mysteriously crashes in the former Soviet Union, a nuclear specialist discovers the accident is really part of a plot to cover up the theft of the weapons. Assigned to help her recover the missing bombs is a crack Special Forces Colonel.',15.931084,NULL,124,'How do you get the world\'s attention?','The Peacemaker',5.8,255),(957,45000000,NULL,1577,'en','Resident Evil: Apocalypse','As the city is locked down under quarantine, Alice joins a small band of elite soldiers, enlisted to rescue the missing daughter of the creator of the mutating T-virus. It\'s a heart-pounding race against time as the group faces off against hordes of blood- thirsty zombies, stealthy Lickers, mutant canines and the most sinister foe yet.',29.880122,129394835,94,'You\'re all going to die.','Resident Evil: Apocalypse',6.1,1267),(958,50000000,NULL,9801,'en','Bridget Jones: The Edge of Reason','Bridget Jones is becoming uncomfortable in her relationship with Mark Darcy. Apart from discovering that he\'s a conservative voter, she has to deal with a new boss, a strange contractor and the worst vacation of her life.',28.803802,40203020,108,'Same Bridget. Brand new diary.','Bridget Jones: The Edge of Reason',6.1,750),(959,50000000,NULL,2116,'en','Out of Time','Matt Lee Whitlock, respected chief of police in small Banyan Key, Florida, must solve a vicious double homicide before he himself falls under suspicion. Matt Lee has to stay a few steps ahead of his own police force and everyone he\'s trusted in order to find out the truth.',14.993459,55495563,105,'The Clock Is Ticking...','Out of Time',6.1,298),(960,50000000,NULL,9624,'en','On Deadly Ground','Forrest Taft is an environmental agent who works for the Aegis Oil Company in Alaska. Aegis Oil\'s corrupt CEO, Michael Jennings, is the kind of person who doesn\'t care whether or not oil spills into the ocean or onto the land, just as long as it\'s making money for him.',9.114168,49000000,102,'His Battle To Save The Alaskan Wilderness And Protect Its People Can Only Be Won...','On Deadly Ground',4.5,104),(961,50000000,'http://www.miramax.com/movie/the-adventures-of-sharkboy-and-lavagirl/',14199,'en','The Adventures of Sharkboy and Lavagirl','Everyone always knew that Max had a wild imagination, but no one believed that his wildest creations -- a boy raised by watchful great white sharks and a girl with the force of a volcano -- were real. Now, these two pint-sized action masters will show Max that even an ordinary kid has what it takes to be extraordinary.',12.311010,69425966,92,'Smaller heroes. Just as super.','The Adventures of Sharkboy and Lavagirl',4.4,269),(962,40000000,NULL,1907,'en','The Beach','Twenty-something Richard travels to Thailand and finds himself in possession of a strange map. Rumours state that it leads to a solitary beach paradise, a tropical bliss - excited and intrigued, he sets out to find it.',41.362082,144056873,119,'Somewhere on this planet it must exist.','The Beach',6.3,1233),(963,50000000,NULL,4599,'en','Raising Helen','Helen Harris has a glamorous, big-city life working for one of New York\'s hottest modeling agencies. But suddenly her free-spirited life gets turned upside down when she must chose between the life she\'s always loved, and the new loves of her life!',13.298205,49718611,119,'Her uptown life gets turned inside out!','Raising Helen',5.9,189),(964,40000000,'http://ninja-assassin-movie.warnerbros.com/',22832,'en','Ninja Assassin','Ninja Assassin follows Raizo (Rain), one of the deadliest assassins in the world. Taken from the streets as a child, he was transformed into a trained killer by the Ozunu Clan, a secret society whose very existence is considered a myth. But haunted by the merciless execution of his friend by the Clan, Raizo breaks free from them and vanishes. Now he waits, preparing to exact his revenge.',19.085403,60462347,99,'Fear not the weapon, but the hand that wields it.','Ninja Assassin',6.2,371),(965,50000000,NULL,10390,'en','For Love of the Game','A baseball legend almost finished with his distinguished career at the age of forty has one last chance to prove who he is, what he is capable of, and win the heart of the woman he has loved for the past four years.',9.622345,NULL,137,'Billy Chapel must choose between the woman he loves and the game he lives for.','For Love of the Game',6.3,88),(966,50000000,NULL,9879,'en','Striptease','Bounced from her job, Erin Grant needs money if she\'s to have any chance of winning back custody of her child. But, eventually, she must confront the naked truth: to take on the system, she\'ll have to take it all off. Erin strips to conquer, but she faces unintended circumstances when a hound dog of a Congressman zeroes in on her and sharpens the shady tools at his fingertips, including blackmail and murder.',11.106006,113309743,115,'Some People Get Into Trouble No Matter What They WEAR.','Striptease',4.4,205),(967,50000000,'http://www.themarmadukemovie.com/',38579,'en','Marmaduke','When Phil and Debbie Winslow relocate from their native Kansas to the sunny climes of Orange County, their big-hearted, havoc-wreaking Great Dane gets a taste of the dog\'s life, California-style.',12.256220,83761844,87,'Live Large','Marmaduke',5.0,149),(968,50000000,'http://hereafter.warnerbros.com/',44603,'en','Hereafter','A supernatural thriller centered on three people -- a blue-collar American, a French journalist and a London school boy -- who are touched by death in different ways.',13.365715,105197635,129,'Touched by death. Changed by life.','Hereafter',5.8,510),(969,50000000,NULL,11892,'en','Murder by Numbers','Tenacious homicide detective Cassie Mayweather and her still-green partner are working a murder case, attempting to profile two malevolently brilliant young men: cold, calculating killers whose dark secrets might explain their crimes.',16.167093,56714147,120,'The only flaw in their plan was her.','Murder by Numbers',6.0,268),(970,50000000,NULL,9691,'en','Assassins','Assassin Robert Rath arrives at a funeral to kill a prominent mobster, only to witness a rival hired gun complete the job for him -- with grisly results. Horrified by the murder of innocent bystanders, Rath decides to take one last job and then return to civilian life. But finding his way out of the world of contract killing grows ever more dangerous as Rath falls for his female target and becomes a marked man himself.',23.073933,30303072,132,'In the shadows of life, In the business of death, One man found a reason to live...','Assassins',6.0,387),(971,50000000,'http://hannibalrising.com/',1248,'en','Hannibal Rising','The story of the early, murderous roots of the cannibalistic killer, Hannibal Lecter – from his hard-scrabble Lithuanian childhood, where he witnesses the repulsive lengths to which hungry soldiers will go to satiate themselves, through his sojourn in France, where as a med student he hones his appetite for the kill.',6.567065,82169884,121,'It started with revenge.','Hannibal Rising',6.0,654),(972,50000000,NULL,12220,'en','The Story of Us','Ben and Katie Jordan are a married couple who go through hard times in fifteen years of marriage.',6.225770,58900031,95,NULL,'The Story of Us',5.9,75),(973,44000000,NULL,72710,'en','The Host','A parasitic alien soul is injected into the body of Melanie Stryder. Instead of carrying out her race\'s mission of taking over the Earth, \"Wanda\" (as she comes to be called) forms a bond with her host and sets out to aid other free humans.',42.933027,63327201,125,'You will be one of us','The Host',6.0,1817),(974,50000000,NULL,10782,'en','Basic','A DEA agent investigates the disappearance of a legendary Army ranger drill sergeant and several of his cadets during a training exercise gone severely awry.',19.226763,42792561,98,'Deception is their most deadly weapon.','Basic',6.2,286),(975,50000000,NULL,9573,'en','Blood Work','Still recovering from a heart transplant, a retired FBI profiler returns to service when his own blood analysis offers clues to the identity of a serial killer.',10.089065,26199517,110,'He\'s a heartbeat away from catching the killer','Blood Work',6.1,206),(976,50000000,'http://www.sonypictures.com/movies/theinternational/site/',4959,'en','The International','An interpol agent and an attorney are determined to bring one of the world\'s most powerful banks to justice. Uncovering money laundering, arms trading, and conspiracy to destabilize world governments, their investigation takes them from Berlin, Milan, New York and Istanbul. Finding themselves in a chase across the globe, their relentless tenacity puts their own lives at risk.',13.391833,60161391,118,'Is your money making a killing?','The International',6.0,368),(977,50000000,'http://www.theofficialjohncarpenter.com/escape-from-la/',10061,'en','Escape from L.A.','This time, a cataclysmic temblor hits Los Angeles, turning it into an island. The president views the quake as a sign from above, expels Los Angeles from the country and makes it a penal colony for those found guilty of moral crimes. When his daughter, part of a resistance movement, steals the control unit for a doomsday weapon, Snake again gets tapped to save the day.',21.637234,42277365,97,'Snake Is Back.','Escape from L.A.',5.6,373),(978,70000000,'https://www.warnerbros.com/iron-giant',10386,'en','The Iron Giant','In the small town of Rockwell, Maine in October 1957, a giant metal machine befriends a nine-year-old boy and ultimately finds its humanity by unselfishly saving people from their own fears and prejudices.',61.245957,23159305,86,'It came from outer space!','The Iron Giant',7.6,1436),(979,50000000,NULL,421,'en','The Life Aquatic with Steve Zissou','Wes Anderson’s incisive quirky comedy build up stars complex characters like in ‘The Royal Tenenbaums’ with Bill Murray on in the leading role. An ocean adventure documentary film maker Zissou is put in all imaginable life situations and a tough life crisis as he attempts to make a new film about capturing the creature that caused him pain.',25.237969,34808403,119,'The deeper you go, the weirder life gets.','The Life Aquatic with Steve Zissou',7.1,775),(980,50000000,'http://stxmovies.com/freestateofjones/',316152,'en','Free State of Jones','In 1863, Mississippi farmer Newt Knight serves as a medic for the Confederate Army. Opposed to slavery, Knight would rather help the wounded than fight the Union. After his nephew dies in battle, Newt returns home to Jones County to safeguard his family but is soon branded an outlaw deserter. Forced to flee, he finds refuge with a group of runaway slaves hiding out in the swamps. Forging an alliance with the slaves and other farmers, Knight leads a rebellion that would forever change history.',21.589393,25035950,139,'Based on the incredible true story.','Free State of Jones',6.6,428),(981,50000000,NULL,11615,'en','The Life of David Gale','A man against capital punishment is accused of murdering a fellow activist and is sent to death row.',22.442241,38955598,130,'The crime is clear. The truth is not.','The Life of David Gale',7.3,480),(982,40000000,NULL,13498,'en','Man of the House','Texas Ranger Roland Sharp is assigned to protect the only witnesses to the murder of a key figure in the prosecution of a drug kingpin -- a group of University of Texas cheerleaders. Sharp must now go undercover as an assistant cheerleading coach and move in with the young women.',6.004422,NULL,100,'Protecting witnesses is a challenge. Living with them is impossible.','Man of the House',5.4,120),(983,50000000,NULL,241554,'en','Run All Night','Brooklyn mobster and prolific hit man Jimmy Conlon has seen better days. Longtime best friend of a mob boss, Jimmy is haunted by the sins of his past—as well as a dogged police detective who’s been one step behind Jimmy for 30 years. But when Jimmy’s estranged son becomes a target, Jimmy must make a choice between the crime family he chose and the real family he abandoned long ago. Now, with nowhere safe to turn, Jimmy has just one night to figure out exactly where his loyalties lie and to see if he can finally make things right.',74.646530,71561644,114,'No sin goes unpunished','Run All Night',6.3,1148),(984,51500000,'http://www.focusfeatures.com/easternpromises/',2252,'en','Eastern Promises','A Russian teenager living in London who dies during childbirth leaves clues to a midwife in her journal that could tie her child to a rape involving a violent Russian mob family.',35.481169,55112356,100,'Every sin leaves a mark.','Eastern Promises',7.2,848),(985,50000000,NULL,11968,'en','Into the Blue','When they take some friends on an extreme sport adventure, the last thing Jared and Sam expect to see below the shark-infested waters is a legendary pirate ship rumored to contain millions of dollars in gold. But their good fortune is short-lived, as a ruthless gang of criminals gets word of what they have uncovered.',14.723467,44434439,110,'Treasure has its price.','Into the Blue',5.8,458),(986,60000000,NULL,10047,'fr','Joan of Arc','In 1429 a teenage girl from a remote French village stood before her King with a message she claimed came from God; that she would defeat the world\'s greatest army and liberate her country from its political and religious turmoil. Following her mission to reclaim god\'s dimished kingdom - through her amazing victories until her violent and untimely death.',21.084542,66976317,148,NULL,'The Messenger: The Story of Joan of Arc',6.2,367),(987,49900000,'http://www.yourhighnessmovie.net/',38319,'en','Your Highness','A fantasy movie about an arrogant, lazy prince and his more heroic brother who must complete a quest in order to save their father\'s kingdom.',21.408222,26121638,102,'Get your quest on.','Your Highness',5.2,501),(988,50000000,NULL,69668,'en','Dream House','Publisher, Will Atenton quits a lucrative job in New York to relocate his wife, Libby and their daughters to a quaint town in New England. However, as they settle into their home the Atentons discover that a woman and her children were murdered there, and the surviving husband is the town\'s prime suspect. With help from a neighbor who was close to the murdered family, Will pieces together a horrifying chain of events.',19.267479,38502340,84,'Once upon a time, there were two little girls who lived in a house.','Dream House',5.8,391),(989,50000000,NULL,9770,'en','Mad City','A misguided museum guard who loses his job and then tries to get it back at gunpoint is thrown into the fierce world of ratings-driven TV gone mad.',3.314004,10541523,114,'One man will make a mistake. The other will make it a spectacle.','Mad City',5.9,81),(990,50000000,NULL,11212,'en','Baby\'s Day Out','Baby Bink couldn\'t ask for more; he has adoring (if somewhat sickly-sweet) parents, he lives in a huge mansion, and he\'s just about to appear in the social pages of the paper. Unfortunately, not everyone in the world is as nice as Baby Bink\'s parents; especially the three enterprising kidnapers who pretend to be photographers from the newspaper. Successfully kidnaping Baby Bink, they have a harder time keeping hold of the rascal, who not only keeps one step ahead of them, but seems to be more than a little bit smarter than the three bumbling criminals.',21.312186,16671505,99,'No bib. No crib. No problem.','Baby\'s Day Out',5.8,274),(991,50000000,NULL,10533,'en','The Scarlet Letter','Set in puritanical Boston in the mid 1600s, the story of seamstress Hester Prynne, who is outcast after she becomes pregnant by a respected reverend. She refuses to divulge the name of the father, is \"convicted\" of adultery and forced to wear a scarlet \"A\" until an Indian attack unites the Puritans and leads to a reevaluation of their laws and morals.',7.442680,10382407,135,'When intimacy is forbidden and passion is a sin, love is the most defiant crime of all.','The Scarlet Letter',5.5,108),(992,22000000,'http://www.fairgame-movie.com/',38363,'en','Fair Game','Wife and mother Valerie Plame (Naomi Watts) has a double life as a CIA operative, hiding her vocation from family and friends. Her husband, Joseph Wilson (Sean Penn), writes a controversial article in The New York Times, refuting stories about the sale of enriched uranium to Iraq, Then Valerie\'s secret work and identity is leaked to the press. With her cover blown and other people endangered, Valerie\'s career and personal life begin to unravel.',12.549490,24188922,108,'Wife. Mother. Spy.','Fair Game',6.5,235),(993,50000000,NULL,9923,'en','Domino','The daughter of actor, Laurence Harvey turns away from her career as a Ford model to become a bounty hunter.',18.394571,22944502,127,'Heads You Live... Tails You Die.','Domino',6.0,444),(994,50000000,NULL,11863,'en','Jade','Someone does a nasty hatchet job on a San Fransisco big noise and the Assistant D.A. takes charge of the investigation. Through a web of blackmail and prostitution involving the Governor, an old lover of the law man emerges as a prime suspect and he has to deal with his personal feelings as well as the case.',8.189406,9851610,95,'Some fantasies go too far.','Jade',5.2,44),(995,50000000,'http://gamerthemovie.com',18501,'en','Gamer','Mind-control technology has taken society by a storm, a multiplayer on-line game called \"Slayers\" allows players to control human prisoners in mass-scale. Simon (Lerman) controls Kable (Butler), the online champion of the game. Kable\'s ultimate challenge becomes regaining his identity and independence by defeating the game\'s mastermind (Hall).',27.631262,40828540,95,'In the near future, you don\'t live to play... you\'ll play to live.','Gamer',5.6,760),(996,60000000,NULL,109491,'en','Beautiful Creatures','Ethan Wate just wants to get to know Lena Duchannes better, but unbeknownst to him, Lena has strange powers.  As Lena\'s 16th birthday approaches she might decide her fate, to be good or evil.  A choice which will impact her relationship forever.',40.721373,60052138,124,'Dark secrets will come to light.','Beautiful Creatures',5.6,984),(997,55000000,NULL,9275,'en','Death to Smoochy','Tells the story of Rainbow Randolph, the corrupt, costumed star of a popular children\'s TV show, who is fired over a bribery scandal and replaced by squeaky-clean Smoochy, a puffy fuscia rhinoceros. As Smoochy catapults to fame - scoring hit ratings and the affections of a network executive - Randolph makes the unsuspecting rhino the target of his numerous outrageous attempts to exact revenge and reclaim his status as America\'s sweetheart.',11.329727,NULL,109,'Get ready for an unexpected hit.','Death to Smoochy',5.9,132),(998,50000000,'http://www.zoolander.com/',329833,'en','Zoolander 2','Derek and Hansel are modelling again when an opposing company attempts to take them out from the business.',37.253774,55969000,100,'Long time no Z','Zoolander 2',4.7,797),(999,50000000,NULL,12634,'en','The Big Bounce','A small-time con artist and a Hawaiian real estate developer\'s mischievous, enterprising mistress team up for a potential $200,000 score.',6.397388,6808550,88,'It\'s all in who you trust','The Big Bounce',5.0,76),(1000,60000000,NULL,10416,'en','What Planet Are You From?','A highly-evolved planet, whose denizens feel no emotion and reproduce by cloning, plans to take over Earth from the inside by sending an operative, fashioned with a humming, mechanical penis, to impregnate an earthling and stay until the birth. The alien, Harold Anderson, goes to Phoenix as a banker and sets to work finding a mate. His approaches to women are inept, and the humming phallus doesn\'t help, but on the advice of a banking colleague, he cruises an AA meeting, meets Susan, and somehow convinces her to marry. The clock starts to tick: will she conceive, have a baby, and lose Harold (and the child) to his planet before he discovers emotion and starts to care?',2.275331,NULL,105,'To save his planet, an alien must find a woman on Earth to have his baby. There\'s just one problem.','What Planet Are You From?',5.4,37);
